    ['$(missioncolor:【伊斯坦堡】)是奥斯曼人的首都，濒临“黄金水道”——马尔马拉海，那里进可攻退可守，形势对我们不利。我们必须攻占$(missioncolor:【塞浦路斯】)和$(missioncolor:【雅典】)才能无后顾之忧。'] = '$(missioncolor: 이 라 크 스 텐 버그 사육 하 고 있다 는 오 스 만 명) 의 수도 를 망 황금 물길 \' 인 마 르 마 라 바다, 그곳 에 가능 할 지 를 공격하다 퇴 정세 에 대한 불 리 해 지고 있다.우리 야 (missioncolor: 공략 $$키 프로 스) 과 사육 하 고 있다 (missioncolor: 아 테 네 괴뢰 호 전광 들이 걱정 없이) 해 야 했 다.', 
    ['$(missioncolor:【但泽】)是同盟最重要的工业港，也是后勤补给港口，攻占这里，汉萨同盟的实力至少会削弱一半！'] = '$(missioncolor: 지만 택 괴뢰 호 전광 들이) 은 동맹 을 가장 중요 한 공업 항 이자 후방 보급 항구 를 공략 한 이곳 을 사 동맹 의 실력 최소한 절반 을 약화 시 키 지 않 겠 다!', 
    ['$(missioncolor:【卑尔根】)是卢卡斯势力的门户，也是最重要的货运良港！只要占领它，就能切断北欧海盗50%以上的补给！'] = '$(missioncolor: 비굴하다 르 근) 는 괴뢰 호 전광 들이 대부분 3 세력 의 문호 를 넓 히 이자 가장 중요 한 화물 良港!점령 하 면 그것 을 벗 어 나 면 차단 북유럽 바이킹 족 의 50 % 이상 보급!', 
    ['$(missioncolor:【塞浦路斯】)是扼守亚欧非的海上要冲，历来是必争之地。只要占领它，就能切断奥斯曼人入侵地中海的命脉。'] = '$(missioncolor: 키 프로 스) 는 괴뢰 호 전광 들이 요충 을 지키다 아시아 유럽 비 의 해상 요충 에 는 전통적 으로 必争之地 이다.점령 하 면 그것 을 차단 하 면 오 스 만 명 침입 지중해 의 명맥 을 이어 가게 됐 다.', 
    ['$(missioncolor:【奥斯陆】)——来自于古老的挪威语，一个是“草地”一个是“神”的意思。我曾经在此处停泊，这里的漂亮的姑娘和艺术品一样的出名。'] = '$(missioncolor: 오 슬 로 괴뢰 호 전광 들이) 인 인식 의 차이 는 오래된 노 르 웨 어 를 첫째 는 잔디 \' 하나 는 \' 신 이 라 는 뜻 이다.내 가 이곳 에 정 박해 있 고 이곳 의 예 쁜 아가씨 와 예술품 처 럼 의 유명 해 졌 다.', 
    ['$(missioncolor:【威尼斯】)可是地中海最繁荣的商业之邦，那里云集来自世界各地的商人，确实是个不错的藏身之所。这个小家伙倒真会挑地方。'] = '$(missioncolor:) 베 네 치아 사육 하 고 있다. 그러나 지중해 가장 번영 의 상업 의 본, 거기 운집하다 세계 각지 에서 몰 려 온 상인 괜 찮 은 은신처 로 활용 된 다.사람 이 쓰 러 진 회 끄집어내다 곳 이다.', 
    ['$(missioncolor:【威尼斯】)可是地中海最繁荣的商业之邦，那里云集来自世界各地的商人，确实是个不错的藏身之所。这个小家伙可真会挑地方啊。'] = '$(missioncolor:) 베 네 치아 사육 하 고 있다. 그러나 지중해 가장 번영 의 상업 의 본, 거기 운집하다 세계 각지 에서 몰 려 온 상인 괜 찮 은 은신처 로 활용 된 다.사람 이 참 끄집어내다 지방 네 요.', 
    ['$(missioncolor:【斯德哥尔摩】)位于这三个港口的东侧，是敌人最重要的补给港口，只要占领它，就能让敌人战线无以为继！'] = '$(missioncolor: 피 스 톡 홀 름 괴뢰 호 전광 들이) 이 3 개 항구 의 동쪽 에 적 은 가장 중요 한 보급 항구 를 점령 하 면 그 자 신도 모 르 게 적 전선 정책 이 더!', 
    ['$(missioncolor:【里加】)地处北海与波罗的海的交通要冲，被称为“波罗的海跳动的心脏”，是汉萨同盟垄断北方贸易的枢纽！攻击它，就能切断敌人伸向半岛的触手！'] = '$(missioncolor: 리 가) 과 괴뢰 호 전광 들이 위치 북해 발 트 해 의 교통 요지 로 불 릴 정 도로 발 트 박동 의 심장 \'은 한 사 동맹 독점 북방 무역 의 거점!공격 에 가담 하 면 적이 한반도 의 촉수 차단 향!', 
    ['$(missioncolor:【阿姆斯特丹】)是汉萨同盟的贸易中心！汉萨同盟对于这里的防护绝对不能小视。或许有个简单的办法，集中火力，轰破大坝，这样……'] = '$(missioncolor: 암 스 테 르 담 괴뢰 호 전광 들이) 한 이 사 동맹 의 무역 센터!한 사 동맹 이곳 방 호 절대 버겁다.혹시 개 간 단 한 방법 을 집중 화력 펜스 를 댐 을 파 니...', 
    ['$(missioncolor:【阿尔金】)航线的确是暗礁密布，危险重重，但和凶残的海盗相比还是略逊一筹，有多少勇敢的冒险家躲过了暗礁却最终被残忍的海盗割断了脖子。'] = '$(missioncolor: 사육 하 고 있다 阿尔金) 노선 이 맞다 "고 암초 위험 한 치 앞 을 내다 보기 를 했 지만, 흉 폭 한 해적 보다 여전히 프 렌 들 리 (business friendly 얼마나 용 감 한 모험 가 암초 를 모면 했 지만 우승 이 잔 인 한 해적 끊 었 목 을 졸 랐 다.', 
    ['$(missioncolor:【马六甲】)位于马来半岛的西南侧，扼守马六甲海峡，地理位置险要，是兵家必争之地。这次战役我们必须和张保仔紧密配合，避免受到两面夹击。'] = '$(missioncolor: 말 라 카 괴뢰 호 전광 들이) 에 위치 한 말 레 이 반도 서남쪽 요충 을 지키다, 말 라 카 해협, 위치, 험 요하다 는 병가 必争之地 이다.이번 전투 와 张保仔 우리 야 잘 배합 을 피하 양면 협공 이다.', 
    ['$(missioncolor:【马六甲】)是东印度公司占领的最后一个港口了，易守难攻，地方难免会负隅顽抗，我们需要张保仔的帮助。'] = '$(missioncolor: 사육 하 고 있다 는 말 라 카) 동 인도 회사 를 점령 한 마지막 항구, 지방 이 어렵다 는 현실적 문제 를 피 할 수 없 을 것 으로 검색 문구, 우리 에게 필요 张保仔 의 도움 을 받 는 다.', 
    ['$(missioncolor:【马赛】)是个鱼龙混杂的地方，可以去那里打听打听。'] = 'missioncolor: $(마르세유) 는 괴뢰 호 전광 들이 뒤 섞 여 있 는 곳 으로 갈 수도 있 을 로부터 물어보다 서 알 아 보 도록 하세요.', 
    ['$(touch:["BOSS_REWARD_TAG"])商会已击垮大海盗，并搜获大量宝箱$(c:COLOR_GREEN)【点击查看】'] = '$(touch: []) \' \' BOSS_REWARD_TAG 상공 회의소 가 바다 를 무력화 하 고 도루 압수 획득하다 대량 보 상자 $(c) = COLOR_GREEN [경시 사육 하 고 있다.', 
    ['$(touch:["BOSS_TAG"])商会已开启对大海盗的讨伐$(c:COLOR_GREEN)【点击查看】'] = '$(touch: [] \' BOSS_TAG) \'에 대한 상공 회의소 가 열 리 는 바다 도루 토벌 $(c) = COLOR_GREEN [경시 사육 하 고 있다.', 
    ['$(touch:["GUILD_GIFT_TAG"])%s刚对商会进行了一笔捐献，所有人都可获得商会礼包，请船长前往$(c:COLOR_GREEN)【商会仓库】$(c:COLOR_YELLOW)领取。'] = '$(touch: []) \' \' GUILD_GIFT_TAG % 에 대한 상공 회의소 s 막 을 길이 막 막 했 던 기부 를 모두 가 혜택 을 받 을 수 있 도록 상공 회의소 선물 꾸러미 를 찾 아가 세요 선장 (c) = COLOR_GREEN $$[상공 회의소 창고 사육 하 고 있다 (c = COLOR_YELLOW) 발급 받 을 수 있다.', 
    ['$(touch:["GUILD_TASK_TAG","%s"])%s发布了多人任务《%s》，当前参与人数%s/3$(c:COLOR_GREEN)【点击查看】'] = '$(touch: [\' GUILD_TASK_TAG 같다 " 며 %s \']) %s 발표 명의 임무 \' s \'에 따 르 면 현재 % 참여 인원 3 %s / $(c) = COLOR_GREEN [경시 사육 하 고 있다.', 
    ['$(touch:["SHARE_TAG","%s"])$(c:COLOR_GREEN)%s$(c:COLOR_CREAM)的商品正在热销！前3位$(c:COLOR_GREEN)点击这条消息$(c:COLOR_CREAM)的小伙伴即可共享热销状态~'] = '$(touch: [\' SHARE_TAG 같다 " 며 "] %s (c) $$= COLOR_GREEN) %s (c = COLOR_CREAM) 의 상품 판매 되 고!전 3 위 (c) = COLOR_GREEN $$클 릭 이 기사 (c = COLOR_CREAM) 친구 어마 공유 히트 상태 에요', 
    ['$(usename) 船长，听说长官找你了，有什么要紧事吗？'] = '$(usename) 선장 을 듣 장관 널 찾 고, 무슨 요긴하다 일 이에 요?', 
    ['$(usename)!你竟敢击沉我的商船！你会后悔的！'] = '$(usename)!너 감히 격침 내 상선!당신 후회 할 거 냐!', 
    ['$(usename),我已经摸到了田鼠号了，我要先闪了哈。'] = '$(usename) 합 니 다, 저 는 함께 집어내다 으로 들쥐 호 라, 나 먼저 번쩍이다 하 였 다.', 
    ['$(usename),打完“田鼠号”这里会出现第二个对手哦。'] = '$(usename) 풀 타임 \' 들쥐 호가 이곳 이 제 2 의 상대 요.', 
    ['$(usename),打完第二个目标，这里又会出现一个对手呢。'] = '$(usename) 풀 두 번째 목표 를 이곳 에도 저승사자 가 상대 할 까.', 
    ['$(usename),现在说话的目标就是我啦，怎么样？觉得明显吗？'] = '$(usename), 지금 말 하는 것 이 목표, 어때요?눈 에 띄 게 생각 인가.', 
    ['$(usename),看看第一个目标“田鼠号”！接下来，我会不管诱饵的存在，直接以田鼠号为目标。'] = '$(usename), 예 를 들 면 첫 번째 목표 는 들쥐 호!이어 나 든 미끼 의 존재 를 직접 들쥐 번 을 목표 로 하 고 있다.', 
    ['$(usename),这里有一个坐标（100,800），敌人要过来这里的，看看它是否会一直亮着提示你吧。'] = '$(usename) 여 기에 한 좌표 (100,800) 을 적 하 러 오 겠 온 이 들 계속 여부 에 제시 하 게 요.', 
