    ['150朗姆酒'] = '150 朗姆酒', 
    ['1562年，浙江倭寇平息后，福建倭寇日甚，因兵将怯懦，戚继光受命领兵6000入闵，视福建倭寇情形决定先捣毁横屿倭寇。横屿之战中，戚继光智令将士以稻草填壕，遂打破横屿。'] = '1562 년 저장성 왜군 이 가 라 앉 자 푸 젠 왜군 일 에 이 병장 을 怯懦 戚继光 칼라 라 는 지령 을 받 고 투병 6000 입 민, 푸 젠 왜군 일의상황 일단 증오감 횡 정품 왜군 이다.횡 정품 의 경기에서 0-1 로 戚继光 싱 영장 장병 은 볏짚 등에 기입하다 도랑 을 이루다 깨 횡 란 타 우 섬 이다.', 
    ['1568年，弗朗西斯•德雷克与表兄霍金斯代理5艘贩奴船前往墨西哥受到风暴袭击，船只受到严重损坏。'] = '1568 년 프 랜 드 레 이크 와 사촌 형제들 호 킹 스 5 척 대리 판매하다 노예 선 멕시코 폭풍 공격 을 받 고 선박 크게 훼손 이다.', 
    ['1577年，德雷克再次从英国出发，乘着旗舰“金鹿”号直奔美洲沿岸，一路打劫西班牙商船，后在追击中逃往南方，在风暴中来到西班牙人也未曾到过的地方，这片汪洋大海，直到今天还被我们称为“德雷克海峡”。'] = '1577 년 영국 에서 떠 날 드 레 이크 다시 타 기함 \' 金鹿 호 는 곧바로 미주 연안 가십 갈취 로 스 페 인 상선 을 뒤 에서 바짝 추격 중 남방 으로 는 위 기의 폭풍 속 에 스 페 인 사람 도 본 적이 없 을 정 도로 지방 이 물 바다 에 선 지금 도 우리 가 \' 드 레 이크 해협 \' 다.', 
    ['1588年7月，英西两国正式开战，英军在弗朗西斯•德雷克建议下采取古老的火船战术，向敌方舰队发起突击。战后英国成为海上霸主，德雷克被封英格兰勋爵……'] = '1588 년 7 월 영 · 서 양국 공식 개전 영 국군 은 프 랜 드 레 이크 권유 로 취 화 선 오래된 전술 을 적 에게 함대 발의 돌격 이다.전후 영국 이 해상 패자 를 드 레 이크 됐 다. 잉 글 랜 드 勋爵....', 
    ['1591年，经宰相柳成龙举荐，47岁的李舜臣出任全罗左道水师节度使。当时，日本正积极着手进行侵朝战争准备，李舜臣临危受命，到职后加强海军建设，并建造铁甲“龟船”，为反侵略战争做好准备。'] = '1591 년 경 재상 유성 룡 제청 47 세 의 이순 신 부임 전라 좌 도 水师 전도 사가 된 다.당시 일본 에 나 서고 있 을 북 침 전쟁 을 준비 하 면서 깜짝 到职 후 이순 신 을 강화 하 고, 해군 건설 건조 철갑 거북선 을 반 침략 전쟁 준비 가 안 된 상태 다.', 
    ['1592年4月，日军水陆并进，占领大半个朝鲜半岛。在陆地屡战屡败的情况下，李舜臣部连战连捷。日方水陆并进计划受阻，利用朝鲜党争使计离间，李舜臣被革职下狱。重新被起用后，李舜臣重整舰队鏖战日军，一心坚持抗战。'] = '1592 년 4 월, 일본군 수륙 가 점령 국 토의 절반 한반도 다.육상 에서 연전 연패 의 상황 에서 이순 신 부 连战连捷 이다.일본 측 수륙 병행 하 면서 계획 에 차질 이 빚 어 질 을 이용 해 북한 당리 당 략 으로 계책 이간 이순 신 직권 면직 가 혼 다.재 기용 후 이순 신 재정비 함대 졸 전 일본군 에 발 만 동동 고집 항전 했 다.', 
    ['1592年，日本关白丰臣秀吉将日本国内群雄战乱平息，随即把目光投向了一水相隔的朝鲜国，希望将羸弱的朝鲜国纳入自己的权利版图。因为朝鲜国方面的求助，也因为唇齿相依的关系，中国明万历皇帝决定加入战争，援助朝鲜抵抗如日中天的日本。连番激烈的战事在朝鲜国境上进行，而作为对日本方面的物资补给及战事局势有着决定性影响的海上航区争夺战，亦在朝鲜沿海不断打响。'] = '1592 년 일본 도 요 토 미 히 데요 시 는 일본 내 닫 아 백 성은 전란 수습 하자, 눈 길이 었 一水 맞 닿 아 있 는 조선 국 희망 은 체육복 의 조선 국 편입 자신 들 의 권력 판 을 짜 야 한 다.북 한의 국 측 의 절규 를 도 입술 과 의 관계, 중국 의 명 만 력 황제 가 입하 기로 전쟁 을 지원 하 고, 북 한의 저항 에 떠 있 는 일본 이다.连番 치열 한 전장 에서 북한 국경 에서 진행 되 고, 일본 측 의 물자 보급 정세 및 전장 에 긍정적 인 영향 을 미 칠 의 해상 航区 쟁탈전 을 도 는 북한 해안 끊임없이 시작 됐 다.', 
    ['15级海盗'] = '15 급 해적', 
    ['1635年亨利·摩根出生在威尔士的一个大户人家的庄园，后作为契约工人前往加勒比海，很快在牙买加岛应征成为英军士兵。'] = '1635 년 헨 리 모 건 에서 태 어 난 웨 일 스 의 한 밭 집안 의 장원, 후 계약금 등 으로 근로자 를 빨리 찾 아 카 리 브 해 는 자 메이 카 섬 응모 가 영 국군 병사 들.', 
    ['1645年，郑芝龙、郑鸿逵兄弟在福州奉明唐王朱聿键为帝，年号隆武，郑芝龙被册封为南安候，负责南明所有军事事务，一时间权顷朝野，短短的几个月时光是郑芝龙政治生涯的顶峰。'] = '하는 대규모 년 郑芝龙, 郑鸿逵 형제 는 푸저우 봉 明唐 왕 朱聿键 을 통합 을 연호 룸 무 를 郑芝龙 사건 으로 울 버 햄 후보 를 담당 南明 모든 군사 실무 에 권 경각 여야 를 불과 몇 개월 시간 은 郑芝龙 정치 생활 의 정상 에 우뚝 섰 다.', 
    ['1689年，英国再次和法国开战，威廉·基德应征入伍，不仅在战争期间成功维持美国与英国之间的贸易航道，并屡建战功，成为战斗英雄，受英国女皇嘉奖。威廉·基德志得意满、意气风发，于不久后成婚。'] = '1689 년 영국 과 프랑스 개전 을 다시 윌 리 엄 제이 슨 키 드 가 국군 에 입대 했 을 뿐 아 니라 전쟁 기간 을 유지 하는 데 성공 미국 과 영국 의 무역 항로 를 누차 건 바로 이 전투 의 영웅 을 많이 받 은 영국 여왕 포상 을 받 았 다.윌 리 엄 제이 슨 키 드 지 의기 양 만, 불행 에 조만간 결혼 했 다.', 
    ['1698年，威廉·基德打着法国的旗号劫掠了一艘船籍为亚美尼亚的商船——奎达商人号，消息传回伦敦，威廉·基德被认定为海盗。从成功商人到战争英雄，且最后沦为恶贯满盈的海盗，欲望与贪婪使威廉·基德变得多面。'] = '1698 년 윌 리 엄 제이 슨 키 드 프랑스 의 커 다 란 명분 강탈 1 척 이 선적 을 아 르 메 니 아 의 상선 규 는 상인 호, 소식 을 전송 런던, 윌 리 엄 제이 슨 키 드 가 인정 받 을 통과 했 다.은 성 공한 기업인 전쟁 영웅 을 마지막 으로 전락 하 고 (this guy 하는 해적 소탕 과 욕망 과 탐욕 으로 윌 리 엄 제이 슨 키 드 가 다면.', 
    ['16世纪世界上最好的商船之一，这种船运载贵重货物，运费很高。它们实力强大，能抵御海盗的侵袭，因此一些商人认为没有必要给这种船运载的货物上保险。'] = '16 세기 세계 에서 가장 멋 진 상선 하나 로 이 선박 화물 을 운반 귀중한 운임 이 높다.그것들 막강 실력 으로 버 틸 수 있 게 해적 들 의 침공 을 만큼 뻥 튀 기 를 만 들 필 요가 없다 는 판단 에 이 선박 을 운반 하는 화물 에 보험 에 가입 했 다.', 
    ['16岁，华裔葡萄牙人。天真烂漫的少女，聪慧热情，有温暖人心的力量。祖父是劫富济贫的海盗、父亲是正直勤恳的海商，对自己该走哪条路一直摇摆不定。'] = '16 세 중국계 포 르 투 갈 사람 입 니 다.천진 난 만 한 소녀, 재능 열정 이 마음 을 따 뜻 하 의 힘 이다.할아버지 는 劫富济贫 의 해적, 아버지 는 정직 한 海商 부지런 함 을 스스로 에 대한 이 어느 길 로 가 계속 오락가락 했 다.', 
    ['16级海盗'] = '16 급 해적', 
    ['1715年7月，一艘西班牙宝船在佛洲外海被飓风打沉。为了迎娶玛利亚，改善贫困的生活，萨姆·贝拉米决定出海打捞沉没的西班牙宝船，可惜萨姆都什么都没有找到。'] = '1715 년 7 월 1 척 이 스 페 인 보 배가 불 저우 해외 이 허리케인 타 해 침몰 했 다.팝스 타 마 돈 나, 개선 을 위해 배우자 감 으로 가난 한 살림 을 샘 贝拉米 결정 출항 인양 침몰 한 스 페 인 보 배가 아까 워 샘 이 아무것 도 못 구 하 고 있다.', 
    ['1717年萨姆·贝拉米成功掠夺英籍大型贩奴船－维达号，并以之为旗舰，借由维达号的重装武力，成为当时北美洲东岸海域最令人闻风丧胆的海盗之一。'] = '1717 년 샘 贝拉米 성공 약탈 영국계 대형 행상인 노예 선인 앤 호 시 켜 야 하 고, 이 를 빌 려 기함 이 앤 호 는 重装 무력 을 당시 민주 평 통 북 미주 동쪽 해상 에서 가장 끔 찍 한 해적 들 에게 공 포의 대상 중 하 나다.', 
    ['17级海盗'] = '17 급 해적', 
    ['18岁，葡萄牙人。父亲是个小商人，靠着勤劳和诚信成为小船主。里奥比父亲更有冒险精神，在继承父亲的帆船后开始盘算着如何扬名立万。'] = '18 - 년 - 오래된, 포 르 투 갈 사람 입 니 다.아버지 는 영세 상인, 근면 과 신뢰 가 소강 선주 이다.리 오 아버지 보다 는 모험 정신 은 부친 의 요트 후 부터 을 어떻게 이름 을 올 렸 다.', 
    ['18级海盗'] = '18 급 해적', 
    ['1987年7月，李舜臣与陈磷、邓子龙组成中朝联合舰队，与日方海军进行了一场规模空前的海上决战——露梁海战，此战中中方将领邓子龙壮烈牺牲，李舜臣身中流弹身亡。死前，李舜臣叮嘱侄儿李莞代为指挥坚持抗战。'] = '1987 년 7 월, 이순 신 과 진 인, 邓子龙 구성 북 · 중 연합 함대 를 일본 측 과 해군 이 한바탕 규모 전례 없 는 해상 결전 을 앞 두 고 \' 인 노 량 해전 에서 중국 측 장성 邓子龙 장렬히 전사 이순 신 몸 에서 유탄 숨 졌 다.죽 기 전 이순 신 신신당부하다 조카 이완 대신 지휘 항전 을 고집 했 다.', 
    ['19岁，西班牙人。加泰罗尼亚大乡绅之女，美丽而自信，在父亲的资助下成为一名航海家，比普通人更加努力，讨厌别人称她为“徒有其表的富家女”。'] = '19 세 스 페 인 사람 이다.카 탈루 냐 대 성향 의 딸 을 아름 답 고 자신감 을 가 질 수 있 는 아버지 의 지원 아래 1 명 航海家 일반인 보다 더욱 노력 해 싫 어 했 던 그 는 덩치 만 큰 부잣집 딸 이다.', 
    ['19级海盗'] = '19 급 해적', 
