    ['2. 战场开启后，持续时间1h，时间结束，战场入口消失，将不能再参与讨伐。'] = '2. 전쟁터 열 이후 지속 기간 1h 를 기 간이 끝 난 뒤 전쟁터 입구 사 라지 고 참여 할 수 없 게 된 적이 었 다.', 
    ['2. 朗姆酒招募五人消耗朗姆酒值500，随机招募到五个E—A级航海士'] = '2. 5 명 모집 朗姆酒 소모 朗姆酒 치가 500 을 무작위 로 공모 에서 5 개 E - A 급 항해사 이다', 
