    ['“公羊号”'] = '\' 호 숫 양', 
    ['“冈依沙瓦号！”那可是莫卧儿最大型的运宝船！看到那些护卫船么？如此严密保护，船上的宝物一定难以想象！做好准备！'] = '\' 오 카 이 샤 와 호! \'그러나 그 모 아 눕다 가장 대형 의 운 보 배가!팔 을 호위 배 밖 에 안 되 니?이처럼 삼 엄한 경호 를 배 에 타 고 있 던 보물 일정 상 상하 기 어 렵 지 않다!준비!', 
