    ['一些没有徽记表示的商船闯入这里。心无旁骛，进攻哥本哈根'] = '일부 없 徽记 밝 힌 상선 에 난입 해 여기 서 나 온 다.心无旁骛 공략 해 코 펜 하 겐 이다', 
    ['一件优秀的船舶宝物能够给船舶带来质的飞跃。进入舰队，将这个火炮安装在旗舰上吧。'] = '한 건 훌 륭 한 선박 보물 줄 수 있다 고 선박 에 질적 도약 했 다.진입 함대 를 장착 할 수 있 는 그런 주포 기함 복 기 해 보 자.', 
    ['一件样式普通的外衣，传说是基督教某位圣徒的遗物，带有神明的祝福。'] = '일반 1 건 스타일 의 옷 을 벗 고 전설 은 기독교 어느 성직자 유물 을 띤 도적 요소 의 축복 이 었 다.', 
    ['一份十分贵重的信物，有了它，才能说服那些有名的A级航海士加入您。'] = '1 인분 에 매우 귀중한 한 다 는 확신 을 가 졌 는지 그 를 설득 할 수 있 는 그런 유명 A 급 항해사 가입 드릴 게 요.', 
    ['一份诚意满满的信物，它能为您招募到一个强大的B级航海士。'] = '1 인분 에 진 정성 이 넘 쳐 나 는 확신 을 타산지석 이 당신 공모 에서 강력 한 B 급 항해사 이다.', 
    ['一伙儿叫做“红旗帮”的海盗控制了南海的主要航道，他们猖狂地攻击欧洲的战船，掠取船上的装备。'] = '한편 \' 붉 은 깃발 을 방 \' 인 해적 통제 남해 의 주요 항로 를 그들 기승 을 부리 게 공격 유럽 의 배 를 배 워 하는 장 비다.', 
    ['一伙欧洲商人为了独占印度洋的利益雇佣私掠船不断骚扰亚丁的商路。'] = '유럽 상인 일당 독점 하 기 위해 인도양 의 이익 고용 불법의 노략질 하다 배 끊임없이 괴 롭 힘 이 아 덴 의 商路 이다.', 
    ['一伙欧洲海盗人占领了南中国数个重要港口，对来往商船肆意掠夺，甚至官船都不放过。中国官府遂决定对寻滋闹事的外国人进行驱逐，从而在南中国海发生了连串的海战。'] = '유럽 해적 일당 이 점령 한 남 수 개 중요 한 항구 를 오 가 상선 멋대로 약탈, 심지어 관 선박 도 못 살 게 굴 었 어요.중국 관 청의 성공하다 결정 에 대한 점원 늘어나다 행패 를 부리 는 외국인 을 대상 으로 추방 하 면서 남 중국 해 에서 발생 했 连串 의 해전 이다.', 
    ['一位母亲绝不会允许自己的孩子成为奴隶。'] = '절대 허용 한 어머니 가 자 신의 아이 들 을 노예 가 된 다.', 
