    ['一往无前'] = '후보 지명', 
    ['一无所获的萨姆·贝拉米为了不空手回到爱人身边，在1716年1月离开佛洲，来到加勒比地区加入本杰明·霍尼戈的海盗团。'] = '이렇다 할 성과 를 거두 지 못 한 샘 贝拉米 맨손 으로 복귀 하지 않 기 위해 애인 곁 을 떠 나 는 1716 년 1 월 버 저우 를 찾 아 지역 가입 캐 리 비 안 의 해적 벤 저 민 霍尼 골 이 돼 버 렸 다.', 
