    ['一次最多解雇10个航海士'] = '한번 최대 10 개 항해사 해고 했 다', 
    ['一次老船长的旧友前来拜访，告诉阿尔弗雷德·扬，老船长尚有后人活在世上，只是下落不知，阿尔弗雷德·扬得知此消息后毅然决定跟随船队出海，寻找老船长继承人。'] = '한번 늙 는 자신 을 찾 아 旧友 선장 을 새삼 일 깨 워 주 고 알 프 레 트 앙, 노후 선장 아직 후손 사 는 세상, 그저 행방 을 모 른 다 알 프 레 트 얀 이 소식 을 뒤 따 라 하 기로 결심 선단 출항 해 찾 아 늙 선장 후계 자다.', 
    ['一次，多索·贝利欧面对艳遇不屑一顾，原来他早已心有所属，现在之所以一心寻宝，便是为了娶到自己的梦中情人。'] = '차 를 여 소 펠 레 오 艳遇 콧방귀 를 앞 두 고 그 는 이미 심 이 소속 으로 지금 일심 보물찾기 는가 하 면, 결혼 하 기 위해 자 신의 이상형 이다.', 
    ['一波三折'] = '일파 만 파 로 번 져', 
