    ['一种包含金属铁的矿石，锻造【刀剑、洋枪、武士刀】等武器时都会用到。'] = '일종 의 담 금속 철 의 광석 을 단조 앤 디 칼, 洋枪, 사무라이 칼 등 무기 때 모두 쓰 사육 하 고 있다.', 
