    ['一种可以将声音扩大放出的神奇乐器。'] = '일종 의 목소리 가 확대 될 수 있 을 것 " 이라고 방출 되 는 신 기한 악기 를 선 보 인 다.', 
    ['一种含铜矿石，提取出的金属铜可以用来打造【铜器】或各式武器，如【盾牌、甲胄、大炮】。'] = '일종 의 함유 구리 를 추출 한 금속 구리 용 으로 활용 할 수 있 을 만 들 거나 각종 무기 [청동기 사육 하 고 있다, 예 를 들 면 [방패, 갑옷, 대포 사육 하 고 있다.', 
