    ['一种吸食香烟的工具，一般用竹子制成。'] = '일종 의 흡입 담배 는 도구 를 일반 대나무 로 만 든 다.', 
    ['一种味道清甜的水果，喜欢生长在温暖湿润的土壤中。'] = '일종 의 맛 清甜 의 과일, 좋아 서 은 촉 촉 한 토양 에 따 뜻 한 다.', 
    ['一种小巧的香料植物，花色鲜艳，芳香四溢，在干燥炎热的环境下生长的最好。'] = '일종 의 정교 한 향신료 식물 무늬 와 색깔 을 열 어야만 향기로운 명패 를 건조 한 환경 더위 가 자 이 제일 좋 았 어요.', 
    ['一种常见坚果，分布广泛，可以用来榨油。'] = '일종 의 견과 류 를 광 범 위하 게 흔 분포 를 그 씨앗 을 하는 데 사용 될 수 있다.', 
    ['一种常见餐后甜酒，以【柠檬】的外皮为原料制成，在意大利南部的拉古萨湾地区较为流行。'] = '일종 의 흔 식사 후 甜酒 로 타이완 (레몬 괴뢰 호 전광 들이 의 외피 를 원료 로 만 든 이탈리아 남부 라 거 萨湾 지역 이 크게 유행 했 다.', 
    ['一种热带水果，喜欢生长在温暖干燥的山地，果肉香味浓郁，酸甜可口，一次吃太多可能会口舌发麻。'] = '일종 의 열대 과일, 좋아 서 은 따 뜻 하 고 건 조하 의 산지, 과육 향 농 후, 새 콤 달 콤 한 번 먹 을 많이 봐 도 될 수 있다. 변설', 
    ['一种热带水果，果肉柔软且甘甜多汁，但并不是所有人都喜欢这种味道。'] = '일종 의 열대 과일, 과육 부 드 럽 고 감 미로 여 즙 을 하 고 싶 지만 누 구나 좋아 이런 맛 을 느 낄 수 있다.', 
    ['一种热带水果，肉质甜软，外壳坚硬，表面有坚硬的凸起。'] = '일종 의 열대 과일, 육질 단맛 이 약 하 고 외각 딱딱 해 져 표면 에는 딱딱 한 돌출 이다.', 
    ['一种生长在热带的香料，气味芳香清凉，味道辣中带苦。'] = '일종 의 생장 열대 하는 향신료 로 향기 청 량 을 맛 을 띠 는 꼴 이 된 다.', 
    ['一种用【蚕丝】制成的衣料，不仅柔软光滑、色泽绚丽，还带有让人迷醉的高贵光泽。'] = '일종 의 거장 실크 로 만 든 옷 을 뿐 만 아 니라 사육 하 고 부 드 러 운 매끈하다 과 빛깔 화 려 하 게 장식 을 띠 기도 이 지방 의 고 귀 함 을 찾 아 준 다.', 
    ['一种稀有的天然矿物，带有美丽的透明光泽，是打造【宝石首饰】的好材料。'] = '일종 의 희귀 한 천연 광물 을 띤 아름 다운 투명 광택 이 사장 은 회사 [보석 세트 괴뢰 호 전광 들이 좋 은 재료 다.', 
    ['一种粮食作物，可以用来制造营养丰富的豆制品，但食用太多的话，常常让人忍不住释放出令人尴尬的气味。'] = '한 种粮食 작물 을 제조 용 으로 활용 할 수 있 지만 영양 이 풍 부 한 여부 를 먹 지만 너무 많 으면 답 냉큼 집 에서 방출 곤란하다 냄새 가 난 다.', 
    ['一种精巧的民间工艺，质地坚韧的【红木、花梨木】都是雕刻复杂作品的上等材料。'] = '일종 의 정교 한 민간 공예 방법 등 끈 질 긴 거장 마호가니, 花梨木 괴뢰 호 전광 들이 모두 조각 작품 의 복잡 한 식 재료 로.', 
    ['一种红色的硬木，带有天然形成的花纹，材质坚硬耐磨，适合打造贵重家具，或【木雕、木器、巴厘木雕】等工艺品。'] = '일종 의 각목 붉 은색 을 띠 천연 형성 된 무늬 를 재질 단단하다 일로 귀중한 용 으로 안성맞춤 만 가구 를 만 들 거나 [목조 목기 와 발 리 나뭇조각 등 공예품 이다. 사육 하 고 있다.', 
    ['一种营养丰富但是咬起来非常吃力的水果，含糖量较高的甘蔗通常用来生产【朗姆酒、黑糖、蔗糖】。'] = '일종 의 영양 이 풍 부하 지만 물 어 뜯 기 가 힘 든 과일, 당 도가 높 은 사탕수수 통상 용 생산 앤 朗姆酒, 黑糖 · 사탕수수 사육 하 고 있다.', 
    ['一种质地很软的金属，常用来打造【银饰】。与黄金一样，白银一直是财富的象征。'] = '과 하 게 소 프 트 의 금속, 상용 만 거장 로 사육 하 고 있다.금 과 처 럼, 실버 줄곧 부의 상징 이다.', 
    ['一种身体扁长的鱼，喜欢生活在寒冷的海水里，肉质白细鲜嫩，口感清淡不腻，可以提炼【鱼油】。'] = '일종 의 신체 납작하다 장의 물고기 를 즐 기 는 사람 이 사 는 추 운 바다 속 에서, 육질 백 가늘다 신선 하 고 연하다 씹 는 느낌 이 연하다 느 끼 하지 않 을 추출 앤 鱼油 사육 하 고 있다.', 
    ['一种软体海洋生物，种类非常丰富，外壳又硬又厚，螺肉十分有弹性。'] = '일종 의 软体 해양 생물 을 종류 도 매우 이 풍 부하 고 외각 딱딱 하 고 두 꺼 운 을 고둥 고기) 상당히 탄력 이 붙 는 다.', 
    ['一种辣味蔬菜，能增进食欲，也是制作【咖喱】的主要原料。'] = '일종 의 매 운 맛 야채 를 증진 시 키 는 식욕 이자 제작 앤 디 의 주원료 다. 카레 사육 하 고 있다.', 
    ['一种透明物质，最初从火山喷出的酸性岩中凝固而得，制造技术纯熟后，常用来吹制【玻璃器皿】等工艺品。'] = '일종 의 투명 물질 을 시작 해 화산 산성 암 에서 굳 어 지게 나 제조 기술 숙달 하다 뒤 상용 으로 불어 제 거장 유리 그릇 괴뢰 호 전광 들이 등 공예품 이다.', 
    ['一种铜质重型武器，装上弹药后可以射出较远的距离，火力范围广，威力十分强大。'] = '일종 의 铜质 중 화기 에서 탄약 을 제시 하 면 사출 멀리 떨 어 진 거리, 화력 광 범위 해서 위력 이 막강 하다.', 
    ['一种雕刻工艺，一般选用质地细密坚韧、不易变形的【牛皮】进行创作。'] = '일종 의 조각 공예, 일반 관리인 으로 품질 에 혀 를 내 두 른 강인하다, 쉽 지 않 는 소가죽 변형 사육 하 고 있다.', 
    ['一种风化岩石，被称为“世界第八大奇观”。'] = '일종 의 풍화 바위 로 불 릴 정 도로 세계 8 대 불가사의 \' 다.', 
    ['一种黄色的热带水果，味道酸甜可口。'] = '일종 의 노란색 의 열대 과일 맛 새 콤 달 콤 했 다.', 
