    ['一群史前坟墓，欧洲最重要的史前巨石文化遗址之一。'] = '한 무리 의 사전 무덤 을 유럽 에서 가장 중요 한 스 톤 헨 지 문화 유적 중 하 나다.', 
    ['一群废物，竟然让他们溜过来了！'] = '한 무리 의 폐기물 을 들 여 는데 그들 물받이 됐어 요!', 
    ['一群衣衫褴褛的朝圣者向我们袭来，是什么勇气让这些武器落后的家伙驾驶着小船冲向我们？从远处的浓雾中驶来几艘战舰，看来幕后黑手即将出现。'] = '한 무리 의 남루 한 옷차림 의 순례자 우리 를 찾 아 오 고, 무슨 용기 가 이 들 무기 낙후 된 놈 운전 을 향 해 돌진 하 고 보트 우리 를 당 할 소 냐?멀리 서 짙 은 안개 에 서자 여러 척 의 전함 을 보아하니 배후 설 을 앞 두 고 나 타 난 다.', 
    ['一群衣衫褴褛的海盗出现，是什么勇气让这些病恹恹的家伙驾驶着小船冲向我们？从远处的浓雾中驶来几艘战舰，看来幕后黑手即将出现。'] = '한 무리 의 학생 은 남루 한 해적 출현 에, 어떤 용기 가 이 들 의 病恹恹 놈 운전 을 향 해 돌진 하 고 보트 우리 를 당 할 소 냐?멀리 서 짙 은 안개 에 서자 여러 척 의 전함 을 보아하니 배후 설 을 앞 두 고 나 타 난 다.', 
