    ['不对，仔细看，中间的船只像商船，船体破损，看来刚经历过战争。'] = '잘못 된 것 을 자세히 들 여다 보 면 중간 의 선박 처 럼 상선 을 선체 파손, 보아하니 갓 전쟁 을 겪 이다.', 
    ['不对，那边有船来了，那旗帜是……是“红胡子”巴巴罗萨！该死，来不及逃走了！'] = '아니요, 저기 가 선 을 보 인 다면 깃발 은.이 붉 은 수염 \' 아내 로 살!빌어먹을 우라질 미처 도주 했 다!', 
    ['不屑园中牡丹，惟爱傲雪寒梅。'] = '냉소 를 채 우 고, 오직 사랑 모란 자고자대하다 눈 폭설 이 쏟 아 져.', 
    ['不得不承认，你的好运气确实让我很嫉妒。这把武器曾经是“杀手之王”——辉亚·琉斯的心爱之物，居然被你得到了.'] = '당신 은 인정 해 운 대목 이 적지 않 은 게 사실이다 질투 난 다.이 무기 들 은 한때 \' 킬 러 의 왕 인 휘 아 브 루 체 스 의 애 장 품 지 더니, 당신 을 받 았 다.', 
    ['不必了，除了钱之外，老家伙留下的每样东西都让我觉得恶心——当然也包括你！'] = '할 필 요가 없다, 그러나 돈 을 제외 하 고 늙 놈 이 남 긴 것 도 마다 한 다 는 생각 이 오심 인 당연히 너!', 
    ['不必慌张，萨格里什是贯穿南北的中转站，龙蛇混杂之地，可以到那里去寻找需要的线索吧。'] = '당황 할 필 요가 없다 萨格 리 슈 를 관통 남북 의 허 브 를 龙蛇 혼잡 한 곳 이 고, 그곳 에서 할 수 있 는 단서 를 찾 아 봅 시다.', 
    ['不必考虑了，我要让这个贪婪的家伙付出代价。'] = '고려 할 필 요가 없다 야 겠 네 라 탐욕 스 러 운 놈 대가 를 치 르 게 될 것 이다.', 
    ['不愧是专业的……等等，这个箱子上的纹饰怎么和宝石上的花纹如此相似。我一定要尽快搞清楚这个秘密！'] = '아름 답 기 는 전공 하 던데.그 상자 에는 등등 의 디자인 은 어떻게 과 보석 의 무늬 가 비슷하다.꼭 빨리 알 아야 잘 이 비밀!', 
    ['不明错误'] = '불 분명 잘못', 
    ['不是任命水手'] = '황천 객 은 임명', 
    ['不是商会之星不能领奖'] = '아니 상공 회의소 의 별 수 에 이 른 다', 
    ['不是所有布伦希尔德都有她的齐格弗里德。'] = '아니 모든 브 렌 힐 데 도 그 의 올 시즌 프 리드.', 
    ['不是！不是海盗！当时政府正为印度洋上的海盗发愁，我是为国效力！为国效力！'] = '아니!아니 해적!당시 정부 는 인도 양의 해적 걱정 입 니 다. 저 는 위 국 효력!위 국 효력!', 
    ['不止一座港口叫圣乔治。'] = '하나 뿐 아 니라 항구 이름 과 장미.', 
    ['不止你哥哥，你还深受许多百姓爱戴。'] = '뿐 만 아 니라 당신 오빠, 당신 은 나 라인 데 도 많은 서민 들 에게 기쁨 을 줬 다.', 
    ['不用在意，看轻你的人终将为他们的轻浮付出代价……（轻声）至于他为什么不向我们动手，自然是因为……'] = '애써 무시 할 필 요가 없 는 사람 이 마침내 경멸하다 당신 을 만 들 어 주 는 가 벼 움 대가 를 치 르 도록....(경성) 는지 왜 우리 에게 손을 자연 때문.', 
    ['不用找了，在游戏里加尔各答是印度东岸唯一的港口。'] = '없이 취직 했 을 뿐 만 아 니라 게임 에 인도 콜 카 타 는 동쪽 유일한 항구 를 말 한 다.', 
    ['不用找了，女神之誓应该已经不在此处，我们进攻汪直之时，有一支船队已经悄悄离开此处朝$(missioncolor:【大阪】)去了。'] = '없이 찾 아다 녔 어요, 여신 의 맹세 야 이곳 은 없 는 것 으로, 우리 공격 왕 직 을 때 에는 선단 이 슬그머니 떠 나 이곳 북 $(오 사 카) missioncolor: 사육 하 고 갔 어요.', 
    ['不用拍马屁！不过也没说错，我因为在战争中的出色表现得到女皇嘉奖，志得意满，结婚生子，直到在伦敦认识贝洛蒙特勋爵。'] = '아첨 없이!그러나 도 하지 못 했 기 때문 은 잘못 을 내 전쟁 에서 보 여 준 활약 여 제 포상 을 받 을 얻 지 의기 양 만 으로 결혼 과 출산 으로 까지 런던 에서 인식 벨 로 몬 트 勋爵 이다.', 
    ['不用斥责这位小兄弟，我的确是用过一些手段。'] = '이 小兄弟 질타 할 필 요가 없 을 써 본 사실 나 는 일부 수단 이다.', 
    ['不用着急，慢慢来，先从英军士兵开始。'] = '불 요 불 급 을 천천히 가요, 먼저 영 국군 병사 시작 됐 다.', 
    ['不用装扮，我本来就是商人！只要经商的利益确实落入我的钱包，我现在就可以动身。'] = '없이 차림 으로 저 원래 상인!비즈니스 를 할 수 있 는 이익 에 만 확실히 내 지갑 저 지금 면 귀성 길 이다.', 
    ['不知何时才能找到关于族人的消息，哎……'] = '언제 찾 아 인 들 에 관 한 소식 을.........', 
    ['不知死活的奴隶，居然趁机反抗！'] = '모 르 의 사활 이 걸 린 노예 안하무인 틈 에 반항!', 
    ['不知死活，我们的忍耐可是有限度的，要逃命趁早！'] = '모 르 죽 으나 인내 할 수 있 지만 한계 가 있 어 온 고 피란 좀!', 
    ['不知道是不是我的错觉，我总感觉幸运女神要远离我们了。'] = '라며 착각 한 적이 부지기수 였 을지 모 르 겠 다 는, 내 가 기분 행운 의 여신 떠 나 고자 했 다. 우리', 
    ['不知道，可能中国人的饮食和我们真的很不同呢，总之我们只管找食材，【马尼拉】的【荔枝】是吧？'] = '몰 라, 수 중국인 들 의 음식 과 우리 정말 밖 에 든가 에 찌 들 어 먹이 찾기 에 맞 춰 앤 디 마 닐 라 사육 하 고 있다 는 여지 괴뢰 호 전광 들이 죠?', 
    ['不祥的预兆'] = '불길 한 조짐', 
    ['不祥的预兆，赶回'] = '불길 한 조짐 을 보이 고 있 는 로 쫓 아', 
    ['不等了,全速前进。'] = '같 지 않다 고 전속력 전진 했 다.', 
    ['不管别人如何看，我对您是佩服的，大叔。'] = '남 의 눈 에 어떻게 비치 는가, 나 는 당신 에게 는 극찬 하는, 아저씨.', 
    ['不管如何，“魔鬼之手--佛得角”就在西南方，第一步的计划，就是征服这片让先辈闻之色变的海域，到佛得角去！'] = '어쨌든 \' 지옥 의 손 인 佛得角 호 만 해도 남서쪽 으로 첫 걸음 의 계획 은 정복 이곳 게 선배 문 기 색도 변 한 해역 에서 佛得角 하 러 가요!', 
    ['不管如何，他都不该出现在这条航线上，到【普利茅斯】找到德雷克，必须让他给一个说法！'] = '어쨌든 그 가 나 타 나 는 안 이 항로 에서 사육 하 고 있다 普利茅 스 앤 드 레 이크 려면 찾 아 그 에게 한 말!', 
    ['不管怎么样，当务之急就是帮助这片曾经美丽的土地恢复原来的面貌吧。'] = '어찌 되 든 가장 시 급 한 것 은 도움 이 무지 막 지 한 스펙터클 을 했 던 아름 다운 토지 원상회복 을 반 대다.', 
    ['不管怎么样，肃清了盘踞在比绍的海盗，总算让新航线安全一些了，努力让比绍成为崭新的贸易港口吧。'] = '어찌 되 든 도사리다 숙청 했 다 는 최선 을 다 하는 해적 에 조금 이라도 신규 노선 안전 하지 않 았 을 될 수 있 도록 최선 을 다 하 고 새로 운 의 무역항 이 시다.', 
    ['不管怎么说，这看起来是个做生意的好地方，让我们到市政厅办理贸易许可证吧。'] = '아무래도 역시 보기 개인 사업 을 하는 좋 은 장소 입 니 다, 우리 가 가 볍 게 이동 구청 을 찾 았 무역 허가증 시다.', 
    ['不管怎样，我们必须做好应对的准备，敌人可是很快就会反扑回来的呢。'] = '그래도 우리 는 반드시 에 대비 한 준비 로 적이 지만 곧 반격 돌 아 오 는 것 일 까.', 
    ['不管是上流社会的贵妇人，还是放浪形骸的市井女子，她们下午茶的谈资里总不会缺少这样一个名字--“黑男爵”巴塞洛缪·罗伯茨。这个据说是有史以来最绅士的海盗王，有着俊朗的相貌和高雅的谈吐，胡子永远保持干净整齐，喜欢穿着华丽的红色外套和戴着红色羽翎装饰的宽檐帽。行动儒雅端庄，不酗酒，甚至喜欢喝清茶，还每天坚持在他的船长室做祷告，就像每一个在圣保罗教堂祷告的教徒一般谦卑虔诚。而除了良好的做派，他为手下散漫凶悍的海盗制定了“海盗10诫”，还有他果敢准确的指挥能力更是为人所津津乐道。'] = '이든 상류층 의 귀족 여인 들 인가, 아니면 질 탕 1949 는 시 정의 여자 최 혜 용 (예문 여고) 오후 차 의 담론 에서 총 는 빠 지지 않 는 한 이런 이름 인 \' 블 랙 경 \' 바 솔로 뮤 로 버 츠.이 는 사상 가장 신 사적인 다고 해적 왕 을 잘 생 의 용모 와 고아 성은 는 입담 수염 영원히 계속 깨 끗 가지런히 을 좋아 하 고 화 려 한 의 붉 은색 재킷 과 모자 를 쓰 고 붉 은색 깃털 장식 한 폭 처마 모 를 벗 었 다.행동 하지 않 儒雅 사교 적이 고 알콜, 심지어 즐 겨 마 셨 다 清茶 도 매일 그 의 船长室 하 기도 드리다, 마치 일일이 세인 트 폴 성당 을 낮 추 기도 드리다 신도 일반 간절하다.재삼 실감 해 좋 은 그 밑 에서 방 만 난폭 한 해적 마련 해 해적 10 권고 \'에는 과 감 정확 한 지휘 능력 또한 느 유명한 일화 다.', 
    ['不管现在还是未来，科学和宗教都可以共存。'] = '아무리 앞으로 도 과 학과 종교 수 공존 한 다.', 
    ['不能任命相同职业的航海士'] = '같은 직업 임명 못 한 항해사 이다', 
    ['不能任由阿芒德的人胡作非为，出发，驰援巴塞罗那！'] = '방치 할 수 없 는 사람 아 참억새 덕 에 출발 해 바 르 셀 로 나 驰援!', 
    ['不能再被增援'] = '선 안 되 겠 다 \'는 증원 했 다', 
    ['不能加速'] = '가속화 할 수 없다', 
    ['不能参加'] = '출전 하지 못 했 다', 
    ['不能取消'] = '취소 할 수 는 없', 
    ['不能含有非法字符'] = '못 함유 불법 문자 이다', 
    ['不能在接受悬赏任务的港口放弃任务'] = '수용 할 수 없 는 현상 임무 를 수행 하는 항구 포기 임무 다', 
    ['不能在活动时间外修改时间'] = '활동 시간 을 제외 하 고 는 개정 돼 서 는 안 된 다 는 시 간이 었 다', 
    ['不能容忍粗鄙的海盗们继续破坏这座美丽的城市。进攻！'] = '용납 할 수 없다 는 粗鄙 해적 들이 파괴 가 계속 이 아름 다운 도시 입 니 다.공격!', 
    ['不能开始'] = '못 열', 
    ['不能拆解编入舰队中的船'] = '못 분해 편입 함대 는 선 이다', 
    ['不能接受'] = '받 아 들일 수 없다', 
    ['不能接收并回赠'] = '고 알뜰살뜰 관리하다 전액 을 받 을 수 없다', 
    ['不能放过这些多管闲事的，干掉他们！'] = '이 들 을 놓 칠 수 없 는 多管闲事 죽여버리다 그들!', 
    ['不能更新信息'] = '못 업 데이트 소식', 
    ['不能犹豫，机会稍纵即逝！必须在他们完成集结前进攻！全员准备，到了跟摩尔海盗宣战的时候了！'] = '못 망 설 이자 기회 샤!반드시 그들 완성 결집 전 공격!전원 준비 를 했 을 때 해적 과 무어 선전 포고 했 다!', 
    ['不能给敌人喘息的机会，趁着敌人慌乱的机会，直取对方中军旗舰！'] = '안 주 는 적 들 의 숨통 을 틔 워 줄 기회 를 틈 타 적 당황 한 기회 를 직 선발하다 상대 中军 기함!', 
    ['不能让他们完成包围，一定要撕开他们的阵线。'] = '지 못 하 도록 해 야 완성 에 둘 러 싸 여 꼭 찢 겨 진 그들 의 라인 이다.', 
    ['不能让他们继续攻击平民，再损失3艘平民船就无法完成撤退任务了。'] = '지 못 하 도록 해 야 공격 을 계속 하 게 서민 을 다시 손실 3 척 서민 배 는 완료 하지 못 했 다. 철수 임무', 
    ['不能让敌人靠近卡利卡特'] = '가 발 붙 이지 못 하 도록 적 접근 한 칼 카 터 다', 
    ['不能让暴行继续。'] = '못 폭행 은 계속 되 고 있다.', 
    ['不能让运输货船逃离，击毁2个炮塔，最后攻击彼得松•霍因。'] = '가 발 붙 이지 못 하 도록 운송 화물선 탈출 를 격파 2 개 포탑 에 마지막 공격 이 피 터 손 호 다.', 
    ['不能让这些家伙进入港湾，截击他们！'] = '이런 놈 진입 가 발 붙 이지 못 하 도록 항만, 요격 그들!', 
    ['不能购买那么多委任次数'] = '구입 할 수 없다 면 더 촉탁 횟수 를 늘 리 고 있다', 
    ['不能迁移到原本的据点港口'] = '이전 까지 못 본연 의 거점 항구 다', 
    ['不能进行一键升级'] = '불가능 한 버튼 을 증폭 시 키 고 있다', 
    ['不能领取其他阵营声望物品'] = '다른 진영 성가 물품 받 지 못 했 다', 
    ['不能领奖'] = '수상 하지 못', 
    ['不行了，船舱已经进水，快靠近主舰!'] = '안돼 요, 이미 취 선실, 빨리 접근 주 함!', 
    ['不行！不能允许如此暴行的存在，哪怕是以国家的名义，立即驰援突围的这位朋友。'] = '안돼 요!그 같은 만행 을 허용 할 수 없다 는 국가 의 존재 를 명목 으로 즉각 驰援 자체 는 친구 다.', 
    ['不行，改变方向，朝着另一个珊瑚礁群前进，抵达那边，我们才能甩开他们。'] = '안돼, 방향 을 바 꿔 향 해 또 다른 산호초 군 전진 에 도착, 저기 뜯 어 고 쳐 야 쑨 다 고 밝 혔 다.', 
    ['不行，魔鬼之手——$(missioncolor:【佛得角】)本身危机重重，我们不能为了一点点金币以身犯险。'] = '안돼, 악마 의 손 인 $(missioncolor: 佛得角) 자체 를 사육 하 고 위기 의식 이 아 닐 수 없다. 조금 금화 몸 을 범 요지.', 
    ['不要与护卫船过多纠缠，绕过去消灭【海盗斥候】'] = '지 말고 과 호위 배 과다 성화 에 해적 소탕 [우회 해 야 斥候 사육 하 고 있다.', 
    ['不要再往南走了，南方没有港口了。'] = '제발 남쪽 으로 내 려 갔 을 남측 이 없 었 다. 항구', 
    ['不要吃我'] = '먹 지 마 나', 
    ['不要听那些原住民诽谤我们的总督大人！'] = '안 듣 원주민 들 비방 우리 의 총독 어른!', 
    ['不要在椰子树下闲逛，会被熟透的椰子砸到。'] = '하지 말 라 는 야자수 아래 사귐 을 뺏 기 게 익 어가 는 야자 국립 공원 이다.', 
    ['不要在王宫面前晃来晃去的。'] = '하지 말 라 는 왕궁 앞 에서 휘황하다 돌 아 갔 다.', 
    ['不要忽视女人在政治中的隐性作用。'] = '외면 하지 않 은 정치 여자 중 위장 된 역할 을 했 다.', 
    ['不要意气用事！现在风向有利于我们，敌方船速不快，我们尽量推延时间，让属下准备突击快船，我自有妙用。'] = '주관적 감정 과잉 은 하지 말 라!지금 우리 에게 유익 한 적 船速 풍향 을 빠 르 지 않 는 최대한 늦 추 여유 산하 준비 돌격 클, 나 는 자기 妙用 이다.', 
    ['不要担心伙计，只要在非洲以东，就不用担心海盗的问题，那些懒惰的家伙才不会费尽心力跑得那么远来抢劫呢。'] = '걱정 하지 마 세요 머슴 절차 를 밟 으면 아프리카 동쪽 걱정 은 사 라 해적 들 의 문제 에 그 게 으른 녀석 되 지 않 은 달리 는 게 너무 힘 들 면 훨씬 강도 를 하 겠 는가.', 
    ['不要指着月亮起誓，它是变化无常的。'] = '집착 하지 말고 달 서약하다, 그것 을 변화 무 쌍 한 다.', 
    ['不要松懈！对方气势汹汹的过来了！'] = '방심 하지 말 라!상대 서슬 이 퍼 렇 던 됐어 요!', 
    ['不要着急，休息，休息一会儿。'] = '조 급 해 하지 말고 쉬 쉬 했 다.', 
    ['不要让水手们在城里惹事！'] = '이 나 오지 않 도록 황천 객 들 은 성안 일을 저지르다!', 
    ['不要轻敌！也永远不要低估马其顿士兵的战斗意志！利用敌人的弱点，我们才有机会取胜。'] = '방심 하지 말 라!에도 영원히 과소평가 하지 말 라 마케도니아 병사 한 전투 의지!적 들 의 약점 을 이용 해 우리 가 승리 했 다.', 
    ['不见得吧，在你心中肯定宝藏更为重要。'] = '반드시 하는 것 은 아니 예 요 시다 는 당신 안 긍정적 망 이 중요하다 고 말 한 다.', 
    ['不许人们私下交易，对每一单贸易都收取高额的税收。却不肯付工钱给农民和工人。把他们当成奴隶使用！'] = '뒷거래 를 하지 못 하 도록 사람들 에 대한 단 무역 이 받 은 고액 세금 에서 나 간 다.은 뒷걸음질 지불 임금 에게 노동자 와 농민 이다.그들 을 를 강제 노역!', 
    ['不许看！'] = '못 보 게!', 
    ['不说红胡子，现在你的目标是阿芒德，听闻他最近在$(missioncolor:【亚历山大】)屯以重兵，那里的监狱是关押重要犯人的地方，拉比斯说不定在那里，我们一起去看看。'] = '입 을 열 지 않 는 붉 은 수염 을 지금 너 의 목표 는 아 참억새 덕 을 그 는 최근 $(missioncolor: 알 렉 산 드 리 아 사육 하 고 있다 는 重兵) 툰, 거기 는 교도소 수감 된 중요 한 곳 은 범인 을 라 비 스 가 나 올 지 모 른 로부터 우리 같이 봅 시다.', 
    ['不超过2艘水军死亡'] = '2 척 이 넘 지 않 는 수군 이 사망 했 다', 
    ['不足%s个，无法合成'] = '부족 %s 개 를 풀 수 있 는 합성 했 다', 
    ['不足20个，无法合成'] = '부족 20 개 를 풀 수 있 는 합성 했 다', 
    ['不足5个，无法合成'] = '5 개, 부족 할 수 없 는 유행어 를 낳 았 다', 
    ['不过么，我记得当时亨利王子和我们尊贵的女王定下的协议是，英国官方将不侵犯贵国在南方的权益，但这不能约束个人行为啊！'] = '그러나 이 잖 던 기억 해리 왕자 와 우리 의 존엄 높 은 여왕 이 정한 협정 은 영국 이 공식 이 귀국 을 침해 하지 않 는 남측 의 권익 을 하지만 단속 하지 못 했 다 는 개인 행위!', 
    ['不过他们还算明智，知道我们是块难啃的骨头，并没有向我们下手。'] = '하지만 그들 도 아 깝 지 알 것 못 지 않 게 중요 한 우리 는 조각 난 갉아먹다 는 뼈 가 우리 에게 전달 되 지 않 았 다.', 
    ['不过你们记住，你们是以私掠船的名义，因为女王现在还不想正面和汉堡发生冲突呢，祝你们好运吧！'] = '그러나 기억, 너희들 은 사교육 스치다 배의 명목 으로 때문에 여왕 지금 아직 정면 충돌 과 햄버거 까, 좋 은 일 만 가득 하 길 바 랍니다!', 
    ['不过即便如此，$(missioncolor:【阿尔金】)依旧是航海家们趋之若鹜的港口，海盗们抢掠的天堂。阿尔金连接南北，各路人马都在此地停泊补给，我们可以向过往的航海家打听拉比斯的消息，不过……'] = '하지만 그래도 $(missioncolor: 사육 하 고 있다 阿尔金) 는 여전히 航海家 들 을 향 해 뛰 고 소 말리 아 해적 들 의 항구 강탈 의 천국 이 었 다.阿尔金 연결 남북 각 젠 도 이곳 에 정박 보급 을 우리 는 지 나 가 는 航海家 물어보다 라 비 스 의 소식 을 하지만....', 
    ['不过多索·贝利欧的打算并不是成为一名航海家，而是梦想在大海这座宝库中发掘一处宝藏，从而获得大量的财富，而多索·贝利欧最初出海，便是听说某小岛有海盗的宝藏。'] = '그러나 여 소 펠 레 오 겠 다 는 속셈 이 아니 거 명 되 고 航海家 이 아 니라 꿈 은 바다 에서 발굴 한 곳 이 보고 망 을 다량 의 부, 여 소 펠 레 오 최초의 바다 로 나 오 는가 하 면, 어느 섬 이 해적 들 의 보 고다.', 
    ['不过好消息就是，我们赢得个南方整个未知世界的开拓权，而这正是我想要的！'] = '하지만 좋 은 소식 은 우리 개 남측 전체 미 지의 세계 의 개척 권 을 바로 내 가 갖 고 싶 었 던!', 
    ['不过如果你们肯帮我凑齐食材的话，等美食节结束我一定上你们的船。'] = '하지만 만약 당신들 켄 좀 여고 (식 자재 면 등 푸 드 페스티벌 에서 끝 난 꼭 당신들 의 배 에 올 랐 다.', 
    ['不过我想请你们帮忙，因为小生意不受重视，市政厅一直扣押我的经营许可。'] = '하지만 제 생각 하세요, 즉 작 은 장사 으니 도 받 지 않 을 중시 하 고 시청 억류 나 의 경영 허가 를 받 았 다.', 
    ['不过本地人不肯卖【糖胶】给我，能不能请你们到【文莱】帮我采购一些？'] = '그러나 현지인 을 주지 않 으려 한 팔 [사탕 아교 괴뢰 호 전광 들이 나 에게 해 줄 수 있 으니 앤 브 루 나이 에서 사육 하 고 있다. 나 를 도 와 주렴 구매 말씀 해 주 세요.', 
    ['不过海军实力虽然提高，但朝鲜党争激烈，肯定会给日方可趁之机。'] = '그러나 해군력 은 높 아 졌 으나 북한 당리 당 략 치열 해 당연히 일본 측 에 틈새 바람 에 편승 했 다.', 
    ['不过要到船厂去建造【三桅卡拉维尔】，我们需要赚到10000银币！加油吧！'] = '하지만 해 야 하 느냐 "고 조선소 가 건조 [3 돛대 칼라 빌 사육 하 고, 우리 에게 필요 번 10000 은화!파이 팅!!', 
    ['不过迭戈·桑切斯半生都被霉运之神笼罩，他加入的船队不是遇上风暴，便是遇上鲨鱼，后来已经很少有船长敢招募他。'] = '그러나 듀오 인 디 도 산 체스 반생 이 징크스 의 신 기에 휩 싸 였 고, 그 가 가입 한 선단 은 폭풍 속 에서 도 요 타 리 콜 사태 로 자금난 에 열 을 올 리 고 상어 로 일하다 가 선장 감히 모집 그 다.', 
    ['不过，以目前我们的实力，与强大的奥斯曼帝国正面抗争时机尚未成熟，所以，我们需要想办法扩充我们的势力版图。'] = '하지만 지금 우리 의 실력 을 강력 한 오 스 만 제국 정면 항쟁 아직 시기상조 이기 때문에, 우리 에게 필요 생각 할 시간 을 주 고 우리 의 세력 판도 확충 했 다.', 
    ['不过，你别指望休息了，达伽马把果阿的驻军都调过来了，这场恶战可是随时打响呢。'] = '하지만 너 별 기대 휴식 을 취 했 달 에서 프로 스타 글 란 딘 을 이루다 아 주둔 모두 조동하다 냈 다며 그러나 이 치열 한 전투 수시로 시작 할 수 있 겠 는가.', 
    ['不过，你需要为【威尼斯】的港口繁荣做些投资，那样，我们才会为你提供所有的便利！很公平，不是么？'] = '하지만 너 를 위해 필요하다 앤 베 네 치아 의 항구 를 사육 하 고 번영 하는 거지 처 럼 투자 를 할 것 "을 제 공한 모든 편의!공정하다, 아 닙 니까?', 
    ['不过，我的消息称，马六甲土司可还不死心呢，他又募集了一支舰队，企图夺回马六甲！为了长久的航线安全，必须彻底消灭他呀！'] = '그러나 나 의 소식 을 열기 위해 토스트 를 단념 하지 않 잖 어, 그 는 다시 모금 했 다고 한 함대 를 탈환 하 려 말 라 카!오랜 기 위해 항로 안전 여야만 한 그 는 군 요!', 
    ['不过，法国人的船通常不会有太多火炮，用火炮把那些擅长摆姿势的骑兵解决掉！这船就逃不出我们的手掌了。'] = '그러나 프랑스 인 들 의 배 를 받 지 않 기 에는 너무 주포 를 용 주포 들 을 잘 포즈 를 취하 고 기병 처단 하!이 배 는 탈 을 보 여 주지 못 하 고 우리 의 손바닥 했 다.', 
    ['不过，看在你们帮忙的份上，或许你可以到汉堡去，我听说汉萨同盟的商人可是出了名的杂货商，嗯，他们大小通吃，从不挑肥拣瘦！'] = '그러나 봐 서 으니 도 와 달 라고 생각 하는, 혹시 너 를 받 을 수 있 도록 햄버거 가 말 을 들었다 한 사 동맹 의 상인 하지만 소문 난 잡상인, 응, 그들 은 크기 通吃 에 전혀 挑肥拣瘦!', 
    ['不错不错，当年我也是通过竞技加入军队，后来就带着人到新大陆袭击西班牙的地盘，掠夺大量财宝。'] = '나 도 괜 찮 은 괜 찮 고 그해 경기 를 통 해 군대 에 붙 들 고 단돈 명 까지 신대륙 습격 스 페 인 기반 을 약탈 대량 재 신 이다.', 
    ['不错么，看起来你还知道这个图纸怎么用，不管怎么说，总算你有一艘看起来像点样子的船只了。'] = '괜 찮 더라. 너 도 알 고 보 이 도면 ㄹ, 아무래도 당신 을 겨우 1 척 의 선박 모습 처 럼 보이 시 했 다.', 
    ['不错，传说七海霸主信物就是七枚克拉肯之眼，克拉肯之眼能够减轻风浪的侵袭。至于七颗克拉肯之眼聚在一起的效果，没人知道。毕竟还没有任何人能称霸七海。'] = '괜 찮 네 요, 전설 칠 해 패자 는 확신 이 7 발의 캐럿 켄 의 눈 에 크 라 켄 의 눈 을 덜 어 줄 수 있 풍랑 주의보 를 많이 겪 는 다.회심 일곱 발 캐럿 켄 의 눈 모 인 효과 를 지 아 무도 몰 랐 다.필경 은 아 무도 도 세계 최강 일곱 바다 다.', 
    ['不错，当年光是魔鬼之手--佛得角就牺牲了无数先驱者才将其征服的。'] = '괜 찮 네 요, 그해 실마리 가 보 인 佛得角 악마 의 손 은 희생 수없이 정복 의 선구자 하 겠 다.', 
    ['不错，成为四等男爵才会开放设置四船舰队的权限，前往各个港口投资或是完成精英战役可以提升你的贡献度，四等男爵指日可待。'] = '괜 찮 네 요, 이 四等 경 에야 개방 설치 4 배가 함대 는 권한 을 찾 아가 각 항구 투자 또는 완성 엘리트 전투 너 의 기여도 를 높 일 수 있 四等 경 시야 에 들 어 왔 다.', 
    ['不错，这个报酬不算低了。辛西亚要是知道这个消息肯定乐疯了。我们赶紧将它任命到舰队吧，有了它，远洋贸易肯定能事半功倍。'] = '괜 찮 네 요, 이 보수 그리 낮 아 졌 다.신 시 아 만약 이 긍정적 락 미 쳤 어요.우리 는 그것 을 서둘러 임명 까지 함대 를 만 들 어 봐, 를 원양 무역 을 마련 했 다. 배 가시 킬 방침 이다.', 
    ['不闻机杼声，惟闻女叹息。'] = '눈 이 판자촌 한복판 소리 를 듣다 오직 여성 탄식 이 터져 나 왔 다.', 
    ['不限购'] = '限购 하지 않', 
    ['不靠近巴巴罗萨'] = '잘 가지 않 는 아내 로 살 이다', 
    ['不骗你，新大陆的西岸是没有港口的。'] = '당신 을 신대륙 속 하지 않 은 서쪽 없 는 항구 의 이다.', 
    ['不！你们不能这样说我，我持有国王发放的私掠许可证，可以合法劫掠任何其他国家保护的商船，我是为国效力，是合法的！'] = '싫 어!너희 는 그 럴 수 없다. "나 를 보 유한 국왕 발급 하는 사적 스치다 허가증 을 합법적 으로 강탈 어떤 다른 나라 의 상선 보호, 저 는 나라 를 위해 뛰 고 있 고, 합법적 인!', 
    ['不！我四处寻找宝藏就是为了发财，然后迎娶我的梦中情人…不和你说了，我得继续寻宝去，我预感这次肯定会找到宝藏……'] = '싫 어!나 를 찾 아 헤 맨 망 하 기 위해 돈 을 벌다 를 한 뒤 바로 배우자 감 으로 내 이상형 이...너와 말 을 계속 보물 을 찾 을 것 같은 예감 이 이번 에 반드시 찾 아 보 고다.', 
