    ['从船头喷射火焰，对喷射到的目标造成%s伤害，并使其无法被治疗10秒。'] = '배머리 에서 화염 을 분사 한 목표 에 %s 상처 를 받 을 자격 이 없 도록 하 고 치료 10 초 다.', 
    ['从荷兰开往东方的商船都会在此补给，西欧殖民者们正是从这里开始向非洲内陆扩张。'] = '네덜란드 행 동방 의 상선 든 이 보급 서유럽 무단 들 은 여기에서 시작 에 아프리카 내륙 영역 을 확장 하 고 있다.', 
    ['从莫桑比克的商人口中得知，'] = '모잠비크 에서 는 상인 진술 을', 
    ['从蚕茧上剥离下来的天然纤维，是制造【丝绸】必备的原料。'] = '누에고치 에서 떼 어 내 에서 내 려오 는 천연 섬유 제조 [실크 괴뢰 호 전광 들이 필수 원료 를 공급 받 았 다.', 
    ['从贝壳中孕育而出的美丽宝石，通常洁白有光泽，气质高雅，适合用来加工各种【宝石首饰】。'] = '패각 중 에서 잉태 때문에 나 타 나 는 아름 다운 보석, 보통 새하얗다 윤기 가 흐 를 고아 에 적 절 한 기질 을 가공 각종 [보석 세트 사육 하 고 있다.', 
    ['从这里出发可以走路去巴格达，不过游戏里不支持这样做。'] = '여기 서 출발 할 수 있 지만 걸 어서 갈 바 그 다 드 게임 속 이 를 지 지하 고 있다.', 
    ['从这里可以望见圣维森特角的灯塔。'] = '여기 가 내 려 다 보이 维森特 수 세인 트 뿔 이 달 린 등대 이다.', 
    ['从这里可以看到极光，那是女武神的战马。'] = '여기 서 볼 수 있 고 그것 은 오 로라 여 무 신 들 의 말 이다.', 
    ['从这里往东的一大片岛屿就是香料群岛。'] = '여기 서 는 동쪽 으로 는 그야말로 섬 바로 향료 군도 뿐 이다.', 
    ['从这里进入波斯湾之后还有其他港口。'] = '여기 서 페 르 시 아 만 에 들 어간 뒤 에도 다른 항구 다.', 
    ['从郑芝龙的话中分析，他的儿子一定是跑去迎敌了。那么我们只要从这三座港口入手，一定会有所收获。'] = '말 속 에서 郑芝龙 분석, 그 의 아들 은 꼭 뛰 어간 맞 이 적 었 다.그렇다 면 우리 춘 다면 3 개 항구 팍팍 하 고 공 부하 면, 반드시 수확 이다.', 
    ['从金刚石中雕琢而出，因为非常坚硬，一直被人们视为忠贞爱情的象征，将其镶嵌在婚戒等【宝石首饰】上。'] = '금강석 중 에서 다 듬 기 를 앞 두 고 " 너무 딱딱 해 져 줄곧 기억 되 운명적 사랑 을 상징 한 다 는 그 는 혼 계 등 거장 보석 세트 에서 사육 하 고 있다.', 
    ['从金鸡纳树中提取而来，是治疗疟疾必备的药物，也可以作为香料为酒类调味。'] = '금 계 에서 나 나무 에서 추출 으로 나 오 는 말라리아 전문 필수 는 약물 로 도 활용 할 수 있 는 양념 향신료 주류 다.', 
    ['仓 库'] = '창 쿠', 
    ['仓库可以使用和合成道具。'] = '창고 와 합성 사용 할 수 있 게 널 려 있 었 다.', 
    ['他……是“飞翔的荷兰人”操纵师，是你父亲的老熟人，也是使你父亲遭遇不测的罪魁祸首！'] = '그......\' 하늘 을 나 는 네덜란드 인 \' 관제사, 당신 은 아버지 의 老熟人 이자...... 그리고 아버지 사고 를 당 한 장본인!', 
    ['他一定会很开心的。好了，别让亨利王子久等了，走吧。'] = '그 는 꼭 즐 겁 게 했 다.됐어, 티 에 리 앙 리 등 王子久 게 하지 마 세요, 가자.', 
    ['他不应该这样对你，你是韦恩海运的头号功臣。'] = '그 는 이러 면 안 에, 당신 은 웨 인 해운 의 일등 공신 이 됐 다.', 
    ['他人'] = '남', 
    ['他们一定是听说圣乔治“黄金”的传闻。'] = '이 들 은 꼭 장미 황금 듣 는 얘기 까지 나 온 다.', 
    ['他们不过是一些小鱼小虾，大鱼还在后头呢。'] = '이 없 는 일부 작 은 민물고기 작 은 새우 를 대어 를 낚 은 후두 겠 는가.', 
    ['他们以为我仅是个酗酒的普通商人罢了。'] = '만 나 오 는 술 의 일반 상인 뿐 " 이라고 강조 했 다.', 
    ['他们发现我们了，准备作战！'] = '그들 은 우리 를 발견 했 준비 작전!', 
    ['他们在港湾两侧犄角还设有护卫炮台和护卫船来回巡逻，我们的任务会非常艰难。'] = '이 들 은 뿔 항만 양쪽 에는 호위 포대 와 호위 배 나 눠 순찰 을 우리 의 임무 를 수행 할 정 도로 어렵다.', 
    ['他们在港湾两侧犄角还设有护卫炮台，如果不摧毁掉，我们的任务会非常艰难。'] = '이 들 은 뿔 항만 양쪽 에는 호위 포대 에 나 서 지 않 으면 파괴 를 뜯 어 내 고 우리 의 임무 를 수행 할 정 도로 어렵다.', 
    ['他们就在前面，炮火瞄准，将他们截下，小心不要伤到船上的无辜人员。'] = '그들 은 맨 앞 에 포화 조 준 이 들 차단하다 아래 조심 하지 말고 뼈 는 한 배 를 탄 없 는 실무자 들.', 
    ['他们居然做出如此丧心病狂的行径！我饶不了他们！'] = '생각 이 이처럼 丧心病狂 행태 가 아 닐 수 없다!내 가 더하다 하지 못 합 니 다!', 
    ['他们居然还敢得寸进尺！'] = '그들 은 한술 더 떠 들 리 는 감히!', 
    ['他们往马尼拉方向逃了，船长，不能让他们跑了，他们身上肯定有陈祖义的线索。'] = '그들 은 마 닐 라 방향 으로 탈, 선장 을 뛰 지 못 하 도록 해 야 했 을 그들 에게 는 것 처 럼 느 껴 陈祖义 한 단서 를 확보 했 다.', 
    ['他们扼守斯堪的纳维亚半岛，切断我们与北方的联系。我们与盟友大英帝国的贸易往来因此中断。'] = '요충 을 지키다 스칸디나비아 반도 그들 을 차단 하는 우리 북측 과 연결 된 다.우리 와 맹우 대 영 제국 의 무역 거래 중단 의 원인 이 된 다.', 
    ['他们火炮强大，与敌人保持距离…'] = '그들 은 주포 강 하 고, 적 과 거리 를 두 려 는...', 
    ['他们的货船正在从卡利卡特运走文物，这对卡利卡特来说是毁灭性损失，快阻止那些货船！'] = '그들 의 화물선 에서 빠 져 나 오 고 칼 리 카 터 반출 문화재 로 가 는 것 은 칼 리 카 터 에게 는 회복 불능 의 손실, 어서 최근 화물선!', 
    ['他们说得是科纳克太阳神庙，是婆罗门教的圣地之一。狮首象身的怪物是其中雕刻上图像，如果你有兴趣可以去探索一番，说不定会有意外收获。'] = '이 들 처 럼 말 은 코 나 크 태양 신전, 은 브라만 교 의 성지 중의 하 나다.스 포 티 지 첫 코끼리 몸 의 괴물 은 그중 조각 에서 그래픽, 만약 당신 이 취미 에 갈 수 있 게 모색 을 맞 고 있 을지 모 른 다 는 망 외의 소득 이다.', 
    ['他们说的也不无道理……哦，我是说，他们太不讲道理了，这下你可以跟我们上船了吧？'] = '그들 의 말 도 일리 가 있다.네, 저 는 자신 들 을 너무 했 을 것 아 닌 가 "이 아래 와 우리 승선하다 시 지 요?', 
    ['他叫马合谟沙，不过他不愿意和陌生人打交道，除非你们能给他的交易所带来生意。'] = '그 의 이름 은 마 합 모 샤 있 지만 그 는 싫 어 낯 모 르 는 이 와 의 교제 중 이 라 는 거지, 당신들 에게 해 줄 수 있 는 그 의 거래 소 에 장사 였 다.', 
    ['他可是个有名的硬骨头，要小心对付。'] = '그 는 그러나 개 유명 독종 을 조심 스 럽 게 상 대가 아니다.', 
    ['他呀，刀子口豆腐心，见你们协助我朝除此大患，心中十分高兴。从我这知道你们在找什么东西之后，特意广发告示，派人四处搜寻……'] = '그 는 야, 칼 을 입 豆腐心 당신들 협조 나 북 이 저 마음 을 기 뻤 다.이 는 내 가 알 고 있 는 무슨 물건 을 위해 일부러 찾 아 뒤 广发 고시 를 파 견해 여기저기 수색....', 
    ['他掳掠人口，当做奴隶贩卖！这种罪恶的行径，连海洋女神都不会饶恕他！'] = '그 는 노략질 하다 인구 를 참고인 자격 으로 노예 인신 매매!이런 악의 행위 를 조차 바다 의 여신 이 없다 는!', 
    ['他是个穷小子，又输了钱，据说跑到【布宜诺斯艾利斯】去找事做了，他这种游手好闲的人怕是只会闯祸。'] = '그 는 아주 가난 한 녀석 을 더 잃 었 다고 돈 을 달 려 가 부 에 노 스 아 이레 스 앤 사육 하 고 궁리 하 고 생각 했 을 찾 아 이런 빈 둥 거리 는 사람 만 봤 는데 화 를 자초 하다.', 
    ['他是唯一一个被冠以“伟大”称号的海盗王，也是奥斯曼帝国的海军元帅。他无情的摧毁敌人的舰船，却把获得的财富无私的分给穷苦的人民。他把一生献给了他要保卫的领土和人民，其名字在爱琴海永世流传。他就是地中海之王--巴巴罗萨·海雷丁！'] = '유일 하 게 에게 는 \' 위 대한 칭호 를 얻 은 해적 왕 이자 오 스 만 제국 해군 총사령관 이다.그 는 무 자비 한 무 적의 함선 들 을 놓 고 얻 은 부 는 무사하다 는 인민 들 에게 나 눠 주 더라도 가난 한 다.그 는 평생 을 바치 겠 보위 의 영토 와 인민 에게 해 그 이름 은 영세 유포 되 고 있다.그 가 바로 지중해 의 왕 인 바 버 라 사 헤 레 딩!', 
    ['他有这个权力，这家海运公司现在属于他。我很高兴能够与那些充满激情的经纪人和水手共事，现在到了说再见的时候了。'] = '그 는 이 권력 을 오 르 내리 며 해운 회사 지 금은 그 다.가능성 이 들 과 열정적 인 매 리 너 스 로 드 매니저 와 함께 일을 이젠 안녕 할 때다.', 
    ['他添加你为好友'] = '그 는 당신 을 첨가 친구 처 럼 지 낸 다', 
    ['他请求你资助'] = '그 는 해 지원 하 도록 했 다', 
    ['他资助你'] = '그 는 당신 을 지원', 
    ['他部落的支持。'] = '그 는 부족 의 지지 를 받 았 다.', 
    ['他？你目前没有让他亲自动手的实力，他可是个极度骄傲的家伙。所以现在你要做的就是对付阿芒德。'] = '그 는?너 아직 그 에게 직접 팔 을 걷 어 붙 이 는 실력 을 겸 비 한 그 는 그러나 개 극 도로 자랑 스 러 운 놈 이다.그래서 지금 당신 대처 해 야 할 일 은 아 참억새 덕 이다.', 
    ['付出必有回报'] = '지불 직접적인 보답', 
    ['代表善良、圣洁的船首像，能为舰船驱走一切厄运。'] = '대표 착 하 고, 거 룩 한 뱃머리 처 럼 보호 함선 분향소 는 모든 징크스.', 
    ['令人钦佩又如何？朝廷之人是不会承认这一切的，仅仅因为我是女儿身！'] = '멋 은 어 떨 까.조정 하는 사람 은 인정 하지 않 을 것 " 이라고 했 다. 모든 것 이 그 는 (나 는 女儿身!', 
    ['以【棉花】为原料，手工织成自然舒适的布匹，许多古老的民族依旧保有这项极其复杂的工艺。'] = '[사육 하 고 있다 는 솜 을 원료 로 하는 바느질 로 짠 자연 편안 한 천 같은 많은 오래된 민족 은 여전히 보유 이 매우 복잡 한 기법 이다.', 
    ['以【棉花】为原料，每织四根绒线就织入一根细铁丝，织到一定长度后，割开绒圈去除铁丝，便成了花纹别致的天鹅绒。'] = '[사육 하 고 있다 는 솜 을 원료 로 하는 것 이 당 뜨개질 네 개 의 숫실 한 방울 을 떨 어 뜨 리 면 뜨개질 근 가늘다 철사 를 뜨다 일정 길이 가 뒤 를 철사 융모 권 제거 돼 버 렸 다고 무늬 의 독 특 한 벨벳 혁명 이다.', 
    ['以【棉花】作原料织成，中间夹杂着金色的丝线，富有东南亚风情。'] = '[작 은 면화 괴뢰 호 전광 들이 원료 로 짠 중간 에 섞 여 있 을 뿐 황금 의 견사 고 부 은 동 남아 풍 일색 이 었 다.', 
    ['以【白银】为原材料，经过工匠巧手打造而成的饰物。'] = '백 은 비 는 거장 사육 하 고 있다 는 원자재 를 거 쳐 장인 巧手 만 으로 는 장식물 이거 다.', 
    ['以【纸莎草】制成的纸张为载体所创作的艺术品，是古埃及文化的重要组成部分。'] = '[종이 로 만 든 종이 를 사육 하 고 있다 莎草 운반 체 그린 예술품 은 고대 이집트 문화 의 중요 한 요 소다.', 
    ['以【羊毛】等各种动物毛发织成的纺织品，手感柔软蓬松。'] = '[양모 사육 하 고 있다 는 등 각종 동물 모발 로 짠 는 섬유, 때로는 부 더부룩하다 이다.', 
