    ['北欧并不只属于汉萨同盟，任何人都有进出的自由。'] = '북유럽 만 이 아니 에 속 한 사 동맹 등 으로 누 구나 가 진출 의 자유 다.', 
    ['北欧是维京人的故乡。'] = '북유럽 바이킹 은 사람 의 고향 이다.', 
