    ['北欧海盗'] = '북유럽 바이킹 족', 
    ['北欧海盗非常猖獗，最好在造船厂强化你的装配。'] = '북유럽 바이킹 족 이 창궐 하는 것 이 좋다 는 조선소 강화 너 의 배포 했 다.', 
