    ['北海的主要势力有英国人、汉萨同盟以及骁勇善战的维京人，我们必须争取到其中一部分！你先到英国人那里去试探一番吧。'] = '북해 의 주요 세력 이 영국인 · 한 사 동맹 및 물불 의 버 진 사람 " 반드시 쟁 취한 일부!당신 먼저 찾 는 영국인 530ur 타진 을 떠 난 다.', 
