    ['原是三面环海的渔村，欧洲商船来此后，逐渐发展为繁忙的贸易港。'] = '원래 삼면 이 바다 의 어촌 을 유럽 상선 을 이후 회로 바 쁜 무역항 이 었 다.', 
    ['原是英国东印度公司的贸易船，杰克为船长受命运送非洲奴隶。出于正义感，杰克将他们全部释放，然后与他的黑珍珠号一起消失在海平线上。'] = '원래 영국 동인 도회 사의 무역 선 을 잭 은 선장 이 라 는 지령 을 받 고 운송 아프리카 노예 가 된 다.정의감 을 잭 이 들 을 모두 석방 뒤, 그 의 흑 진주 함 과 함께 사 라지 는 海平线 에서 다.', 
    ['原有属性'] = '기존 속성', 
    ['原木'] = '통나무', 
    ['原本是一座印第安小渔村，欧洲人在此设立贸易点后，吸引了海盗不断入侵该城。'] = '원래 하나 인디언 작 은 어촌 유럽인 들이 이 설립 무역 시 뒤 큰 인기 를 끌 었 다. 이 성에 계속 침입 해적', 
    ['原本是印第安人的居住地，经过西班牙的殖民后，这里变成了加勒比海盗的大本营。'] = '원래 인디언 의 주소지 를 거 쳐 스 페 인의 식민지 후 에 캐 리 비 안 의 해적 의 본거지 였 다.', 
    ['原来一切都是彼得松·霍因为了掌控印度洋所设计的阴谋，现在他在卡利卡特附近布置了大型炮塔，躲开炮塔，击破他的旗舰。'] = '원래 모든 게 피 터 송 호 때문에 인도양 장악 음모 가 디자인 한, 이제 그 는 칼 리 카 터 주변 에 배치 해 대형 포탑 에 피 포탑, 격파 그 의 기함 이다.', 
    ['原来如此。为了爵位，也只有全力以赴了。'] = '그 렇 군 요.작위 를 받 기 위해 도 단 노력 을 다 했 다.', 
    ['原来如此，可你的外表看上去很柔弱，不像出海之人。'] = '그 렇 군, 당신 의 외모 비상하다 유약하다 가 아 닌 것 처 럼 출항 한 사람 이다.', 
    ['原来如此，怪不得这么多人，我们也别落后，去市政厅投资！'] = '그 렇 군, 어쩐지 이렇게 많은 것 을 우리 도 별 낙후 에 시청 투자!', 
    ['原来如此，我们也正在寻找陈祖义的消息，说不定我们可以合作。'] = '그 렇 군, 우리 도 사람 을 찾 고 있다 는 소식 陈祖义 지도 모 른 다고 우리 협력 할 수 있다.', 
    ['原来如此，我看他们与这些红眉毛绿眼睛的侵略者长得十分类似，以为他们也是同伙。'] = '그 렇 군 을 그들 과 이 홍 눈썹 녹 눈 침략자 들 예 쁘 게 생 겼 을 것 와 거의 유사하다 한통속 이라고 볼 것 이다.', 
    ['原来如此，无知而野蛮的海盗是文明的大敌。先暂缓追击海盗的脚步，保护圣乔治，我们协助恢复城市设施，能帮多少就帮多少吧。拉比斯，我终于能理解你的心情了。'] = '그 렇 군, 무지 야만 한 해적 문명 의 적 인 것 이다.먼저 유예 추격 해적 들 의 발길 을 보호 과 장미 를 우리 협조 회복 도시 시설 을 대 주 면 얼마 남 을 돕 는 얼마나 시다.라 비 스, 나 는 마침내 당 신의 마음 을 이해 할 수 있 었 다.', 
    ['原来如雷贯耳的【暴雪竞技场】就在卑尔根！听说这是著名的 金发埃里克 建造的呢！'] = '원래 천하 앤 디 경기장 에서 사육 하 고 있다 면 폭설 비굴하다 르 근!님 은 유명 는 긴 금발 머리 에 릭 건조 하는 게 아 닌 가!', 
    ['原来投资港口后还有分红回报！立刻'] = '원래 도 배당 투자 항구 에 보답!당장', 
    ['原来摩尔人的背后是地中海真正的海上霸主--红胡子巴巴罗萨·海雷丁！但是，为了家乡的安宁，不管面对的敌人是多么强大，绝不退缩！'] = '원래 무어 사람 의 이면 에는 진 정한 강자 로 지중해 해상 도인 홍 수염 아내 로 살 헤 레 딩!그러나 하 기 위해 고향 의 안녕, 아무리 직 면 하 고 있 는 적 은 아무리 강 해도 결코 물 러 서!', 
    ['原来是你们在搞鬼，看来你们没搞清楚状况。'] = '원래 는 당신들 은 없 을 搞鬼 당신들 규명 된 상황 이다.', 
    ['原来是威尼斯人在背后支持阿拉伯商团，立刻赶回'] = '원래 베 네 시안 의 지지 를 받 아 랍 상단 을 즉각 로 쫓 아', 
    ['原来是郑公子，汪直罪恶深重，我们此去正是为了这个家伙。'] = '원래 정 인 공자 를 직 죄 를 우리 가 이 녀석 이 입 니 다.', 
    ['原来海盗一直利用佛得角附近凶险的环境伏击过往的船只！难怪那么多经验丰富的探险家都在这里遇难！'] = '원래 해적 계속 이용 佛得角 인근 의 환경 매복 공격하다 구심력 이 지 나 가 는 선 박이!오죽 하 면 그렇게 많은 경험 이 풍 부 한 탐험가 이 이곳 에서 사망!', 
    ['原来海盗一直在利用佛得角附近凶险的环境伏击过往的船只！难怪那么多经验丰富的探险家都在这里失事！'] = '원래 해적 그동안 활 용해 佛得角 인근 의 환경 매복 공격하다 구심력 이 지 나 가 는 선 박이!오죽 하 면 그렇게 많은 경험 이 풍 부 한 탐험가 이 이곳 에서 사고!', 
    ['原来海盗们所谓正确的“交易”就是--如果对方实力弱，就进行掠夺，如果对方实力很强，就进行钱货交易。当然，两样都存在风险。'] = '원래 해적 들이 이른바 정확 한 \' 거래 \'를 하자 바로 인 상 대가 뒷문 을 수탈 했 고 상대 화력 이 돈 만 벌 여 물건 을 거래 했 다.물론 가 위험 할 수 있다.', 
    ['原来这一带的海盗都属于一个人，“潮州王”陈祖义！他的手下甚至对沿海城邦征收高额的贸易税费，稍有不从，便会招致船毁人亡的下场！'] = '원래 이 일대 는 해적 들이 한 사람 에게 \' 潮州 왕 \' 陈祖义!그 의 밑 에서 지 나 칠 정 도로 연안 도시 국가 에 물리 는 세금 을 약간 은 무역 을 초래 구멍 의 귀결!', 
    ['原来这里是传言中的象牙海岸，真是个富饶美丽的地方，难怪有那么多的探险者蜂拥而至！'] = '여기 가 설 중 상아 해안 니, 정말 풍요하다 아름 다운 곳, 어쩐지 많 익 스 플 로 러 몰 려!', 
    ['原来阿芒德的靠山是地中海真正的霸主--“红胡子”巴巴罗萨·海雷丁！'] = '원래 아 참억새 덕 의 후견인 으로 알 려 진 정한 강자 는 지중해 붉 은 수염 \' 아내 로 살 헤 레 딩!', 
    ['原来霍金斯的背后竟然有英国女王的支持。为了达成交易，女王甚至将强大的皇家海军战舰赠给霍金斯，她们随时可能加入战斗！'] = '원래 호 킹 스 의 배후 가 있 었 다니 영국 여왕 의 지지 를 받 고 있다.출하 기 위 한 거래 를 여왕 까지 강력 한 레 알 소 시 에다 드 해군 전함 을 기증 하 면 호 킹 스), 최 혜 용 (예문 언제든지 가입 전투!', 
    ['原英国大型商船，在加勒比海被黑胡子劫获，在以安妮女王复仇号给她命名并加装了火炮后成为了黑胡子的旗舰。伴随她出现的是大海上来往商船的噩梦。'] = '원래 영국 상선 을 대형 는 카 리 브 해 킹 胡子劫 획득하다 으로 멋 을 낸 후 안 니 여왕 복수 호 그녀 에게 명명 하 고 加装 포 사격 을 한 후 검 은 수염 입구.동행하다 그녀 는 나 타 나 는 것 은 바다 에서 왕래 상선 의 악몽 이다.', 
