    ['去他的牙买加总督！以为这样就能收买我，却没想到我继续与海盗合作，还可以获取丰厚的利益，哈哈哈……'] = '그놈 의 자 메이 카 총독!이렇게 되 면 매수 줄 알 았 는데, 그 라고 생각 하지 않 았 지만 계속 해적 들 과 의 협력 을 챙 길 수 있다 짭 짤 한 이익 을 하 하하......', 
