    ['去吧，迎接属于你的试炼！大海永远是勇者的乐园，懦夫的坟墓，碾碎他们！'] = '갑 시다. 맞 는 당신 의 시범 달구다!바다 는 영원히 승전보 를 울 리 는 랜 드 에 따 라 치킨 의 무덤 을 碾碎 그들!', 
