    ['又一位投资者！太好了！对了，你知不知道，你对每一个港口的投资都能换来分红回报？不知道！那还不赶紧去领取，过期作废的哦！'] = '또 다른 투자자!너무 좋아요!맞 아요, 당신 을 알 고, 당신 은 하나하나 가 항구 의 투자 를 가 져 오지 배당 보답?모 르!그 가능성 을 배제 할 수 없 는 얼른 수령 할 수 있 으며, 유통 기한이 폐기하다 보 내 세요!!!', 
    ['又一艘敌舰进入卡利卡特，卡利卡特快被攻陷了！'] = '또 하나의 척 적 함정 진입 한 칼 칼 리 카 터 터 빨리 이 함락 되 었 다!', 
    ['又一艘新船，快设置到$(missioncolor:【舰队】)吧，我们的舰队越来越强大了。'] = '또 새 배 한 척, 빨리 설치 까지 $(missioncolor: 함대 괴뢰 호 전광 들이) 를 만 들 어 봐, 우리 해군 함대 는 갈수록 강 해 졌 다.', 
    ['又是一座惨遭荼毒的城市，海盗的贪婪就像是一个无底洞，会将整个城市掏空。卢卡斯犯下的罪恶只有用鲜血才能净化！'] = '셋째 는 도시 이자 멍 에를 폐해 를 해적 들 의 탐욕 는 마치 밑 빠 진 독 에 도시 전체 여 겼 다.루 커 스 저지 른 죄악 만 피로 야 정화!', 
    ['又是你们？上次海军居然没把你们的破船击沉？'] = '또 너희 냐?지난번 지 못 너희들 의 보물 선 이 격침?', 
    ['又是倭寇又是海盗，现在还来了一群欧洲人。'] = '이자 왜군 이자 해적, 지금 도 왔 한 무리 의 유럽 명 이다.', 
