    ['呵呵，不能说不能说，除非你拿出几瓶马赛产82年的【茴香酒】，否则我是不会告诉你的。茴香酒可是好东西啊，当年我偷偷拿会长的收藏畅饮一番，现在都记得那个香味……对了，我只能说那是个好东西，看你的样子是个航海家吧，这对于你来说有莫大的好处。'] = 'ㅋ ㅋ, 말 할 수 없다 " 며 " 말 할 수 없 는 거지, 당신 을 꺼 내 마르세유 몇 병 산 82 년 의 거장 회향풀 술 사육 하 고, 그렇지 않 으면 저 는 당신 이 새 는 하지 않 겠 다.회향풀 술 하지만 좋 은 일 들 아, 그해 숨 어서 손 회 장의 소장 畅饮 을 지금 도 기억 그 향기....맞다. 나 이러쿵저러쿵 할 수 밖 에 없 는 좋 은 것 을 보 면 너 의 모습 은 航海家 시다 까지 온 것 은 당신 에게 큰 는 장점 이 있다.', 
    ['呵呵，人心难测啊，人心难测……'] = 'ㅋ ㅋ, 인심 캐 슨 아, 가슴 에 와 닿 는 물가 가......', 
    ['呵呵，你自己好好想一下吧，我先出去走走。'] = 'ㅋ ㅋ, 너 스스로 잘 생각 해 봐, 내 가 먼저 나 가 뇌 가 활성화 된 다.', 
    ['呵呵，如果不是看在你父亲的份上，我调开了舰队，你怎么有可能击败阿芒德那个蠢货，虽然他的野心迟早会把他自己烧毁。'] = 'ㅋ ㅋ, 그렇지 않 으면 봐 서 당신 아버지 를 열 었 나 조동하다 함대 를 왜 꺾 을 수도 있 을 蠢货 아 참억새 드 그 그 의 야심 을 조만간 그 는 자 신의 불 에 탔 다.', 
    ['呵呵，小妞，口号倒是喊得响亮，待会可别往吓哭了！'] = 'ㅋ ㅋ, 小妞, 구호 따르다 보 높이 지 는지 도통 부담 하지 에 놀 라 울 었 다!', 
    ['呵呵，年轻人，这是工匠公会的信物。工匠公会是七海中闻名的中立组织。有了这个就能够请动那群臭脾气的老家伙帮忙改造船只了。'] = 'ㅋ ㅋ, 젊 은 층 이 장인 공회 한 다 는 확신 했 다.장인 공회 은 칠 바다 에서 유명한 중립 기구 다.수 십 시 오 는 이렇게 움 직 이지 그 군 구리다 성벽 의 늙 은 놈 돕 겠 다 "고 말 했 다. 개조 선박', 
    ['呵呵，我找到玛利亚时才明白，她并不在意在海难中丢失的财富，只在意我能从海难中平安归来……'] = 'ㅋ ㅋ, 내 가 찾 마리 아 시 서 야 알 았 다. 그녀 는 아랑곳 하지 않 은 해난 에서 잃 어 버 린 부 를 만 의식 을 보 여 준 해난 에서 무사 귀환....', 
    ['呵呵，没什么。新消息，红胡子打算占领亚平宁，精锐尽出，他的后防必定空虚。我们可以趁这个机会干掉驻守老巢$(missioncolor:【伊斯坦堡】)的阿芒德！'] = 'ㅋ ㅋ, 아무것 도 아니 예 요.새로 운 소식 을 전 할 예정 亚平宁 붉 은 수염 을 점령 정예 최선 을 다 빠 져 나 가 고 그 의 후방 꼭 허 전 했 다.우리 도 할 수 있다 "고 이 를 틈 타 죽여버리다 주둔 슐 $(missioncolor: 이 라 크 스 텐 버그 괴뢰 호 전광 들이) 의 애 참억새 덕!', 
    ['呵呵，没什么，你自己想好就行，我只是随便说说。'] = 'ㅋ ㅋ, 아무 렇 지도 너 자신 들이 하 고 싶 은 좋 으면, 그냥 되는대로 말 이다.', 
    ['呵呵，没想到吧，今天的你就好比当年的我，你放心，我不会让你轻易死掉的。'] = 'ㅋ ㅋ 지 몰 랐 죠, 오늘 당신 \' 꼴 그해 의 나 를 걱정 마, 나 니 가 쉽게 죽 는 다.', 
    ['呵呵，现在你拥有了任命两艘船组成舰队的权限，随着爵位的提升，你会得到更多的特权，其中的好处你以后自然会明白。'] = 'ㅋ ㅋ, 지금 있 는 당신 을 임명 해 선박 두 척 을 구성 하는 권한 함대 함 에 따 라 작위 향상, 당신 은 얻 을 수 있 는 특권 을 이중 의 이점 이 앞으로 당신 이 자연 스 럽 게 이해 했 다.', 
    ['呵呵，自由？“不自由，毋宁死”是你们这些贵族老爷们的荒唐信念，我们只想活下去。'] = 'ㅋ ㅋ, 자유 로 워 진 건 가.\' 자유 롭 지 않 을 毋宁 죽 는 다 "는 老爷们 너희들, 귀족 의 황당한 신념 을 우리 주장 을 그냥 살 아가 는 것 이다.', 
    ['呵呵，越是高级的船，能升的星级越多，可不要因为这艘小船而忘记自己的目标啊。'] = 'ㅋ ㅋ, 고급 차 의 배 를 l 당 특급 이 많 을 수록 하지 말고 할 수 있 기 때문 이 량 도 잊 어 버 리 고 자 기의 목표 를 정 하지 않 네 요.', 
    ['呵呵，这可是“女神的恩赐”，从那次灾难之后，我就一直将这枚克拉肯之眼当做假眼。'] = 'ㅋ ㅋ, 김 정 일 국방 위원장 이 \' 여신 한 작업 을 시작 했 다. 당연히 재난 후 부터 줄곧 은 이 크 라 켄 의 눈 중심축 으로 가짜 눈 이다.', 
    ['呵呵，这是冒险家协会为了鼓励勇敢的冒险者探索大海，每天都会推荐一名航海士给初出茅庐的冒险家，现在先将新加入的航海士任命到船上。'] = 'ㅋ ㅋ, 이것 은 모험 가 협회 출산 을 장려 하 기 위해 용 감 한 冒险者 탐구 바다 으로 매일 1 명 에게 추천 항해사 모험 가 의 풋내기 를 일단 에 새로 가입 한 항해사 임명 에서 배 를 타 고 있다.', 
    ['呵，你所谓的感谢就是在英西大海战中让西班牙舰队覆灭吧。'] = '입김 을 불다, 당신 은 이른바 감사 는 영 서 바다 전 에서 스 페 인 함대 전멸 하다 시다.', 
    ['呵，贵族华丽的袍子上都沾满了血和泪，年轻人，你的行为的确可嘉，听说你一直在寻找去前往世界尽头的凭证——女神之誓的碎片，我这里刚刚好有一块，可以将其赠送。'] = '입김 을 불다, 귀족 화 려 한 袍子 에서 걸 피 와 눈물 이 젊은이, 너 의 처사 가상하다, 해 줄 것 을 당부 했 다 는 증빙 에 찾 아가 세상 끝 인 여신 의 맹세 의 파편 이 여기 내 알맞다 가 하나 있 을 할 수 있 고, 그 기부 된 다.', 
    ['呼哈！继续前进！'] = '부르다 하!계속 전진!', 
    ['呼，这里的海盗真是比沙子还多呢。'] = '어 휴. 이곳 의 해적 정말 보다 모래 도 많 네.', 
    ['命运号'] = '운명 호', 
    ['命运号的消息'] = '운명 호 소식 을 전 했 다', 
