    ['命运女神编织丝线，万物都在丝线上运行。'] = '운 명의 여신 엮다 견사 재봉 은 만물 에 모두 견사 에서 운행 된 다.', 
    ['和'] = '과', 
    ['和其他品种的咖啡相比，里约咖啡虽然口感较为粗糙，但胜在高产，不失为一种大众咖啡。'] = '과 다른 품목 의 커피 보다 는 리 우 커피 맛 이 비교적 들쭉날쭉 했 지만 승 은 수확 많은 을 포기 할 줄 아 는 것 도 대중 카페 도 있다.', 
    ['和小麦相比，大麦不适合做面包，但可以用来酿造【啤酒、伏特加、威士忌、琴酒】。'] = '와 밀 에 비 해 보리 빵 에 적 합 하지 않 지만, 원료 용 으로 활용 할 수 있 지만, 위스키 맥주, 타이완 (보드카 · 칵테일 사육 하 고 있다.', 
    ['和平使者'] = '평화 사자', 
    ['和平的条件'] = '평 화의 조건', 
    ['和我不用客气，希望我回来时能够带来好消息。'] = '저 와 사양 하지 마, 희망 은 내 가 돌 아 왔 을 때 이 선물 을 했 다.', 
    ['和拉比斯心生间隙'] = '와 라 비 스 마음이 생기 면 틈 이다', 
    ['和敌方保持一定距离，被“希腊火”喷到可不是开玩笑的'] = '적 과 일정한 거리 를 두 되 면서 \' 그리스 불의 사출하다 까지 이 장난 이 아니 더라', 
    ['和纯伏特加相比，葡萄酒简直就是淡果汁。'] = '과 순수 보드카 에 비 해 와인 피멍 이 옅 은 주스 이다.', 
    ['和罗安达一样，这里也是由航海家迪亚士发现的。'] = '과 罗安达 처 럼 이곳 역시 航海家 희망 곶 에서 발견 된 것 이다.', 
    ['和贝拉米联手击退政府军，并且保护贝拉米旗舰。'] = '贝拉米 격퇴 와 손 잡 고 정부군 을 보호 하 고 贝拉米 기함 이다.', 
    ['咖啡豆产自牙买加蓝山山脉，这种咖啡拥有所有好咖啡的特点，味道浓郁香醇，口感顺滑。'] = '커피 원두 산 자 메이 카 蓝山 산맥 을 모두 갖 고 있다 고 이런 커피 마 시 는 커피 맛 좋 은 특성 을 씹 는 느낌 이 농 후 흐 륵 매 끄 러 운 다.', 
    ['咖喱'] = '카레', 
    ['咦！这个港口水网密布，快赶上威尼斯了。'] = '어머나!이 항구 水网 흐렸다. 빨리 따 라 잡 베 네 치아 했 다.', 
    ['咦，船长你在说啥，问我今后的打算，噢，不用您担心，就算我比较倒霉，但我不会放弃我的梦想。'] = '어머나, 선장 은 " 너, 나 에게 물 었 다. 향후 행보 를 할 필 요가 없 어, 당신 을 걱정 하 더라도 내 가 비교적 재수 없 지만 포기 하지 는 않 겠 나 의 꿈 입 니 다.', 
    ['咦？你们不是汉萨同盟的商船，本海域严禁汉萨同盟以外的船只经过，速速离开。'] = '어머나?당신들 은 한 사 동맹 의 상선 본 해역 금지 한 사 동맹 이외 의 배가 지 나 를 속속 떠 나 려 합 니 다.', 
    ['咦？前面好像有什么比赛？'] = '어머나?앞 에 있 는 듯 했 다. 무엇 인가.', 
    ['咦？大叔您也知道拉比斯？'] = '어머나?아저씨 선생님 도 알 라 비 스.', 
    ['咦？大叔您说什么？发生什么事了，怎么人们都在四散奔逃？'] = '어머나?아저씨 뭐 라 구 요?무슨 일 이 발생 했 는데 왜 사람들 은 흩 어 奔逃?', 
    ['咦？进阶图纸？有了这个图纸我们就可以把一艘星级船只随机进化成高阶船。'] = '어머나?진 섬돌 도면?우리 는 이렇게 설계도 만 성 급 선박 1 척 을 무작위 로 진화 핵폐기물 은 배 에 올 랐 다.', 
    ['咳~咳~~我才是船长！嗯，我说伙计们，敌人港口的第一道防线已经突破了！让我们趁胜追击！'] = '기침하다 ~ 아이참 ~ ~ 나 야 말로 선장!응, 나 동업자 들 을 적 항만 의 첫 저항 선 을 돌파 했 다!우리 에게 혼란 을 틈 타 승 추격!', 
    ['咳~咳~（热闹的酒馆安静了下来）。请问这里有赋闲的航海士找活干吗？我是 $(usename) 船长！我需要一些能干的家伙跟我到巴塞罗那对付摩尔海盗！'] = '기침하다 ~ 아이참 ~ (활기 찬 주점 렸) 다.여 기에 이 등장 하는 항해사 찾 아 살 인지 알 아서 머 해?저 는 $(usename) 선장!저 는 일부 유 능 한 놈 나 랑 까지 바 르 셀 로 나 대충대충하다 무어 해적!', 
    ['咳、咳，拉比斯的话虽然…但也没有错，每年由于撞上浮冰而沉没于北海中的船不可胜数。我们最好改变下阵型，用护甲较高的装甲舰和突击舰将旗舰护卫在最中间。'] = '아이구, 타이 트 라 비 스 의 말 은...그러나 도 틀 리 지 않 았 으며 매년 이 부 딪 于北海 부빙 해 침몰 되 는 선 불가 다승 이다.바 꾸 는 게 좋 겠 지만 아래 포 메이 션 을 용 호 갑 이 높 은 装甲舰 과 돌격 함 이 기함 호위 는 가장 중간 이다.', 
    ['咳、咳，拉比斯的话虽然…但也没有错，每年由于撞上浮冰而沉没于北海中的船不可胜数。我们最好改变下阵型，用护甲较高的装甲船和近战船将旗舰护卫在最中间。'] = '아이구, 타이 트 라 비 스 의 말 은...그러나 도 틀 리 지 않 았 으며 매년 이 부 딪 于北海 부빙 해 침몰 되 는 선 불가 다승 이다.바 꾸 는 게 좋 겠 지만 아래 포 메이 션 을 용 호 갑 높 은 장갑 선과 가까이 배가 이 기함 호위 는 가장 중간 이다.', 
    ['咳咳……咳咳……好像失败了呢。'] = '기침하다 아이참....기침하다 아이참....듯 실패 했 을 까.', 
    ['咳咳……并不是我不信任你们，但这批货物对我很重要，你们必须在市政厅压一笔保证金。'] = '기침하다 아이참....난 게 아니 지만 당신들 을 불신 이 물량 에 대한 중요 한 나 는 시청 압 한 획 보증금 이다.', 
    ['咳咳，多谢您，善良的船长。强盗，该死的强盗！他们掳走了我们所有人，把我们当成奴隶，进行惨无人道地虐待。我趁他们不备，跳海逃生。要不是您，我这条命就……呜……'] = '기침하다 허, 감사하다 당신, 착 한 선장.강도 놈 의 강도 를!이 들 掳走 우리 모든 사람 들이 우리 를 노예 를 잔 인하 게 폭행 을 당 했 다.내 가 그들 을 틈 타 방비 하지 않다 점프 해 추락 했 다.오죽 하 면 당신, 내 조 인명 이......꺼이꺼이......', 
    ['咳咳，差点忘了还有这回事。辛西亚，现在去交易所把存货出售，换取继续强化所需的银币吧。'] = '기침 도 허, 잊 을 뻔 했 어요. 뜨내기 는 아니 었 다.신 시 아, 지금 거래처 방문 을 재고 자산 매각 으로 바 꾼 계속 강화 에 필요 한 은화 시다.', 
    ['咳，喝多了莫名其妙帮人跑了趟腿。对了，戴肯叔叔，您帮我看下，这个锤子是什么？'] = '허, 과음 했 엉 뚱 한 사람들 을 위해 뛰 어 다 녀 온 발 이 었 다.맞 아요, 다이옥신 켄 아저씨, 당신 좀 보 으로 이 경우 망치 는 무엇 입 니까?', 
    ['咽喉之争'] = '인두 다툼', 
