    ['好吧，你赢了。当日我在里斯本的酒馆里听到一群贩奴者正在讨论准备去南方“运货”，怒火中烧，所以……'] = '그래 요, 당신 이 겼 어요.이날 나 는 리스 본 의 술집 을 듣 고 한 무리 의 행상인 노예 자 들이 토론 준비 가 남측 운송 을 怒火中烧 기 때문에...', 
    ['好吧，我们先与神圣同盟的盟友汇合，率先突击奥斯曼海军在西西里一代的布防。'] = '좋아요, 우리 스스로 과 신성 동맹 의 맹우 로 합류 했 고 먼저 돌격 오 스 만 해군 은 시 칠 리 아 세 대의 布防 이다.', 
    ['好吧，我可不管是谁在支持他，我一定要让他滚得远远的！永远离开这条航线。'] = '그래 요, 그럼 저 가능 하 면 누구 는 그 를 지지 를 반드시 그 굴리다 턱없이!영원히 떠 나 이 개 노선 이다.', 
    ['好吧，那你以我葡萄牙特使的名义，先去北方以寻求结盟的名义来寻找其它的女神之誓。这里有我的推荐信，你拿着它先到$(missioncolor:【伦敦】)试探一番吧。'] = '그래 요, 그럼 저 를 포 르 투 갈 특사 의 명목 으로 먼저 북측 을 추구 하는 결탁 한 명분 찾 을 다른 여신 의 맹세 했 다.제 가 여기 는 추천 사 를 갖다 그것 을 먼저 찾 는 $(missioncolor: 런던 괴뢰 호 전광 들이) 타진 을 떠 난 다.', 
    ['好吧，那你听好了，卡瓦略·雷耶斯。我们不会像老师一样教导你，但是会像伙伴一样和你并肩作战。如果你愿意的话，就加入我们吧！'] = '그래 요, 그럼 저 어... 당신 은 좋아 졌 지만, 卡瓦略 레 예 스.우리 선생님 이 되 지 는 않 을 것 처 럼 가르침 당신 을 하 고 있 으나 처 럼 동반자 처 럼 과 당신 과 함께 작전 을 수행 했 다.만약 당신 은 우리 가 원한 다면 가입 합 시다!', 
    ['好吧，那我可就不客气了……哈哈，终于可以鸟枪换炮了……现在先将新船设置进入舰队。'] = '좋아요, 그럼 제 가 할 수 있 는 천만에요......하하, 할 수 있 게 됐 다며 鸟枪换炮......일단 은 새 배 설치 진입 함대 이다.', 
    ['好啦好啦，我们会给【市政厅】投资一笔钱让你们维修港口的。'] = '좋 은 니 좋 거 든!! 우리 에게 [시청 괴뢰 호 전광 들이 투자 한 돈 을 당신 을 정비 항구 다.', 
    ['好啦好啦，药材齐啦！'] = '좋 은 니 좋 네 요 약재 코 지!', 
    ['好大一块礁石，我们可别撞上去了！瞄准！让我炸掉它！'] = '미국 할리우드 소 유의 초석 을 우리 하지 에 부 딪 혀 올 라 가게!조 준!나 와 폭발!', 
    ['好大一条鱼！抓住它兄弟们就能美餐一顿了！准备撒网！'] = '좋 은 대학교 1 학년 조 물고기!불현듯 형제 들이 면 선택 한 끼 었 어요!준비 투망!', 
    ['好大的炮'] = '미국 할리우드 의 포', 
    ['好大的雾！没有瞭望镜，我什么也看不清，只能祈祷迷雾快快散去。'] = '미국 할리우드 의 안개!거울 을 요망 없 나 아무것 도 보 이지 않 을 정 도로 청 을 기도 하는 수 밖 에 없 는 안개 빨리 걷 히 했 다.', 
    ['好好想想吧，是走上血与火的霸者之路，还是就此退出！'] = '잘 생각 해 봐, 전문가 들 은 피 와 불의 왕 자의 길 을 탈퇴, 아니면 여기!', 
    ['好好留意一下，附近可能有玛雅人的遗迹。'] = '잘 보 유의 부근 에 마야 사람 의 유물 이다.', 
    ['好想运几头骆驼回欧洲去。'] = 'i 운 몇 마리 낙타 회 유럽 갑 니 다.', 
    ['好望角'] = '희망 곶', 
    ['好望角也叫风暴角，经常有杀人浪出现。'] = '희망 봉 사도 같이 폭풍 뿔 이 가끔 살인 랑 등장 했 다.', 
    ['好望角到印度的航线发现后，波斯湾的贸易逐渐衰落。'] = '희망 곶 인도 전역 의 노선 을 발견 한 뒤 페 르 시 아 만 의 무역 조금씩 쇠락 했 다.', 
    ['好望角是葡萄牙国王命名的。'] = '희망 곶 은 포 르 투 갈 국왕 이 붙 인 이름 이다.', 
    ['好望角是非洲大陆的最南端。'] = '희망 곶 은 아프리카 대륙 최남단 이다.', 
    ['好望角有许多危险的海洋生物'] = '희망 곶 이 많은 위험 한 해양 생물 이다', 
    ['好望角的东南方是牧人湾。'] = '희망 곶 의 동남쪽 은 牧人 만.', 
    ['好望角经常起雾'] = '희망 곶 자주 안 개가 끼 이다', 
    ['好望角航道开通后亚历山大已无复往日荣光。'] = '희망 곶 항로 개설 후 알 렉 산 드 리 아 이미 무 복 옛 향취 영광 이다.', 
    ['好望角被称为世界上最危险的航海地段的主要原因是？'] = '희망 봉 을 세계 에서 가장 위험 한 항해 지점 의 주요 원인 은?', 
    ['好望角连通着大西洋与哪个海域？'] = '이제 고 희망 봉 대 서양 과 어느 해역.', 
    ['好样的！哎，你终究还是没有找到你的父亲，我为此感到悲伤。'] = '장하다!야, 너 는 끝내 찾 지 못 했 다. 당신 은 아버지 이 슬 퍼 했 다.', 
    ['好消息是这次我和你们一起去！还等什么，快出发吧！'] = '좋 은 소식 은 이번 에 제 가 너희 와 함께 하 러 가요!또 등 어떤, 빨리 출발 합 시다!', 
    ['好深的心机。我想，霍金斯和国王权杖也在你手中吧。'] = '좋 은 깊이 의 마음 이다.내 생각 에 호 킹 스 국왕 权杖 도 당신 에게서 시다.', 
    ['好的船长'] = '좋 은 선장', 
    ['好的，将这艘$(missioncolor:【轻型三角帆船】)加入到舰队，我们即刻出航！'] = '네, 이 척 $(missioncolor: 경 삼각 요트 괴뢰 호 전광 들이) 가입 으로 함대 를 우리 즉각 출항!', 
    ['好的，我马上就去【马斯卡特】，但愿你们的老朋友也能够缓过来。'] = '그래, 나 도 금방 갈 게 앤 디 마 스 카 터 사육 하 고 있다 니 하 면서 당신들 의 오랜 친구 도 할 수 있 도록 서울 강 서구 발산 했 다.', 
    ['好的，船长。其实我心理预期是15帝国钻石币，没想到您这么痛快地就答应了，您放心，我……'] = '네, 선장.실은 저 심리 전망 은 15 제국 다이아몬드 폐 더니 당신 을 통 쾌 하 게 승낙 했 을 안심 하 십 시 요. 저......', 
    ['好的，那真是麻烦大叔了，我现在就购买新船扩大舰队。'] = '네, 정말 큰일 이 야 아저씨 네 요. 이제 으면 사 새 배 확대 함대 이다.', 
    ['好运'] = '좋 은 일 만 가득', 
    ['好运的年轻人，你刚好进爵为五等男爵获得进阶轻型三角帆船的权限，现在又有了进阶图纸，我们当年可没有你这么好的运气啊。'] = '행운 의 젊은이, 당신 은 마침 진작 등 을 5 경 준위 받 진 경 삼각 요트 의 권한 을 지금 또 쳤 섬돌 도면 을 우리 그해 없다 당신 이 이렇게 좋 은 운 이 네 요.', 
    ['好运还是不幸？'] = '좋 은 일 만 가득 인지 불행 인지?', 
    ['好！为了能够找到父亲，我无所畏惧。'] = '좋아!기 위해 아버지 를 찾 을 수 있 을 겁 없이.', 
    ['好！年轻人，有气魄！“白棉布”杰克的势力盘踞在$(missioncolor:【哈瓦那】)、$(missioncolor:【梅里达】)和$(missioncolor:【巴拿马城】)，希望能听到你们胜利的消息。届时，我会赐予你们丰厚的赏金。'] = '좋아!젊 은 층 이 기백!\' 백 면포 \' 잭 의 세력 이 도사리다 $(missioncolor: 아 바 나), 사육 하 고 있다 (missioncolor: $$) 과 메 리 다 사육 하 고 있다 (missioncolor: 파 나마 시 티 괴뢰 호 전광 들이) 되 길 바 란다 "고 승리 의 소식 을 전해 듣 고 너희들 다.이때 나 하사하다 당신들 푸짐하다 의 현상금 을 내 걸 고.', 
    ['好！霍金斯，我一定会制裁你！'] = '좋아!호 킹 스 를 꼭 제재 당신!', 
    ['好，资金还很充裕，我们一步到位。哈哈哈哈……'] = '네, 자금 도 충 분 하지 는 우리 一步到位 이다.나 는 키 가 틉 니....', 
    ['好，资金还很多，我们一步到位，哈哈哈哈……'] = '네, 자금 이 아직 많 아 우리 一步到位, 나 는 키 가 틉 니....', 
    ['好，这个港口已经是我们的囊中之物了！'] = '네, 이 항 은 이미 우리 에게 돌 아 간 다!', 
    ['如你所愿，年轻人，希望我的同行能够给你带来帮助。'] = '너 의 희망 처 럼 젊 은 층 을 희망 동행 할 수 있 도록 당신 에게 도 도움 이 된 다.', 
    ['如你所见……这里的情况糟糕透了，海盗洗劫了商铺，我们计划重开港口，但是连足够的货源都没有了。'] = '너 처 럼 본 대로....완전히 떡 됐어. 이곳 의 상황 을 약탈 했 해적 상가 를 우리 계획 재개 항구 에서 단 충분한 비장감 이 아무 것 도 없 었 다.', 
    ['如您所言！的黎波里的防御力量比突尼斯更强大，敌人果然将这里作为了基地。'] = '당신 말 대로 이여!트 리 폴 리 의 방위 역량 보다 더 강하다 고 튀 니 지 는 적 은 과연 이곳 은 해 기지.', 
    ['如来佛'] = '두께', 
    ['如果 蒲丽雅 说我愿意援助，那我就愿意援助咯，不过，我只能让我的人帮忙建设城防炮台，我的舰队正跟马六甲的苏丹交战呢！'] = '만약 蒲丽 아 말 을 할 용의 가 있다 "고 지원, 그럼 나 겠 지만 지원 하늘나라 에 나 는 결국 내 셨 건설 도 시의 방위 포대, 나 의 함대 따 르 고 있다. 말 라 카 의 수단 교전 할 께 요!', 
    ['如果你们能到【汉堡】向消息灵通的阿尔伯特·希勒打听一下海盗的动向，并且消灭他们，我想你们肯定能赢得我们女王的青睐。'] = '만약 당신들 에 도착 할 수 있 앤 햄버거 괴뢰 호 전광 들이 소식통 들 은 앨 버 트 시어 러 알 아 봐 해적 들 의 움직임 도 있 고 이 들 을 일소 하 고 싶다 "고 너희들 긍정적 확실히 이 우리 여왕 의 인기 를 끌 었 다.', 
    ['如果你们能协助我们皇家海军击败那些见利忘义的家伙，我想女王会接见你们的。'] = '만약 당신들 상생 할 수 있 는 우리 해군 의 그 레 알 소 시 에다 드 격파 하 고 싶다 "고 소감 을 见利忘义 놈 여왕 만날 것 이다.', 
    ['如果你坚持的话，我很乐意向达尔布克基大人转达你的意思。'] = '만약 당신 을 고집 해 버 리 면 저 을 기꺼이 向达尔 보 크 스키 어른 전달 당신 뜻 이다.', 
    ['如果你想反悔，最好现在说。'] = '만약 원 하는 것 이 좋다. 지금 말 하는 것 이 오락가락 하는 바람 에', 
    ['如果你抱有希望的话！这个可恶的海角把我的舰队给毁了！我休整后就回航了，我听说达伽马的船队也在这附近，你要小心他！'] = '만약 당신 희망 을 갖 고 있다 면!빈대 는 땅 끝 나 의 함대 에게 망 가 진 다!내 게 정지 직후 부터 회 항 했 다 는 말 을 들었다 에서 프로 스타 글 란 딘 의 선단 역시 이 인근 에 각별히 그!', 
    ['如果你这么想，就是本末倒置了，难道你所做的一切，就是为了得到朝廷的承认？那我真是看错你了。'] = '당신 이 이렇게 하 면, 본말 이 뒤 집 혀, 그럼 당신 모든 것, 조정 의 인정 을 받 기 위해?그럼 제 가 정말 잘못 한 것 입 니 다.', 
    ['如果在海上遇到龙卷风，不知道会被吹到哪里。'] = '만약 해상 에서 만난 회오리바람 할 지 모 른 다 는 가 잡 을 수 있 었 다.', 
    ['如果山不走过来，那我就走过去。'] = '만약 산 안 오 더니 그럼 나 과거의 틀 이다.', 
    ['如果我们完全用欧洲人的方式生活，那我们还是自己吗？'] = '만일 우리 가 완전히 용 유럽인 들 의 방식 으로 살 고 우리 는 자신 뿐 이 있 습니까?', 
    ['如果我们绕着太阳转，为什么我不会头晕呢？'] = '우리 주위 를 돌 면 태양 을 왜 내 키 지 않 는 어지럼증 인가.', 
    ['如果我因为带回这美妙的商品而成为里斯本最有名的会计师，我可一定也不会意外呢！'] = '만약 내 가 귀 국시 켰 기 때문 이 아름 다운 상품 으로 받 아 들이 고 있 는 리스 본 가장 유명한 회계사, 난 무단 일정 하지 는 않 을 것 이 라며 뜻밖 었 어요!', 
    ['如果我真是小女生，就不可能在大海之上遇上狂风暴雨时，还能对其他水手指挥若定并且安全度过暴风雨。'] = '만약 내 가 정말 여자 어린이 를 하지 않 고서 는 불가능하다 는 바다 위 에 열 을 올 리 고 있 을 때 강풍 에 대한 별 다른 황천 지휘 할 경우 정 하 고 안 전하 게 지 내 폭풍우 이다.', 
    ['如果我能在竞技场里取得胜利，那么对于我的探索和影响力一定会有所帮助，那么，去试试看吧，听说奖励还非常丰厚呢！'] = '그럼 내 말 이면 은 경기장 에서 승리 해 지면 나 의 탐색 과 영향력 반드시 도움 이 된 다면 으로 갑 시다 던데, 혹시나 인센티브 도 매우 푸짐하다 나요!', 
    ['如果是平常我肯定臭骂你，但是现在老娘没有力气，你要去谢谢俞红袖小姐，是她救了我们。'] = '호 되게 꾸짖다 평상시 라면 난 분명히 해, 하지만 지금 예 힘 이 없 을 걸 어 감사합니다 유 红袖 아가씨, 그녀 를 구 했 다 는 우리 이다.', 
    ['如果有人问玛丽，是否惧怕绞刑架，她会哈哈大笑后告诉你：“绞刑并不可怕，如果没有绞刑，那么胆小如鼠的人都能成为海盗了！”'] = '느냐고 한 다면 마리 를 두려워 할 것 으로 绞刑架 는지 깔깔 대 뒤 당신 에게 " 교수형 는 무 서 운 하지 않 을 경우, 교수형 라면 간이 콩알 만 해 요 한 사람 들이 해적 까지 생 겼 다.', 
