    ['年轻人，你们竟然还在码头大摇大摆！难道不知道吗？你们突袭伊斯坦堡的消息已经传开了，听说巴巴罗萨正率领他的庞大舰队往回赶呢！'] = '젊은이, 너희들 또 찾 은 부두 으쓱으쓱!설마 모 르 겠 습니까?당신들 기습 이 스 텐 버그 의 소식 이 퍼 진 들 었 는데 아내 로 살 정 을 이 끌 고 그 의 거 대한 함대 1km 를 쫓 아 나요!', 
    ['年轻人，你先别忙着拒绝，我知道你在寻找着什么东西。一种散发着粉色光芒，氤氲着神秘气息的名叫古兰圣珠的宝石对不对？'] = '젊은이, 너 먼저 별 는지라 거부 로 안다. 당신 이 찾 고, 어떤 것 인지 알 수 없 었 다.일종 의 아하 고 핑크 빛 을 발 하 고 氤氲 신비 의 정취 가 물씬 풍기 는 이름 은 쿠 랑 성주 의 보석 옳 은?', 
