    ['年轻人，你现在这艘小船当旗舰确实有些勉强，不过没关系，在之前战斗中获得的金币是可以用来强化船只装备的，你只需要进入舰队进行$(missioncolor:【装配研究】)，就能极大提升火炮的威力。'] = '젊은이, 너 지금 이 량 이 기함 확실히 무리 지만 괜 찮 아, 앞서 전투 에서 얻 는 금화 는 선박 용 으로 활용 할 수 있 지만 강화 장비 뿐 인 데, 너 만 불 어야 함대 를 $(missioncolor: 조립 연구 괴뢰 호 전광 들이) 를 보 면 큰 향상 주포 의 위력 을 과시 했 다.', 
    ['年轻人，你看我说的没错吧，大学者安度因的弟子，自然不简单……'] = '젊은이 들 을 봐 라, 내 가 말 하는 틀림 없 음 대 학자 안도 후세 인의 제자 를 자연 이 간 단 치 않 음 을......', 
    ['年轻人，你这又是何必呢？这样的性格将是你在日后航程中的阻碍。'] = '젊은이, 당신 이 는 또 왜 그래야 되 죠?그런 성격 은 당신 은 향후 항로 속 의 발목 을 잡 는 다.', 
    ['年轻人，在北海，对于舰队来说最危险的并非是海盗，而是随处可见的浮冰。'] = '젊은이 를 북해 함대 에게 가장 위험 에 대해 관심 이 해적 이 아 니라 곳곳 의 얼음 이다.', 
    ['年轻人，快走！“邪恶的号角奏响，海水无法熄灭的火焰降临”！'] = '젊은이 들 을 빨리 가요!\' 악의 나팔 가 울 려 퍼 지 면서 바닷물 못 꺼 져 가 던 화염 강림 \'!', 
