    ['年轻人，我来给你介绍一下。这是西印度公司总督彼得松·霍因。此次前来，是为商谈联手对抗东印度公司的事情。你有没有带来迪欧·霍阿将军的消息？'] = '제 가 젊은이 들 을 소개 해 드 리 겠 다.이 회사 는 서 인도 총독 피 터 송 호 이 다.이번 으로 신 속 하 게 상담 에 맞 서 동 인도 회사 차원 의 일 이다.넌 에 디 오 호 아 장군 의 습니까.', 
    ['年轻人，我自然是要控制整个印度洋了。我可不是黑斯廷斯那个蠢货，一味的强硬只会带来无止境的反抗，而当海盗入侵，统治者无能为力，实力大减，而我再以救世主的身份出现……'] = '젊은이 나 자연 은 막 아야 하 기 때문에 전체 인도양 했 다.내 가 그 를 그저 그 렇 고 黑斯廷斯 蠢货 일방적 인 강 경 만 낳 을 알 수 없 는 저항 으로 해적 침입 에 통치자 무능 하 게 실력 이 크게 줄 어 든 반면 제 가 다시 나 올 것 이 라 는 메시아....', 
