    ['想要得到爵位的晋升，投资港口可是最重要的一环。而投资许可——$(missioncolor:【推荐信】)只有完成日常任务才能获得。'] = '얻 고자 하는 것 이 작위 에 대한 승진 투자 항구. 그래도 가장 필요 한 대목 이다.반면 투자 허가 인 $(missioncolor: 추천서 괴뢰 호 전광 들이) 뿐 완성 일상 임무 를 받 을 수 있 었 다.', 
    ['想要穿行中国东南沿海，没有郑家的保护令旗，是一件非常危险的事。你不知道那些神出鬼没的海盗啥时候就会出现在你的船上。'] = '하 려면 중국 동남부 연안 을 누비 며 없 는 郑家 보호 영장 기 를 앞 세 우 고 는 위험천만 한 일 이다.익 숙지 않 은 그 신 출 귀 몰 한 해적 나 와 잘 때 면 나 타 나 는 너 의 배 를 타 고 있다.', 
