    ['意为“在水面上跳跃的船”。因其外观船体狭长，速度轻快而著称，深受航海家们的喜爱。'] = '뜻 을 담 은 수면 에 점프 배 였 다고 밝 혔 다.외관 으로 선체 를 狭长 속도 경 쾌 하 면 서도 신 강 에 이 를 정 도로 航海家 들 의 사랑 을 받 았 다.', 
    ['意外之财'] = '뜻밖 의 재', 
    ['意外奖励：'] = '뜻밖 의 인센티브:', 
    ['意大利人。原本是威尼斯的医生，看到了药品贸易的可观利润后做起了海商，但因摩尔海盗的劫掠损失惨重。擅长节约开支却不擅长创造财富。'] = '이탈리아 사람 입 니 다.원래 베 네 치아 의 의사, 보고 의약품 무역 의 이익 海商 후 시작 했 으나 무어 해적 들 의 약탈 피해 가 컸 다.능 통한 비용 절감 은 호흡 부 를 창출 했 다.', 
    ['意大利人。威尼斯的吟游诗人，穷困潦倒的日子里和一个老水手出海寻找出路，喜欢在甲板上用曼陀林弹奏哀伤的情歌。'] = '이탈리아 사람 입 니 다.베 네 치아 의 음유시인 이, 가난 한 날 리 와 하나 로 스 출항 활로 를 찾 을 좋아 하 고 갑판 에서 용 만돌린 손끝 의 슬 픈 노래 한 다.', 
    ['意大利人。家族是佛罗伦萨财阀，父亲因商业丑闻入狱后家道中落，吉安带着弟妹生活，在众人的冷嘲热讽下一直为了恢复祖辈的荣耀而努力。'] = '이탈리아 사람 입 니 다.재벌 가문 은 피 렌 체 를 아버님 상업 스캔들 투옥 이후 가 세가 기 울 었 을 빈틈 없이 단돈 제수 생활, 수 많은 사람 들이 라 는 비아 냥 까지 할아버지 들 의 영광 을 회복 하 기 위해 노력 하 고 있다.', 
    ['意大利人。标准的意大利美男子，优雅健谈、魅力四射，晋升之路十分顺遂，三年就当上了大副。是海上有名的单身贵族，因为太过完美总是被怀疑取向。'] = '이탈리아 사람 입 니 다.기준 의 이탈리아 꽃 미남 우아 健谈, 카리스마 를 승진 매우 顺遂 을 3 년 으로 옮 겨 갔 다. 등 항해사이 해상 유명 한 싱글 을 너무 완벽 자꾸만 의심 취향 이다.', 
    ['意大利人。波隆那大学的问题学生，因为讥讽政局被开除。退学后开始做水手，被誉为“海上政治家”，一直将船作为一个小型社会模型来研究。'] = '이탈리아 사람 입 니 다.파 룸 라면 대학 의 학생 을 문제 때문에 풍자하다 정국 과 관련 해 제적 됐 다.학교 를 중퇴 하 고 시작 하 면서 캔 자 스 시 티 로 까지 불 렸 던 해상 정치인 \'로 까지 배 으로서 소형 사회 모형 을 연구 했 다.', 
    ['意大利人。生于水手之乡热那亚，是地圆学说的坚定信奉者，他坚称从欧洲往西航行，横穿大西洋是抵达东方国度的最近路途。'] = '이탈리아 사람 입 니 다.태생 인 매 리 너 스 의 향 제 노 바 는 둥 글 게 학설 의 확 고 한 신봉자, 그 판례 유럽 에서 서쪽 으로 항해 를 타 고 대 서양 을 횡단 은 동양 에 도착 한 코 치가 최근 곌,,,,,,.', 
    ['意大利人。维克多的童年好友，对维克多英俊的容貌不屑一顾，经常讽刺挖苦，实际上却非常珍惜这份友谊，经常帮维克多摆平暗处的敌人。'] = '이탈리아 사람 입 니 다.빅 토 르 의 어린 시절 친구 사이 로 잘 생 긴 모습 은 빅 토 르 콧방귀 를 자주 풍자 쓴소리 를 하 면 서도 실제로 는 매우 가 치가 이 우정 을 자주 방 빅 토 르 다스 려 음지 에 숨 어서 의 적 이다.', 
    ['意大利人垄断了胡椒贸易，促使葡萄牙人开拓了前往印度的新航线，使之成为风靡欧洲的香料。'] = '이탈리아 인 무역 독점 후추 를 유도 하 기 위 한 포 르 투 갈 인 개척 인 도로 가 는 항로 를 부 각시 켜 유럽 을 주름 잡 았 던 향료 이다.', 
    ['意大利人撰写的炼金术知识大全，有人按照上面步骤实验但总是失败，可能哪里搞错了？'] = '이탈리아 인 지식 을 쓴 炼金术 대전 을 누 군가 절차 에 따 라 위 지만 번번이 실패 한 실험 을 어디 그런데 했 어요?', 
    ['意大利人撰写的玻璃制作工艺说明，作者是为哥特式教堂制作彩色玻璃的技师。'] = '이탈리아 인 들이 쓴 유리 공예 설명 을 저자 는 고딕 양식 의 컬러 유리 한 기사 성당 제작 했 다.', 
    ['意大利人，军人出身，觉得军队中的生活太过拘束而毅然下海。向往驾着破船自由驰骋在地中海的生活，是个没心没肺、天真率直的人。'] = '이탈리아 출신 군인 출신 이라고 생 각하 고 군 생활 이 너무 어려워요 선택 진수 했 다.지망하다 끌 고 선체 를 자유 롭 게 뛰 는 지중해 의 생활 하 고, 개인 没心没肺, 순 진 하 고 솔 직 한 사람 입 니 다.', 
    ['意大利天才里奥纳多·达·芬奇绘制并撰写的医学书籍，详细绘制了人体结构，有点可怕。'] = '이탈리아 천재 리 오 나 여 다 그려 애티 커 스 핀 치 역할 을 쓴 의학 서적 을 상세히 완성 했 다고 인체 구조, 좀 무 서 워 요.', 
    ['意料之外'] = '뜻밖', 
    ['意气风发'] = '주관적 감정 풍 발', 
    ['愚蠢的家伙，居然引爆自己的船只。那接下来就是你们了！'] = '멍 청 한 놈, 뜻밖에 폭발 자신 들이 보 이기 시작 했 다.그 다음 은 당신들!', 
    ['感到受辱的女王暴跳如雷，决心对汉萨同盟展开报复行动。'] = '곤욕 을 치 른 여왕 을 느 끼 는 펄쩍 뛰 었 을 결심 한 라 사 동맹 보복 행동 이다.', 
    ['感到受辱的女王暴跳如雷，决心对汉萨同盟展开报复行动。到【普利茅斯】寻找德雷克，他将代表英国王室指引进行报复行动。'] = '곤욕 을 치 른 여왕 을 느 끼 는 펄쩍 뛰 었 을 결심 한 라 사 동맹 보복 행동 이다.로 스 앤 普利茅 괴뢰 호 전광 들이 찾 아 드 레 이크 에 그 는 대표 영국 왕실 안내 보복 행동 이다.', 
    ['感谢上帝！得救了！'] = '하나님 감사합니다!살 았 다!', 
    ['感谢上帝！我们自由了！'] = '하나님 감사합니다!우리 자유!', 
    ['感谢你们……看来欧洲除了有最歹毒的恶棍也有最高贵的绅士。'] = '감사합니다.보아하니 유럽 제외 하 고 는 가장 악 랄 한 불량배 도 가장 고급 스 러 운 신사 이다.', 
    ['感谢你们从强盗的手里解救亚丁，但亚丁要想重回往日的繁华必须重新建立贸易网。'] = '고맙습니다 는 강도 에게 구출 아 덴 이지 만 아 덴 만 에 복 귀하 려면 종 전의 번화가 를 다시 세 워 야 무역 망 했 다.', 
    ['感谢你们帮我了却心愿，只可惜我现在无法给照约定你们报酬了。'] = '감사합니다 나 를 도 와 주렴 부터 불안 을 만 들 지 못 하 고 아 는데 찍 어 약속 당신들 보수 했 다.', 
    ['感谢你们，我亲爱的朋友，有什么能为你们效劳的吗？'] = '고맙습니다, 내 사랑 하는 친구, 무슨 너희들 힘쓰다 있 나요?', 
    ['感谢你们，我们还陆续得到几位海上的帮助，马上就可以重开港口了。'] = '고맙습니다, 우리 는 이어 몇몇 해상 의 도움 을 받 아 곧 재개 할 수 있다 항구 했 다.', 
