    ['我不懂你们为什么要定居下来，到处迁徙不好吗？'] = '한국어 를 잘 모 르 너희들 왜 에 정착 했 다고 여기저기 이동 좋 지 않 습니까?', 
    ['我不是将军，也不是海盗，我只是我自己。'] = '나 장군 도 아니 고 해적 들 을 내 놓 으면서 그 는 내 자 신의 도 메 인 이름 이다.', 
    ['我不管，你答应过我要替我找回命运号的，否则别想我带你去世界的尽头。'] = '난 상관 없 어, 너 에 응 했 었 다고 대신 내 운명 을 되 찾 을 생각 은 하지 말 라 는 호 는 그렇지 않 으면 내 가 데 려 다 세 상의 끝 이다.', 
    ['我为我的伙伴骄傲！只可惜，现在只剩下我和大副安东尼奥了……'] = '나 는 나 의 동반자 자랑 스 러 워!불행 에 이제 는 나 와 대부 안 토 니 오 라......', 
    ['我为我的族人对你们所犯下的罪行道歉。'] = '나 는 나 의 인 들 에 대한 당신들 의 범죄 사과 했 다.', 
    ['我之前对于正义的理解太肤浅了，从你们身上我们看到真正的正义，希望你们能把光复正义的智慧传授予我！'] = '전 에 대한 정의 은 이해 가 피상적 됐 고 당신들 에게 보 여 진 정한 정의 를 줬 으면 광복 을 정의 로 운 지혜 소환하다 수여 저 입 니 다!', 
    ['我也明白，但我不愿就此抛却任何一艘曾经陪伴我的船。我已经提升到爵位到三等男爵，可以进阶【轻木帆船】，让它以全新的姿态伴随我们继续战斗。'] = '저 도 당연 하지만 나 이에 抛却 단 한 척도 한때 곁 을 떠 나 지 나 가 는 배가 있 습 나다.나 는 이미 까지 끌 어 올 리 기 위해 작위 까지 백두산 등 경 준위 를 들 을 가 볍 게 木帆船 [사육 하 고 있다. 이 를 새로 운 자 세로 함께 계속 싸 웠 다.', 
    ['我也是一名水手，船上才是我的家。'] = '나 도 한 명의 황천 선상 이야말로 저의 집.', 
    ['我也是这么想，如果我真的打捞了沉船，一定可以将玛利亚迎娶进门，但是没有一个人找到那些宝藏，见鬼，包括我！'] = '저 도 그렇게 생각 해 보 면 정말 인양 했 침몰 하 고 공 부하 면, 반드시 마리 아 를 맞 이 할 수 있 는 한 명도 없 었 지만 가게 에 들 어 서자 찾 아 저 지하 자원 을 접 싯 물 면 나!', 
    ['我也正有此意，因马尼拉海盗的埋伏，我们损失了不少人手，如果几位能协助我们，双方合力一举剿灭陈祖义，真是感激不尽。'] = '나 도 그런 생각 은 마 닐 라 해적 들 의 매복 으로 우리 의 손실 을 입 었 다면 적지 않 은 인력 을 몇 수 있다 는 믿음 을 통 해 북한 측 에 양측 이 힘 을 모 아 일거 剿灭 陈祖义, 정말 고 마 워.', 
    ['我也知道这很困难，但我不会放弃，除非有一天我也死去。'] = '저 도 그 사실 을 알 고 살림 이 어 려 워 포기 하지 않 는 거지, 어느 날 나 도 죽 었 다.', 
    ['我也觉得十分奇怪，难道是霍金斯从某些特殊渠道弄来的装备？'] = '나 도 왠지 한 국역 란 말 이 냐고 호 킹 스 는 어떤 특수 채널 만지다 온 장비?', 
    ['我也觉得很很奇怪，但现在也不好突然上前发问，只能静观其变。'] = '언니 가 너무 이상 하 게 잘 안 좋 지만 지금 도 갑 작 스 러 운 항해 하 는가 라 는 내지 할 수 밖 에 없다.', 
    ['我亲爱的船长，感谢你用勇气和牺牲为我们带来这场重要的胜利！'] = '내 사랑 하는 선장 을 해 줘 서 고맙다 "고 용 용 기와 희생 을 우리 에게 이 소 중 한 승리!', 
    ['我从小就在长辈的关照下经营海上贸易，父母去世时我答应过他们，不让他们失望。'] = '나 는 어 릴 적 부터 은 윗사람 의 배려 로 경영 해상 무역, 부모 사망 때 내 가 응 이 그들 을 하지 않 도록 항상 실망 스 러 웠 다.', 
    ['我从小就想见识到世界各地所有珍稀的货物，海上的风险都吓不到我的。'] = '나 는 어 릴 적 부터 생각 나마 세계 각지 에서 모든 희귀 의 화물 을 싣 고 해상 의 위험 이 라 못 내 것 이다.', 
    ['我从没去过更远的地方，还是部落里最安全。'] = '내 가 꼭 한 번 더 먼 곳, 아니면 부족 에서 가장 안 전한 다.', 
    ['我从没见过一个人的眼睛像他一般贪婪和冷漠，如果 马丁·金 无法说服他不再贩卖同胞，那么霍金斯迟早会卷土重来！'] = '내 가 한번 도 본 적이 한 사람 의 눈 처 럼 그 는 일반 탐욕 과 싸 늘 해 졌 고, 만약 마 틴 김 을 설득 할 수 있 는 그 는 더 이상 인신 매매 동포 라면 호 킹 스 조만간 권 토 중 래!', 
    ['我从船头搜到船尾，终于找到%s个【%s】，和这件古老的宝物【%s】，再看看有没有其他东西吧！'] = '저 는 갑판 에서 압수 고물, 마침 내자 %s 개 [%s 사육 하 고 있다, 와 이 오래된 보물 [% 를 더 지 켜 보 자 s 사육 하 고 있 는지 다른 물건 합 시다!', 
    ['我以那个暴戾的家伙是我的同胞为耻！而我千里迢迢赶来也绝不是为了躲在舷墙后看热闹，请允许我，加入防御部队吧！'] = '나 는 그 暴戾 한 놈 은 나 의 동포 들 을 부 끄 럽!갈 노정 이 아주 멀다 고 내 자신 을 찾 아 온 것 도 결코 위해 뱃전 에 숨 어 담장 뒤 구경 다니 고, 제 가입 방어 부대 합 시다!', 
    ['我们不像海盗只在乎掠夺，要得到开展贸易的许可需先获取信任，让我们到【市政厅】为港口的繁荣做些贡献吧！'] = '우리 처 럼 해적 무조건 약탈 을 벌 무역 의 허가 맵시 를 먼저 입수 될 정 도로 신뢰 를 감 상하 [시청 사육 하 고 있다 는 항구 의 번영 하는 거지 공헌 합 시다!', 
    ['我们不关心历史，我们只关心未来。'] = '우리 역사 에 관심 을 두 지 않 고 우리 미래 에 만 관심 을 쏟 는 다.', 
    ['我们不崇拜钱和权力，只崇拜最优秀的猎手。'] = '우리 는 돈 과 권력 을 숭배 만 숭배 가장 우수 한 맹수 다.', 
    ['我们不想向贪婪的国王交税。'] = '우리 에게 탐욕 스 러 운 왕 들 은 세금 을 하 고 싶 지 않다.', 
    ['我们不是强盗'] = '우리 는 강도', 
    ['我们不生产粮食，我们只是大自然的搬运工。'] = '우리 식량 을 생산 하지 않 을 뿐 자연 의 뜻 이다.', 
    ['我们不能再让他背负更多的责任，请给他庇护。'] = '우리 시 킬 수 없다 는 그 가 짊 어 진 채 더 많은 책임 주 십 시 비호 했 다.', 
    ['我们也比在突尼斯的时候更强大！打起精神，让敌人看看我们舰队的实力吧。'] = '우리 도 튀 니 지 는 때 보다 더욱 강 해!정신 을 차 리 고 보 는 우리 에게 적 함대 시다.', 
