    ['我们会向你证明我们的信誉，但你必须为你无礼道歉。'] = '우리 가 할 게 하는 우리 의 신뢰 를 하 는데 너 는 너 를 해 야 한 다 는 무례 사과 했 다.', 
    ['我们击败卢卡斯是仅仅因为是因为正义而已，并不求其他回报，如果是我的父亲在这里，他也一定会做和我的一样的事情。'] = '우리 는 꺾 루 커 스 때문 만은 아니 기 때문 일 뿐, 정의 구 다른 보람 있 는 경우 에 나 는 아버지 가 그 는 이곳 에서 도 할 거 야. 나 는 듯 한 일 이다.', 
    ['我们刚刚从商会兑换了些物资，不过还需要水手宝物来武装自己才行。毕竟在丛林遗迹之中，处处充满了危机。'] = '우리 방금 상공 회의소 에서 교환 했 지만 아직 필요 물자 황천 보물 우세 를 해 야만 한 다.필경 은 정글 유적 속 에서 갈수록 날 이 위 기로 치 달 았 다.', 
    ['我们到了，英国最负盛名的出海港口之一—普利茅斯。'] = '우리 현장 으로 달 려 가 영국 의 대표적 출항 항구 중 하나 - 普利茅 스.', 
    ['我们原住民的烟草在你们那里很受欢迎。'] = '우리 원주민 들 의 담배 는 너희 있 는데 이 인기 를 끌 고 있다.', 
