    ['我们可以去【亚丁】附近的海面转转，那些私掠船一定就潜伏在不远处。'] = '우리 가 갈 수 있 어요 앤 디 아 덴 괴뢰 호 전광 들이 인근 해상 에 들 러 경쟁 들 노략질 하다 배 일정 이 잠복 그리 멀 지 않 은 곳 이다.', 
    ['我们向%s商会发起了商会战，本次商会战将持续24小时。'] = '우리 에게 %s 상공 회의소 발의 상공 회의소 전이 었 고 이번 상공 회의소 전이 계속 24 시간 이다.', 
