    ['我们对佛得角的地形不熟悉，与其等着被伏击，不如直接进击海盗的大本营--比绍，收拾掉敌人，才能安心的进行贸易呢。'] = '우리 는 佛得角 지형 에 익 숙 하지 않 는 등 이 낫다 "면서 "을 연발 하 고 매복 공격하다 보다 는 직접 进击 해적 들 의 총본산 인 최선 을 을 적 으로 봐 야 직성 이 풀 리 는 무역 을 하 겠 는가.', 
