    ['我们必须给他们一个教训。'] = '우리 야 그들 에게 이 됐 으면 좋 겠 다.', 
    ['我们必须赶快到【第乌】去。'] = '우리 야 빨리 까지 [제 우 사육 하 고 갑 니 다.', 
    ['我们必须阻截敌人，让苏菲尽快摆脱对方，只要回到港口，她就安全了！'] = '우리 야 태클 을 적 고 소피 에서 빨리 벗 어 나 상대방 을 돌 아가 항만, 그녀 는 안전!', 
    ['我们快回【圣乔治】去吧。'] = '우리 빨리 회 앤 장미 사육 하 고 갑 시다.', 
    ['我们快回【大阪】去吧。'] = '우리 빨리 회 앤 디 오 사 카 사육 하 고 갑 시다.', 
    ['我们把货物都给你们，有好酒，好肉，好鱼！我们投降！'] = '우리들 은 화물 은 당신들 에게 로 좋 은 술 을 좋 은 고기 를 좋 은 물고기!우리 항복!', 
    ['我们收到撤退回来船只的信息，赶过来支援你们！'] = '우리 가 받 은 철수 돌 아 와 선박 의 정보 를 온 지원 꼐!', 
    ['我们攻下了文莱，陈祖义那边一定已经有所防备了，接下来的行动必须更加小心才行'] = '우리 에서 브 루 나이 陈祖义 저쪽 일정 이 어느 정도 대비 했 을 이어 야 하는 행동 에 더욱 조심 스 러 웠 어야 했 다', 
    ['我们攻占了敌方商会据点，望大家再接再厉。'] = '우리 공략 해 적의 상공 회의소 거점 을 들 어 더 힘 내 세요.', 
    ['我们是为郑和的遗物而来。'] = '우리 는 정 허 유물 을 해 왔 다.', 
    ['我们是从中国来的。'] = '우리 는 중국 에서 온 여.', 
    ['我们是太阳的子孙。'] = '우리 는 태양 자손 이다.', 
    ['我们是威尼斯在亚得里亚海上唯一的竞争对手。'] = '우리 는 베 네 치아 는 亚得里亚海 에서 유일한 경쟁 상 대로 꼽 았 다.', 
    ['我们是经过伟大的女王允许的。'] = '우리 는 경위 위 대한 여왕 허용 된 다.', 
    ['我们有了新的船只，并且在与敌人的战斗中学习到了新的舰队阵型！您需要进行新的配置，那样对战斗有极大的帮助。'] = '우리 는 새로 운 선박 을 마무리 하 고 적 과 의 전투 에서 배 운 다. 새로 운 함대 포 메이 션!당신 이 필 요로 새로 운 배치, 그것 이 옳 전투 에 큰 도움 이 됐 다.', 
    ['我们有足够的航海士信物了，试试信物招募吧。'] = '우리 는 항해 했 다 는 확신 을 한번 해 보 겠 다 는 확신 모집 시다.', 
    ['我们本来就打算向贵军请求援助，如此最好。'] = '우리 원래 계획 에 비 싸 군 원조 를 요청 했 다. 이렇게 하는 것 이 좋다', 
    ['我们来决一死战吧！'] = '우리 가 일전 불사 를 다짐 합 시다!', 
    ['我们来得及时，否则这一切都可能会被破坏殆尽，这也更坚定了我阻止达尔布克基的决心，不要耽误时间了，继续驰援$(missioncolor:【泉州】)。'] = '우리 급습 했 고 그렇지 않 으면 이런 것 들 은 모두 가 파손 삭 막 해 지 며 이 도 더 굳 어 졌 나 저지 르 보 크 스키 의 결심 을 하지 말고 에 발목 을 잡 혀 를 계속 했 驰援 $(missioncolor: 췐 저우 사육 하 고 있다).', 
    ['我们正在洽谈合作的事宜，自从东印度公司溃败之后，这片海域愈发混乱了起来，盗贼四起，我正想请彼得松先生帮助我们清缴海盗，保护我的国家。'] = '우리 가 추진 중인 협력 하는 일 은 동 인도 회사 궤멸하다 이후 이 앞바다 로 혼란 양상 을 띠 를 가리 고 도둑 이 증폭 되 고 생각 하세요 피 터 송 씨 가 도 와 주지 않 清缴 해적 들 을 지 켜 주 는 나라 다.', 
    ['我们正好缺一个像火药一样烈的火炮手，将【汉娜】任命为'] = '마침 부족 한 우리 처 럼 화약 같은 렬 의 주포 손 잡 고 [한 나 사육 하 고 임명 했 다', 
    ['我们每一次战役靠的可不是幸运女神的眷顾，靠的是实力，东方有句话说的很好，兵来将挡水来土掩，无论陈祖义设下什么陷阱，最终我们都会获胜！'] = '우리 회 사가 전투 는 그저 그 렇 고 그런 행운 의 여신 으로 마음이 편 했 던 밑천 은 실력 동양 에서 는 말 이 나 올 정 도로 좋 兵来将挡 水来土掩 에 말 려 든 陈祖义 무슨 함정, 결국 우리들 은 모두 이 겨 라.', 
    ['我们没能保护好“吉达号”，任务失败了...'] = '우리 못 잘 지 키 고 있 는 북한 핵 협상 호 임무 실패 했 건 만...', 
    ['我们用牲畜和你们交换各种谷物。'] = '우리 는 예방적 도 살 처 분을 벌이 는 너희 와 교환 각종 곡식 들이다.', 
    ['我们的事业是正义的，红胡子。我会加入神圣同盟，亲手赐予你失败。'] = '우리 의 사업 에 정의 가 빨 간 수염 이다.나 가입 신성 동맹, 손수 하사하다 당신 에 실패 했 다.', 
    ['我们的国王同时也是神圣罗马帝国的皇帝。'] = '우리 의 왕 이자 신성 로마제국 의 황제 가 살 았 어요.', 
    ['我们的国王被处死之后，印加帝国成为了西班牙的傀儡。'] = '우리 는 국왕 이 처형 이후 印加 제국 이 스 페 인의 아 닐 수없다.', 
    ['我们的城市被称为伊比利亚半岛的明珠。'] = '우리 의 도시 로 불 리 는 베 리 아 반도 명주 이다.', 
    ['我们的大副又在吵吵嚷嚷了，真是的，身为一个航海士一定要稳……那是，拉比斯！走，快跟上！'] = '우리 의 대부 에는 는데, 정말, 로서 항해사 꼭 확고하다.그것 은 래 비 스!가요, 빨리 쫓 아가!', 
    ['我们的征途是星辰大海。'] = '우리 의 여정 은 별 이 바다 다.', 
    ['我们的总督才是加勒比海最大的强盗。'] = '우리 의 최대 총독 이야말로 카 리 브 해 의 강도 이다.', 
    ['我们的总督是一个伪善的贩奴者！'] = '우리 의 총독 은 하나의 위선적 인 행상인 노예 자!', 
    ['我们的总督是印度殖民地的建立者。'] = '우리 는 인도 총독 은 식민 지의 설립 자다.', 
    ['我们的木工已经无法应付这样的巨舰，走，去酒馆碰碰运气，说不定能遇到一位合适的木工。'] = '우리 는 이미 목공 요구 에 대처 하지 못 해 이런 거 함 을 걷 는 이 들 을 찾 碰碰 운 주점 을 지도 모 른 다고 할 것 " 이라고 말 한 적 절 한 목공 이다.', 
    ['我们的目标是【摩尔运奴船】，别去招惹那些船坚炮利的护卫舰！'] = '우리 의 목표 는 앤 무어 운 노예 배 를 사육 하 고 가지 마 십 시 오. 船坚炮利 야기하다 들 의 호위 함!', 
    ['我们的舰队已经集结完毕了，让我们为了生命的平等而战！大地母亲一定会护佑着我们！启程！目标--莫桑比克！'] = '우리 는 이미, 함대 결집 되 었 습니다. 우리 의 평등 을 위해 생명 전!대지 어머니 반드시 护佑 했 고 우리!출발!목표 인 모잠비크!', 
    ['我们的资金十分充足，再次升级装备，强力的火炮才是男人的浪漫'] = '우리 의 자금 이 넉 넉 해 다시 매우 업그레이드 장비, 강력 한 주포 이야말로 남자 는 낭만적 이다', 
    ['我们目前为本港口第一商会，无法与其它商会缔结同盟关系'] = '우리 는 현재 본 항구 1 상공 회의소 다리 고 다른 상공 회의소 동맹 체 결의 했 다', 
    ['我们相信，年纪越大的人越有智慧。'] = '우리 는 믿 는 사람 일 수록 나이 가 들 수록 는 지혜 다.', 
    ['我们终于可以多一艘船了吗，船长。太好了，这下不用在晚上窝在小船舱里听辛西亚数金币，蒂奇甩皮鞭和汉娜调试火枪的声音了。谢天谢地，我能睡个好觉了。'] = '우리 가 할 수 있 게 됐 다며 여 배 한 척 지 선장.정말 잘 됐 다, 그 아래 에 안 쓰 는 저녁 둥지 에서 작 은 선실 에서 듣 고 신 시 아 수 금화 티 치 벗어버리다 가죽 채찍 과 한 나 튜 닝 총통 소리 가 들 렸 다.다행이 네 요 나 잔 개 게 했 다.', 
    ['我们被包围了，向西航行，快，利用地形，在他们靠近酒桶时攻击水面的酒桶！'] = '우리 둘 러 싸 여, 서쪽 으로 항해, 빨리 지형 을 이용 해 접근 2l 짜리 큰 소주병 공격 때 드 러 나 는 2l 짜리 큰 소주병!', 
    ['我们被打败了，提升船只、装配或者航海士的能力后重新挑战吧！'] = '우리 가 꺾 을 높 여 나 가 고, 조립 이나 선박 항해 을 점검 한 뒤 재 도 전하 시다!', 
    ['我们要想前往“世界的尽头”，还真是少不了她。走吧，等找到她，说什么都要好好教训一顿！'] = '우리 려면 찾 는 세계 의 끝 \'도 결코 들 덕분에 그녀.갑 시다 등 로 찾 아 뭐 라고 하는 것 은 잘 교훈 한끼!', 
    ['我们认识的第一个欧洲人叫达·伽马。'] = '우리 가 아 는 첫 유럽 사람들 불 러 다 에서 프로 스타 글 란 딘 다.', 
    ['我们该为接下来的征程赚取更多的金钱！记得航经每一个港口都到交易所看看！我们的目标是：拥有4000银币！'] = '우리 는 다음 의 대 장정 이 더 벌 고 돈!기억 항 경 하나하나 항구 모두 거래 소 봐!우리 의 목표 는 아파트 를 4000 은화!', 
    ['我们跟随霍金斯的行踪一路追到这里，突然失去了他的踪迹。不知道这个恶棍躲在了什么地方。'] = '우리 를 따 라 호 킹 스 의 행방 을 쫓 아 추락 을 계속 하 고 있다. 이쯤 되 면 그 의 행방 을 갑자기 잃 었 다.모 르 는 경우 가 악질분자 가 어떤 곳 이다.', 
    ['我们这样带着几十人回去已经回引起怀疑，先去【交易所】把货物装满仓作为掩饰吧。'] = '이런 우리 를 데 리 고 수십 명 에 지 나 지 않 는 돌 아 간 지가 회 을 의심 받 을 먼저 가 타이완 (거래 소 사육 하 고 있다 는 물건 을 싣 满仓 로서 호도 시다.', 
    ['我们这种人怎么配认识有钱人家的老爷？我母亲等了他十几年，一直等到死，现在我只想让他早点下地狱！'] = '우리 같은 사람 이 어떻게 교배시키다 인식 집안 의 시골 영감?그 는 제 어머니 를 비 롯 해 10 여 년 이 지 나 죽 을 지금 만 그 일찍 지옥 에 떨 어!', 
    ['我们这里卖椰子，这可不是哪里都买的到。'] = '우리 팔 아 야자 를 시혜 가 아 니라 어디 도 구입 했 다.', 
    ['我们这里有很多水果，但交易所只卖椰子。'] = '우리 도 많은 과일, 하지만 거래 소 만 팔 야자 이다.', 
    ['我们这里的乳香非常著名。'] = '우리 가게 는 유향 을 매우 유명 했 다.', 
    ['我们这里的雪莉酒非常有名。'] = '우리 가게 는 설 리 술 유명하다.', 
    ['我们遭到攻击了!'] = '우리 공격 을 받 아!', 
    ['我们首要目标是摧毁炮台，同时不能让货船运走货物，最后击败彼得松•霍因，夺回卡利卡特。'] = '우리 최 우선 목표 는 파괴 포대 를 동시에 가 발 붙 이지 못 하 도록 화물선 반출 화물 을 꺾 고 피 터 손 호 을 탈환 한 칼 카 터 다.', 
    ['我们？还有其他人？'] = '우리 를 당 할 소 냐?또 다른 사람 인가.', 
    ['我会为你们弄到足够的货源，希望你们能够振作起来。'] = '나 는 여러분 들이 지척 충분한 장 하 도록 진작 했 을 거 다.', 
    ['我会带你们回去，只要你们把刚才说过的话告诉你们的同胞，让他们都醒过来吧。'] = '너희들 은 돌 아가 서 데 려 다 줄 게 요, 당신들 의 아까 이 한 말 을 알 려 주 세요 문 국 한국 의 동포, 그래서 그들 도 덜 깨 시다.', 
    ['我会更强大！而你必将失败！'] = '내 가 더 강!그리고 는 반드시 실패!', 
    ['我会让他上我的船，成为我的伙伴，我保证。'] = '그 는 내 가 뭐 라고 생 각하 에서 배 를 나 의 동반자 내 가 책 임지 죠.', 
    ['我会负责监视马铃薯的，小心点，可别引来增援哦。'] = '나 의 감 시해 감자 를 조심 하세요, 하지 요. 빈축 증원', 
    ['我倒不是担心这个，之前阻止了达尔布克基，此事最好还是先回$(missioncolor:【里斯本】)向亨利王子解释一番。'] = '저 아니 그런 걱정 을 사전 차단 했 다 르 보 크 스키, 파문 으로 돌 아가 는 게 좋다 missioncolor $(: 리스 본 괴뢰 호 전광 들이) 에게 해리 왕자 해명 을 벌 인 다.', 
    ['我倒是挺羡慕他们这样的生活，起码非常安宁……'] = '꼭 꼿꼿하다 부러 워 치 는 아이 들 의 삶 은 최소 매우 안녕......', 
    ['我倒是觉得事情没这么简单。'] = '꼭 그렇게 생각 일 간단하다.', 
    ['我做这些事并不为了需要朝廷承认，只是这对天下女子来说不公平。'] = '내 가 그런 얘기 를 하지 않 기 위해 필요 인정 을 조정 에 대한 여자 에게 뿐 이다 천하 불공평 해 요.', 
    ['我准备在岛的西边开辟一片咖啡豆种植园。'] = '제 가 준비 가 섬 서쪽 은 있 지만 커피 원두 플랜 테 이 션 이다.', 
    ['我准备造一艘名叫白银梅丽号的船。'] = '제 가 준비 만 척 dennis 은돈 라 메 리 호 는 배 였 다.', 
    ['我刚从俘虏口中探听得知，拉比斯趁着我们攻打亚历山大的时候，脱身逃往了$(missioncolor:【威尼斯】)。'] = '방금 전 에서 포로 로부터 탐문하다 알 을 틈 타 라 비 스 알 렉 산 더 의 우리 공격 때 를 빠 져 나 갈 구멍 을 도피 했 missioncolor $(:) 베 네 치아 사육 하 고 있다.', 
    ['我刚刚听到一个孩童说着一些奇怪的东西，好像是狮首象身的怪物和什么住在深海里半人半蛇的那伽摩纳娑……'] = '나 방금 한 아이 들 더라 " 며 엉 뚱 한 것 같다 는 스 포 티 지 첫 코끼리 몸 의 괴물 과 어떤 사 심해 에서 반 인 반 뱀 의 그 가 모 나 娑....', 
    ['我刚好要去见一位老朋友，那么回头见。'] = '내 가 마침 를 만난 한 오랜 친구 이 고, 그러면 조금 있다 가 봅 시다.', 
    ['我到东南方的【锡兰】去求援吧，希望他们明白厉害关系，愿意伸出援手。'] = '내 려 동남쪽 의 거장 锡兰 사육 하 고 있다 가 손을 벌 릴 라, 희망 도 알 고 있 었 을 이해 관계자 말 을 꺼 낸 원 조의 손길 을.', 
    ['我到今天这个地步全是拜这群恶魔所赐！实不相瞒，我是萨尔法八世，这片土地的国王。曾经这是一篇祥和的土地，直到恶魔降临，烧杀掳掠。我的人民奋起抵抗却无法抗拒那恐怖的巨龙吐息。他们夺走了我的王位，奴役着我的子民。而我，只能四处躲避，等待复国的时机。'] = '내 가 여기까지 오 전 은 이 군 악마 가 하사품!실 하지 않 相瞒 입 니 다. 저 는 사 르 법 8 세, 이 땅 의 왕 이다.한때 다 여유 로 운 땅 까지 악마 이 고 한 烧杀 노략질 하다.나 의 인민 봉기 저항 할 수 없 는 현실.... ☆ 그 테러 는 용 토 금리 인상 이다.그들 을 앗 아 갔 나 의 왕위 를 강제 노역 을 내 아들 민 다.나, 피하 려 할 수 밖 에 없 을 기다 려 온 는 시점 이 었 다.', 
    ['我又回来了，这次，我带了无敌战舰送给你们，哈哈哈哈'] = '내 가 다시 들 어 왔 고, 이번 에 나 때문에 당신들 에게 무적 전함 을 나 는 키 가 틉 니 다', 
    ['我发誓，为了加尔各答的自由，我们一定能取得胜利！'] = '난 맹세 하 겠 씁 니 콜 카 타 를 위해 자유, 우리 는 반드시 승리 할 수 있 을 것 입 니 다!', 
    ['我只不过是尽我作为一名管家的本分而已，这不算什么。'] = '나 는 내 분수 에 불과 한 사람 으로서 집사 의 본분 뿐, 별것 아니다.', 
    ['我只是不像其他的海盗一样赶尽杀绝而已，真是可笑，明明是做恶，只要在恶的基础上稍稍施加一点点善，被伤害的人却会给你冠以美誉，对你感激涕零。'] = '난 그저 다른 한 해적 처 럼 지국 을 뿐 우습다 을 짜 는 무슨 일을 악 이라도 악 을 바탕 으로 조금 을 조금씩 선 를 피해 집 을 나 온 사람들 은 너 한테 성묘 쓰 고 당신 에게 감격 해서 울 고.', 
    ['我只是为当年死于墨西哥湾的同伴报仇而已。'] = '나 는 그저 그해 죽음 을 맞 이 한 멕시코 만 의 동료 보복 일 뿐 이다.', 
    ['我只知道有人被阿芒德给抓到了……不废话，让你见识见识我的厉害。'] = '나 만 누 아 참억새 덕 에게 붙 잡 아......안 되게 식견 식견 내 심 각 해 요.', 
    ['我只站在自己这一边。你走吧，看在曾经国王的面子上，我会放你一马。远离这纷乱的漩涡吧，否则你只有死路一条。'] = '나 만 이 자기 네 편 이 었 다.그냥 해 한때 국왕 의 체면 을 살 려 주 에서, 나 는 한번 봐 줄 게 요.신록 이 분란 의 소용돌이 를 만 들 어 봐, 그렇지 않 으면 당신 은 죽 는 다.', 
    ['我只能帮到这，在他们发现我之前我得撤退了。'] = '내 에 방 까지 이 를 발견 하 고 나 는 이전 에 제 가 퇴각 했 다.', 
    ['我叫夏洛克，你需要借贷吗？只需要一点点利息。'] = '저 는 국가 가 아 닌, 너 필요 차입?조금 만 필요 이자.', 
    ['我可不仅仅长得漂亮噢，将购销货物的事务交给我，我们的资金很快就会成倍增长的！现在进入交易所点击左下角我的头像就可以购买货物。'] = '난 무단 뿐 아 니라 예 쁘 오, 이 공급 화물 을 실 어 나 르 는 사무 내 자신 에게 우리 의 자금 이 곧 배가!거래 소 는 이제 클 릭 左下角 내 얼굴 을 수입 할 수 있 는 화물 이 실 려 있다.', 
    ['我可不像达伽马，我只想稳当的做我的总督，而战争毁掉了城镇，所以，你必须负责把【果阿】和【卡利卡特】建设达到港口等级3。'] = '저 도 되 고 싶 을 뿐 처 럼 달 에서 프로 스타 글 란 딘 온건 한 나 의 총독, 전쟁 어구 타운 되 므로 오빠 반드시 책임 을 져 야 한 다 는 앤 디 아 사육 하 고 열매 와 앤 디 칼 리 카 터 괴뢰 호 전광 들이 건설 이 항구 등급 3.', 
    ['我可不只这点能耐!'] = '난 무단 뿐 아 니라 점 고온!', 
    ['我可不是娇滴滴的贵族千金！我要让所有人记住我拉比斯的名字！'] = '저 는 그저 그 렇 고 娇滴滴 귀족 백만!나 만 기억 나 라 비 스 의 이름!', 
    ['我可不管你为什么，我只想用舰炮狠狠地轰击阿芒德……眼睁睁看着阿芒德耀武扬威又从容而去，这是对我汉娜的蔑视！'] = '어 쨌 거나 왜 내 고 싶 을 뿐 함포 가 무 자 비하 게 폭격 아 참억새 덕....걸 보 면서 아 참억새 덕 에서 맹위 를 떨 치 고 여유 를 찾 아 가지 않 는 한 나 는 저 에 대한 멸시!', 
    ['我可以在祈祷时喝酒吗？我可以在喝酒时祈祷吗？'] = '내 가 할 수 있 는 일 이 없 기 를 빌 때 술 마 시 고?내 가 할 수 있 는 술 을 마 신 시 기도 있 습니까?', 
    ['我可以帮你找到香料群岛，但我绝不会成为你屠杀的凶器。'] = '내 가 도 와 줄 수 있 잖 어 찾 아 향료 군도 지만 저 는 당신 이 될 지 학살 의 흉기 를 휘 둘 렀 다.', 
    ['我可对什么十字军和约翰王的联盟那些玩意不感兴趣，我只在意繁华的交易所和热闹的酒馆呢。'] = '난 무단 무엇 에 십자군 과 约翰王 연맹 들 의 놀음 이 따로 없다 에는 관심 이 없 고 저 만 신경 쓰 지 않 는 다며 번화가 인 거래 소 와 활기 찬 주점 을 할 까.', 
    ['我可没有这样的意思，是你自己想多了……别瞪我，既然你这么喜欢这里，我就帮帮这些人。'] = '난 무단 그런 뜻, 당신 은 자신 들이 하 고 싶 은 여......내 가 당신 을 만큼 별 쏘아보다 이렇게 좋아 해 이곳 을 내 가 도 와 주 실 이 들.', 
    ['我可没有钱付给你们，但有的是力气，可以为你们工作。'] = '내 가 돈 을 지 불하 게 당신들 은 없 지만, 얼마 든지 있다 고 기력 을 는 작업 이다.', 
    ['我可没这么闲。我来是想请你协助我前往“世界的尽头”。'] = '난 무단 그렇게 억 원 으로 가장 많 았 다.내 가 하 고 협조 해 주 십 시 요 밸 런 \' 세계 의 끝 \' 다.', 
    ['我听当地的居民说陈祖义的手下甚至对沿海城邦征收高额的贸易税费，稍有不从，便会招致船毁人亡的下场！'] = '저 도 듣 고 현지 주민 들 陈祖义 밑 에 대해서 는 아예 연해 도시 국가 에 물리 는 세금 을 약간 은 무역 을 초래 구멍 의 귀결!', 
    ['我听戴肯叔叔说，需要七海霸主信物才能压制女神的力量。'] = '저 도 듣 고 착 용해 켄 아저씨 를 필요 일곱 바다 패권 확신 야 억압 여신 의 힘 이다.', 
    ['我听水手们说过郑和的故事，他是中国最伟大的航海家。'] = '저 도 듣 고 황천 객 들 에게 " 정 허 는 이야기 를 그 는 중국 의 가장 위 대한 航海家 이다.', 
    ['我听说了你们的事迹……如果我没有破产的话你们倒是不错的合作伙伴。'] = '당신들 의 일대기 를 들었다.만약 내 가 없다 가 부도 나 면 당신들 따르다 보 괜 찮 은 파트너 다.', 
    ['我听说威廉基德正准备和霍金斯宣战，不如我们和他一起联手，打败霍金斯的胜率就更大了！'] = '내 가 듣기 에 제이 슨 키 드 윌 리 엄 스 와 호 킹 을 준비 하 고 있다 고 선전 포고 보다 는 우리 와 함께 손 잡 고 를 꺾 으며 호 킹 스 의 승률 했 다면 더 큰!', 
    ['我哼，原来如此，怪不得我上次功亏一篑。'] = '내 가 흥! 그 렇 군, 어쩐지 내 지난번 \' 신 세가 된 것 이다.', 
    ['我嗅到了金币的味道，这里一定有特级商品！我们快去$(missioncolor:【市政厅】)吧，我的直觉不会有错的！'] = '내 가 촉각 을 곤 두세 우 고 금화 맛, 여기 있 었 구나 특급 상품!빨리 $(missioncolor: 시청 괴뢰 호 전광 들이) 그 러 는데, 나 는 직관 틀 리 지 않 는 한!', 
    ['我在土里挖出了几枚中国古代的钱币。'] = '저 는 흙 속 에서 찾 아 냈 을 몇 개 나 중국 고대 하는 돈 이 었 다.', 
    ['我在寻找我的父亲，传闻他去了世界的尽头。东印度公司四处劫掠，欺压原住民，我攻击他们是替天行道。'] = '나 는 나 의 아버지 를 찾 아 간 적이 있 었 다. 세계 의 소문 은 끝 이 없 었 다.동 인도 회사 여기저기 강탈, 억압 원주민, 나 공격 대신 일간 닐 세.', 
    ['我在背诵教皇发布的禁止奴役印第安人的圣训。'] = '저 는 암기 교황 불허 노역 인디언 의 圣训 이다.', 
    ['我在这颗宝石里感受到了大海的力量，上次在世界尽头的最终路途上被水幕结界所阻，或许就是缺少了这样一把钥匙……'] = '저 는 이 새로 운 보석 에서 느 낀 바다 의 힘 으로 지난 세상 끝 의 최종 길 에도 이 水幕 结界 에게 막 혀, 혹시 부재 는 이런 열쇠 가......', 
    ['我在附近的种植园里工作。'] = '저 는 인근 플랜 테 이 션 에서 일 해 요.', 
    ['我好像听到打雷了，嗝！'] = '기분 이 든 다 "고 말 했 을 듣 고 천둥소리 딸꾹질!', 
    ['我学了一句中国话：有钱能使鬼推磨。'] = '저 는 배우 한마디 중국말: 돈 씁 쓸 한 여운 을 남 긴 다.', 
    ['我完全同意，我们应该到酒馆里去请喝一杯，总有一些人，舌头一大话匣子就打开了，比如我……'] = '찬성 짚 고 넘 어가 야 할 것 까지 술집 에 소주 한잔 주 세요, 총 몇 명 이 고, 혀 큰 떠 버 리 자. 예 를 들 면 내 가......', 
    ['我对你们的感激之情无以言表，我亲爱的朋友。'] = '내 가 당신 에게 고 맙 게 생각 하는 말 할 수 없이 내 사랑 하는 친구 입 니 다.', 
    ['我对自己的运气一向很有信心。走，这就去酒馆。'] = '스스로 에게 는 행운 을 안 이 굉장히 자신 있 었 다.갑 으로 간 주점 을 했 다.', 
    ['我尝试拼了一下，虽然磨损很严重但依稀能看得出是一张地图，您快看。'] = '내 가 시도 맞붙이다 줘 도 비록 닳 을 심 각하 게 받 아 들이 지만 여전히 어지러이 발견 된 은 웃 지도, 당신 빨리 보 겠 습니다.', 
    ['我就是一个普普通通的管家，可没什么故事可言。'] = '내 가 한 하 자면 수 없 는 집사, 이야기 가 따로 없 었 다.', 
    ['我就知道戴肯叔叔你一定会理解我的。'] = '생각 을 나 다이옥신 켄 아저씨 넌 꼭 이해 내 것 이다.', 
    ['我就要死了，但现在战况紧急，不要透露我的死讯，请你接替我的位置，以我的名义，继续战斗下去……咦，你不是李莞？'] = '나 면 난 죽 었 지만, 지 금은 전황 긴급 을 하지 말 도록 나 의 사망 소식 을 후임 나 의 위치 를 내 이름 으로, 계속 전투 지속 될 수 있 도록......어머나, 당신 은 이완?', 
    ['我就说我的运气一向不错吧。这位经验丰富的航海士一定能给我们带来极大的帮助。咦，$(missioncolor:【冒险家笔记】)，这是什么？'] = '저 를 좋아 하지 않 는 운 이 평소 괜 찮 은 편 이 죠.이 경험 이 풍 부 한 항해 일정 우리 에게 큰 도움 이 됐 다.어머나, $(missioncolor: 모험 가 노트 를 사육 하 고) 이것 은 무엇 입 니까?', 
    ['我就说我的运气不错吧，在对战中使用钩锁，能够直接封锁对方旗舰的行动，我方旗舰上刚好缺少这样一位人才。'] = '저 를 좋아 하지 않 는 운 이 괜 찮 게 요. 전 에 사용 할 수 있 도록 봉쇄 낚다 자물쇠 를 직접 상대 기함 의 행동 을 우리 측 에 이런 기함 마침 부족 한 인력 이다.', 
    ['我已经听说了这事了，是的，协议的确没有对个人有约束，这也是我为了我们私人商船在北海的利益而做的让步。'] = '나 는 이미 들었다 가 그 일 에 네, 합의 사실 에 대한 개인 이 통제 를 받 았 다. 이것 이 내 가 기 위해 우리 상선 은 북해 의 사적인 이익 을 위 해서 는 양보 할 수 없다.', 
    ['我已经听说了这事了，英国那边暧昧的态度着实令人担忧。霍金斯现在的实力依然不容小觑，你要小心。另外，请你代表我们葡萄牙王室与刚刚重获自由的城市缔结贸易关系，葡萄牙愿意帮助他们走出困境。'] = '나 는 이미 들었다 가 그 일 영국 저쪽 애 매 한 태도 를 수 있 을지 걱정스럽다.호 킹 스 지금 의 전력 은 만만 찮 아 너 조심 하세요.한편 제발 우리 와 포 르 투 갈 대표 왕실 막 중 집행유예 로 풀 려 난 도시 체결 무역 관계, 포 르 투 갈 도 와 주 려 헤 쳐 나 가 겠 다.', 
    ['我已经当了超过40年的水手，现在准备退休做点小生意。'] = '나 는 이미 노릇 을 40 년 이 넘 은 매 리 너 스, 지금 은퇴 준비 장사 수준 이다.', 
    ['我已经很久没有回到这里了，自移居到普利茅斯后，我就在这一带讨生活，跟着商船到世界各地贩卖红茶和啤酒。大海充满了商机，年轻人你要擅长发现。'] = '나 는 이미 오랜만 에 돌 아 와 서 는 이주 했 普利茅 스 후의 나 는 이 일대 에서 讨生活 상선 을 따 라 세계 인신 매매 홍차 나 맥주 이다.바다 가득 상권 을 젊은이 들이 니까 잘 발견 됐 다.', 
    ['我已经把那块女神之誓给了那小子，戴肯，你觉得靠这小子就一定能在世界的尽头找到女神？'] = '나 는 이미 그 덩어리 의 맹세 여신 에게 그놈 을 입 고 뿔 켄, 너 생각 에 의존 이놈 면 반드시 세 상의 끝 에서 찾 아 여신?', 
    ['我希望我可以相信你……来【酒馆】找我。'] = '나 를 믿 을 수 있 는데.....[주점 을 찾 아 나 사육 하 고 있다.', 
    ['我当然愿意！能与你们一同为了正义而战是我的荣幸，快来【酒馆】签订招募合同吧！'] = '나 는 물론 의사!너희 와 함께 정의 를 위해 전 은 나 에게 큰 영광, 빨리 와 타이완 (주점 괴뢰 호 전광 들이 모집 계약 체결 합 시다!', 
    ['我怎么可能甘心，空手回去见玛利亚不如直接让我丧生在这片大海当中，成为鱼群的饵料！我去了加勒比海，加入了本杰明.霍尼戈的海盗团。'] = '내 가 어떻게 돌 아가 만난 달가워하다 손 으로 직접 팝스 타 마 돈 나 보다 나 를 목숨 을 잃 은 이곳 바다 속 을 떼 는 饵料!나 카 리 브 해 에 가세 했 다. 霍尼 벤 저 민 골 의 해적 단 이다.', 
    ['我怎么感觉巴巴罗萨话里有话。'] = '내 가 어떻게 느낌 아내 로 살 话里有话 이다.', 
    ['我怎么没感觉到他在推脱。你看，居然有一艘船，不过看上去并不像战舰。先去【舰队】升级装备，做好将它加入舰队的准备，等戴肯叔叔回来向他咨询下关于这艘船的信息。'] = '내 가 어떻게 느 끼 지 못 했 다. 그 는 떠너 봐 봐, 의외로 배 한 척 이 지만 보 이지 처 럼 전함.먼저 [함대 사육 하 고 업그레이드 장비 를 각오 하 고 가입 함 대의 준비 를 착 용해 콘 등 아저씨 돌 아 와 그 에게 자문 아래 당위적 척 의 메시지 를 보 냈 다.', 
    ['我怎么知道？我和那个纨绔小子可没什么交集。'] = '내 가 어떻게 알 겠 어?저 와 그 녀석 은 수 니 별 집합.', 
    ['我怎会没付诸行动呢？我的打算是加入一艘船上积累经验，然后慢慢建立自己的船队。'] = '내 가 못 했 더라면 행동 으로 보 여주 는 것 일 까.나 의 복안 이 가입 한 척 선상 경험 을 쌓 고 천천히 선단 을 만 드 는 모습.', 
    ['我总觉得还缺点啥，要不到交易所里看看吧'] = '난 생각 만 도 단점 을 못 받 을 그냥, 거래 소 에 가보 자', 
    ['我想凡是有正义感的人没人会愿意如此安宁悠闲的地方被战争给破坏。'] = '무릇 고 싶다 는 정의감 의 사람 못 해 보 면 이렇게 안녕 한적 한 곳 이 전쟁 망 했 다.', 
    ['我想在佛得角建一座小教堂。'] = '어디 가 고 싶 佛得角 건립 작 은 성당 이다.', 
    ['我想她一定是一个大美人，让您到现在都念念不忘。'] = '나 보고 싶 일정 은 큰 미인 을 가게 당신 을 한 번 도 들 먹이 고 있다.', 
    ['我想如果能够利用好大漩涡，会给我们日后带来诸多便利。至于危险又算得了什么！走，让我们去见识一下这神奇的大漩涡吧！'] = '좋 은 생각 이 활용 해서 큰 소용돌이 속 에 우리 에게 앞으로 지신 편리 합 니 다.회심 위험 하 고 그나마 나 무슨!걷 고 하자 운용 이 마 법의 큰 소용돌이 합 시다!', 
    ['我感觉到钱袋又重了一些。'] = '돈가방 인 느낌 을 다시 점검 했 다.', 
    ['我愿意。只要给我足够的继续、足够的时间，而且我还需要你的帮助。'] = '그 러 겠 어요.나 에게 주 면 내 가 충분한 계속, 충분한 시간 을 갖 고 당신 이 필요 한 도움 을 받 았 다.', 
    ['我懂一点占卜，知道他凶多吉少了……'] = '내 가 이해 를 알 수 있 는 점술 절망적 이다......', 
    ['我懂了，看来我又得操劳一番了。'] = '내 가 알 았 하지 않 겠 나 라고 말 했 다. 그러나 지 금은 고생 임 이 드 러 났 다.', 
    ['我懂的，戴肯叔叔，秘密在金子面前不再是秘密。'] = '내 가 알 아 보지 못 하는 착 용해 켄 아저씨 를 비밀 은 금 앞 에서 는 더 이상 비밀 이다.', 
    ['我成为水手之后，听说有一艘西班牙宝船在佛州被飓风卷进了大海深处，我决定去佛州试一试运气。'] = '내 가 듣기 에 매 리 너 스 에 이어 1 척 이 스 페 인 보 배가 됐 佛州 허리케인 휘 말 렸 바다 깊 을 하 러 가 기로 결정 했 습니다 佛州 한번 해 보 자 는 운 이 따 랐 다.', 
    ['我才不信什么女人会带来厄运呢，如果我们连一个炮手都没有就去和摩尔人战斗那才真的会倒大霉！'] = '절대 믿 어떤 여자 에 징크스. 우리 하나 포수 하나 없이 측 과 무어 명 전투 다면 그 게 과연 큰 코 다 치!', 
    ['我才不是在向你认错呢……哼！我发现这群自称商人的海盗围绕南方的$(missioncolor:【圣乔治】)经营退路，并和另一股势力有所勾结，我一定要将他们一网打尽！'] = '비로소 이 아 니라 는 사실 그대 에게 반복 이 아 닐 지.흥!내 가 발견 한 이 군 스스로 상인 들 의 해적 을 둘 러 싼 남측 의 $(missioncolor: 장미 괴뢰 호 전광 들이) 경영 퇴로 를 하 고, 또 하나의 세력 이 유착 을 꼭 이 들 을 일망타진!', 
    ['我找你前来正是为了此事。霍金斯并没有在东印度公司手上，而是与海盗勾结，四处劫掠商船。'] = '내 가 널 찾 찾 아 주기 위해 알 려 지게 됐 다.호 킹 스 두 지 는 않 고 동 인도 회사 손 에 달 려 있다 는 것 이 아 니라 해적 들 과 유착 여기저기 강탈 상선 이다.', 
    ['我把她卖给了一个威尼斯人，他说要到非洲干一趟大买卖……饶命啊……'] = '나 는 그녀 에게 팔 았 하나의 베 네 시안 라 아프리카 말리 고 다 녀 온 빅 딜 \'....면서 살 아......', 
    ['我把希望留给自己，它将给我带来无穷的财富！'] = '나 는 희망 에 남 을 갖 고 있 는 나 에게 막강 부!', 
    ['我投降！我投降！别杀我，我愿意用我所有的财宝换我一条生路！你看，只要你们放过我，这个美丽的宝瓶就是你们的。'] = '내 가 항복!내 가 항복!별 나 를 죽 나 보지 않 았 으면 내 모든 재 신 바 꿔 나 외 쳤!너 봐 봐, 당신들 의 놓아주다 나 이 아름 다운 宝瓶 니.', 
