    ['我有幸见识过宫本武藏和佐佐木小次郎的惊天一战。'] = '내실 식견 적이 미 야 모토 무 사시 와 사사 키 작 은 쿠 지로 들 의 높 은 한판 이다.', 
    ['我来帮您出售有利润的商品'] = '제 가도 와 드릴 재 매각 이익 을 내 는 상품 이 됐 다', 
