    ['我没看错吧！那艘船竟然悬挂着英国国旗！无耻的家伙，在剥夺了我们在北海的权益后，居然还有脸到非洲来与我们争夺！'] = '저 안 잘못 봤어요!저 배 이 걸 려 있 고 영국 국기!뻔 뻔 스 러 운 국적 을 박탈 놈 은 우리 가 있 는 북해 의 권익 에 온 뒤 에는 얼굴 까지 아프리카 과 우리 다툼!', 
    ['我熟悉敌人行进路线，你们攻城，我来解决右边巡逻的家伙。'] = '내 가 익 숙 적 행진 구간, 너희들 을 공격 할 때 쓰 던 고 왔 다고 해결 오른쪽 순찰 하는 놈 이다.', 
    ['我爱上了一个姑娘，她叫玛利亚.哈里特。'] = '나 를 사랑 한 처녀 를 불 렀 다. 팝스 타 마 돈 나 해리 트.', 
