    ['是条顿骑士团为皇帝征服了普鲁士。'] = '은 조 턴 을 정복 했 骑士团 황제 프로 이 센 다.', 
    ['是水手聚集地，去那里招募新伙伴吧。'] = '이 매 리 너 스 집결지 를 찾 아가 모집 새 파트너 시다.', 
    ['是水手聚集地，我们去那里招募新伙伴吧。'] = '캔 자 스 시 티 는 단지 우리 가 거기 모집 새 파트너 시다.', 
    ['是汉萨同盟最重要的军事和商业港口，'] = '사 지가 한 이 가장 중요 한 군사 동맹 과 상업 항구 를', 
    ['是海盗，他们盘踞在【哈瓦那】附近，那里的商船无法出港，货源眼看就要断了！'] = '이 들 은 해적 을 도사리다 은 앤 디 아 바 나 사육 하 고 인근 에 그곳 의 상선 을 못 출항 비장감 눈앞 끊 겼 어요!', 
    ['是玛格丽特女王建立了北海卡尔玛联盟。'] = '마 거 릿 여왕 을 구축 했 다 는 북해 칼 마 연맹 이다.', 
