    ['是的，不过没有买卖就没有伤害！霍金斯一伙已经逃往海峡对岸，这次我要彻底消灭他们！彻底摧毁这肮脏的奴隶贩子！'] = '네, 하지 못 한 매매 없이 는 상해!호 킹 스 일당 요르단 해협 건너편 는데, 이번 에는 저 철저히 섬멸!확실히 파괴 이 더러 운 노예 치기!', 
