    ['没出息的家伙……这可比我的命运号差远了，还不快过去领船，哼！'] = '건평 씨 는 놈....이 하늘 을 찌 를 듯 내 운명 호 멀 었 다 욕설 을 하는 과거 칼라 배 를 흥!', 
