    ['没想到你们的实力这么强悍，我可以正式考虑把你们引荐给女王了。'] = '줄 은 몰 랐 다. 당신들 의 실력 이렇게 멜 버 틸 수 있 었 다. 공식 고려 너희들 대동 했 다. 여왕 에게', 
    ['没想到你还是有点实力的，你让我想起我年轻的时候，无知无畏，乘风破浪。'] = '줄 은 몰 랐 다. 당신 은 여전히 좀 실력 뿐 인 데, 너 생각 이 떠 나 젊 었 을 땐 무지 무의미 으로 순풍 에 돛 단 듯이.', 
    ['没想到只是对付阿芒德的手下，就已经如此艰难。'] = '줄 은 몰 랐 다. 다만 대충대충하다 아 참억새 덕 의 부하, 이미 이렇게 어 렵 게 했 다.', 
    ['没想到吧，当年你口中的虫子又出现在你面前。直说了吧，我这次来是为了你手中的霸主信物。交出来！否则我会让你吃些苦头。'] = '줄 은 몰 랐 죠, 그해 너 입 안 의 벌레 가 당 신의 앞 에 다시 나 타 났 다.직 설 적 화법 렸 을 까. 제 가 이번 에 온 은 당신 을 위 해서 손 의 패자 는 확신 했 다.건네다 나 와 야 지!영향 을 받 으면 저 는 당신 에게 조금 고배 를 마 셨 다.', 
    ['没想到对方的速度这么快，已经把城镇给包围了，看来，这场战斗可不轻松呢。'] = '이렇게 빨리 줄 은 몰 랐 다. 상대방 의 속도 를 이미 타운 에게 포위 했 을 것 이 싸움 도 가 볍 게 할 까.', 
    ['没想到希勒暗藏如此的心思，我们都失算了。'] = '남몰래 감추다 이렇게 움 직 일 수 있 는 줄 은 몰 랐 다. 시어 러, 우리 가 생각 했 다면 오산 이다.', 
    ['没想到当年先驱者哥伦布的第一站已经成了海盗的乐园。全员解散！都好好休息一下。'] = '줄 은 몰 랐 다. 그해 선구자 콜 럼 버스 의 첫 기착지 이미 해적 의 랜 드 다.전원 해산!모두 편히 쉬 세요.', 
    ['没想到我大明海军里居然出了叛徒！难怪会发生种种奇怪的事情阻止我们征剿陈祖义。'] = '내 가 선물 을 준수 대명 해군 간 의외로 냈 배신자!오죽 하 면 종종 나 온 이상 한 일 이다. 陈祖义 우리 를 막 징집하다 토벌하다', 
    ['没想到是你赢了。这个宝石，拿走。'] = '당신 이라고 만 생각 이 겼 어요.이 보석 을 가 져 간 다.', 
    ['没想到红袖姐姐居然找个这样一个刻板的丈夫。'] = '줄 은 몰 랐 红袖 언니 뜻밖에 찾 아들 하나 를 의 남편 이다.', 
    ['没想到这个小港口里汇集了这么多经验丰富的航海士。'] = '이 이 小港 지지 에 묶 은 이렇게 많은 경험 이 풍 부 한 항해사 이다.', 
    ['没想到连父亲最忠实的老部下都没能忍住金钱的诱惑，难怪会发生种种奇怪的事情阻止我们征剿陈祖义。'] = '는데 아버지 가장 충실 한 늙 은 부하 들 도 참 지 못 돈 의 유혹 을 뿌리 치 고 오죽 하 면 종종 나 온 이상 한 일 이다. 陈祖义 우리 를 막 징집하다 토벌하다', 
    ['没想到，你说起道理来还是一套一套的。'] = '예 상과 달리, 당신 이야기 논리 는 빚 을 갚 는 채 세트.', 
    ['没搞错吧？我在这座港口很难看出你口中的风景甚佳。'] = '그런데 없 죠?나 는 당신 이 항구 보기 힘들다 면 입 안 의 풍경 몫 까지 했 다.', 
    ['没文化真可怕……戚将军这句诗是在继承祖位负责管理登州卫所的屯田事务时所作，怎会是这样的意思？'] = '아이고 무 서 워 못 문화....비애 장군 이 구절 은 상속 조 위 담당 관리 등 州卫 개 의 屯田 사무 때 만큼 했 더라면 이런 어 처 구 니 없 는 는 뜻 일 까.', 
    ['没时间了聊天了，走！'] = '시 간이 없 어요 이야기 를 나 누 었 을 가요!', 
