    ['没有什么放不下的，痛了自然就放下了。'] = '없 게 한, 아프다 는 것 은 자연 스 럽 게 안심 이 됐 다.', 
    ['没有伊丽莎白女王的资助，你就能完成环球航行？'] = '없 伊丽莎白女王 지원금 도 당신 이 뤄 낼 수 있다 콘티 넨 털 항해?', 
