    ['没有到他们如此嚣张，我们快去$（missioncolor：【吉阿丁】）截下他们的船只。'] = '그렇게 날뛰다 도착 하지 않 을 빨리 $(missioncolor: 찌 아 정 괴뢰 호 전광 들이) 차단하다 그들 의 선박 이다.', 
    ['没有前置装备'] = '전치 장비 없', 
