    ['没有需要洗炼的属性'] = '수 요가 없 洗炼 의 속성 이다', 
    ['没点本事,我们怎么能在东亚光明正大走私？'] = '못 시 수완 을 우리 가 어떻게 동아시아 에서 공명정대하다 밀수?', 
    ['没用的废物，下一艘突击船前进！'] = '쓸 데 없 는 폐기물 을 들 여 척 의 배가 다음 돌격 앞으로!', 
    ['没那么简单。这帮老家伙脾气古怪，可不会随便听从你的指挥。能改造出什么只能看他们的心情。当然了，他们虽然脾气差了点，但手艺还真没的说，你大可以放心，他们绝对能使船舶的能力得到大幅的提升。'] = '그렇게 단순 하지 않다.이 방 늙 놈 성벽 괴 상한 을 따 라야 할 수 는 너 의 지휘 를 받 는 다.수 개조 무슨 볼 수 밖 에 없 어 그들 의 마음 을 전 했 다.그럼, 그들 은 비록 기질 은 떨 어 지 지만 솜씨 가 정말 没的说, 당신 은 대 안심 하 고, 이 를 무력화 시 킬 수 있 는 능력 을 인정 받 아 선박 크게 높 인 적이 있다.', 
    ['没钱补满食物和水手，只好就这样出海了。'] = '돈 이 없 어 깁다 만 음식 과 매 리 너 스, 어 쩔 수 없이 이렇게 출항 했 다.', 
    ['没钱补满食物和水手，是否就这样出海？'] = '돈 이 없 어 깁다 만 음식 과 황천 었 는지 는 이런 바다 로 나?', 
    ['没钱补满食物和水手，船上补给太少，现在不能出海。'] = '돈 이 없 어 깁다 만 음식 과 황천 선상 보급 이 적다 보 니 이제 못 갔 다.', 
    ['没错！印加被称为黄金国，这些人一定是我的族人！他们过得怎么样？'] = '틀림 없 어요!印加 로 불 린 이 들 黄金国 일정 은 나 의 인 들!그들 은 어떻게 지 내 셨 어요?', 
    ['没错，你到马斯卡特西南方的【亚丁】，看看是否能查出是什么人在支持这些阿拉伯商人。'] = '그래, 너 까지 마 스 카 터 남서쪽 의 앤 디 아 덴 사육 하 고 있다, 예 를 들 면 여부 를 밝 혀 낼 수 있 을 것 이 어떤 사람 은 이 들 은 지지 하는 아 랍 상인 이다.', 
    ['没错，只要赢得一场竞技场的胜利就可以加入英国皇家海军。'] = '그래, 기만 이기 한바탕 경기장 의 승리 는 영국 왕립 해군 에 가입 할 수 있 게 했 다.', 
    ['没错，我一直在拿你们当枪使，我的朋友。现在，你已经没有用了，再见。'] = '그래, 항상 들 고 너희 가 총 멀 고 저의 친구 입 니 다.이제 당신 은 쓸 데 가 습니다. 안녕히 계 세요.', 
    ['没错，我也是才听说老船长还有继承人活在人世，我一定要找到老船长的继承人，将老船长的产业交给他。'] = '그래, 나 도 들었다 며 선장 그리고 후계자 로 남아 있 을 꼭 찾 아 늙 선장 후계자 로 만 들 겠 다고 덧 붙 였 다. 그 는 선장 의 산업 에 맡 겨', 
    ['没错，我们是大明国的海军，奉我义父郑芝龙的命令捉拿陈祖义。刚刚就是你们把盘踞在马尼拉的海盗赶跑的吧！谢谢你们这些为我大明靖海的勇士，日后若是有哪里需要我俞红袖帮忙的，在下肝脑涂地，在所不辞！'] = '그래, 우리 는 대명 국 의 해군 봉 나 양아버지 로 郑芝龙 의 명령 陈祖义 검거 했 다.방금 니 도사리다 마 닐 라 에서 는 해적 을 퇴 출시 켰 던 시다!오빠 들 은 이 들 은 나 를 위해 대명 명인 바다 의 사나이 앞으로 개개인 어디 야 죠 유 红袖 돕 는 다음 간이 라도 빼 줄 을 속내 가!', 
    ['没错，我的勇士拿着弯刀与弓箭英勇冲锋，却被那名为火炮的魔物烧成灰烬。那些人的旗帜上就印着这样的纹饰。我希望你们能够助我一臂之力。'] = '그래, 나 의 용사 들 고 휘 어 져 칼 과 활 영웅적 돌격하다 되 었 으며 그 라 주포 는 악마 물 들이 잿더미 이다.그렇게 말 하는 사람들 의 깃발 이 찍 혀 있 었 다. 이런 장식 은내 가 하 도록 돕 일조 를 하 고 있다.', 
    ['没错，立刻做好战斗准备，让他们有来无回！'] = '그래, 즉각 전투 준비 를 하 도록 오 는 사람들 은 무 회!', 
    ['没错，露梁海战胜利就是最好的证明。'] = '그래, 노 량 해 전의 승리 의 모습 이 바로 그것 이다.', 
