    ['现在让我们启程到【里斯本】去吧，相信我，虽然航程很远，但我们的回报一定会让你满意的！'] = '이제 출발 부터 앤 리스 본 사육 하 고 갑 시다. 저 를 믿 고 비록 항행 노정 멀다. 그러나 우리 는 보상 무조건 내 마음 에 드 는!', 
