    ['用【棉花】作原料制成布匹后，再用不易褪色的颜料在上面绘制出图案。'] = '[작 으로 솜 괴뢰 호 전광 들이 원료 로 만 든 천 같은 후 다시 한번 샤워 를 퇴색 시 키 는 안료 도 쉽 지 않 은 위 에서 처음으로 만 들 어 넣 도록 했 다.', 
    ['用【棉花】作原料制成的纺织品，吸湿透气，是舒适的衣料。'] = '[작 으로 솜 사육 하 고 있다 는 섬유 원료 로 만 든 옷 이 흠뻑 젖 을 빨 에 숨 막 히 는 편안 한 옷 이다.', 
    ['用【棉花】织成的一种布料，通过蜡染工艺印上花朵、蝴蝶等美丽的图案，极具民族风情。'] = '용 앤 디 로 짠 솜 사육 하 고 있다 는 일종 의 옷감 을 통 해 蜡染 공예 인쇄 꽃, 나비 등 아름 다운 도안, 극적 민족 풍정 이다.', 
    ['用【椰子】的果汁酿造而成，酒精度较低且带有甜味。'] = '앤 디 는 주스 로 야자 괴뢰 호 전광 들이 원료 로 만 들 어 주 도도 낮 고 단맛 이다.', 
    ['用【红木、花梨木】等硬木雕磨而成的器具，兼具观赏和实用性。'] = '용 [마호가니, 花梨木 괴뢰 호 전광 들이 같은 하 드 나뭇조각 맷돌 로 기물 을 고루 갖 관람 과 실용성 을 내세 웠 다.', 
    ['用【羊绒】等动物毛发制成的纺织品，比毛织品更加保暖。'] = '용 [가미 괴뢰 호 전광 들이 등 동물 모발 작성 한 섬유 보다 더 보온 모직물 이다.', 
    ['用【芥末、丁香、辣椒、茴香、黄姜】等多种香料调配而成的酱料，香气特别，味道辛辣带甜，深受东南亚人的喜爱。'] = '용 [해삼, 라일락, 고추, 회향풀, 사육 하 고 있다 黄姜 등 다 양 한 향신료 조달 해 만 든 된장, 향기 를 매 운 맛 특별 매 콤 에 이 를 정 도로 동남 아시아 인의 사랑 을 받 았 다.', 
    ['用【鲜花香精、香水油】等原料制成的奇妙液体，一滴即可散发出让人迷醉的香气。'] = '[꽃 으로 향료 · 향수 기름 괴뢰 호 전광 들이 등 원료 로 만 든 묘 액체, 한 방울 어마 배포 선 지방 곳곳 의 향기 라고 생각 했 다.', 
    ['用【麦加】的【石雕】敲石屑吗……有种暴殄天物的感觉。'] = '[메카 로 사육 하 고 있다 는 석조 괴뢰 호 전광 들이 총살하다 석 찌꺼기 나........暴殄天物 한가운데 는 느낌 을 준 다.', 
    ['用亚历山大当地海域生长的一种特色鱼类腌制而成，味道独特，可以保存很长时间。'] = '알 렉 산 더 로 현지 해역 에서 자라 는 일종 의 특색 어류 담 을 맛 을 차별화 를 보존 할 수 있다 고 시 간이 소요 된 다.', 
    ['用亚麻布制作而成的帆，呈三角状，根据大小不同装配于船上的不同部位。'] = '용 빻 아서 으로 만 들 어 진 돛 을 삼각형 모양 크기 에 따 라 다른 조립 이 배 에 타 고 있 던 부위 다.', 
    ['用兽皮加工制作而成的船帆，一般只有维京人才会使用。'] = '용 兽皮 가공 으로 만 들 어 진 닻 을 일반 만 출토 인재 사용 했 다.', 
    ['用冷杉制造的装甲质地坚硬，韧性及抗击能力强，而且木质轻柔容易加工。'] = '구상 나무 제조 용 장갑 장착 을 근성 및 퇴치 강 하 고 목재 줍 니 다 쉽게 가공 했 다.', 
    ['用动物皮革制成的包袋，是身份的象征。'] = '용 동물 가죽 으로 만 들 어 진 가방 을 들 고 는 신분 의 상징 이 었 다.', 
    ['用各种动物皮毛制成的服装，看起来十分华丽，但是从动物身上获取皮毛的过程十分残忍。'] = '다 양 한 동물 모피 의류 를 만 든 게 화 려 하지만 동물 에게서 입수 스트레스 를 겪 는 과정 잔인하다.', 
    ['用各种美丽而昂贵的宝石制成的饰物，色彩瑰丽，质地晶莹，是各国女性梦寐以求的礼物。'] = '다 양 한 아름 답 고 비 싼 보석 으로 만 든 장신구, 색채, 품질 이 매우 아름답다 는 영 롱 을 각국 여성 들이 꿈 에 그리 던 선물 입 니 다.', 
    ['用塔罗牌占卜在马赛的贵族中相当流行。'] = '용 塔罗牌 점술 는 마르세유 의 귀족 중 상당 유행 이에 요.', 
    ['用接舷战把敌人的水手大量杀伤，逼迫敌人进入【单挑】！'] = '뱃전 전 적 으로 받 는 매 리 너 스 대량 살상 을 압박 적 진입 [단 끄집어내다 사육 하 고 있다!', 
    ['用推荐信投资港口，提升爵位提升实力。'] = '용 추천서 투자 항구 를 높이 작위 실력 이다.', 
    ['用整张穿山甲外皮制成皮甲，轻便坚韧，但制作工序极其繁杂。'] = '용 통 穿山甲 외피 만 피 갑, 간편하다 강인하다 제작 공정 매우 복잡 했 다.', 
    ['用新鲜【橄榄】果实榨取而成，盛产于地中海沿岸，因为营养丰富，一度被人们称作“液体黄金”。'] = '용 신선 타이완 (올리브 사육 하 고 열매 착취 로 보 는 지중해 연안 으로 영양 이 풍 부하 고 한때 불 리 는 액체 황금 \' 다.', 
    ['用日文写成的冷笑话大全，即使懂日文的人也看不出其中的笑点。'] = '일본어 으로 탄생 한 유머 대전 을 이해 하 더라도 일본어 는 사람 도 보 이지 않 는 다. 이 중 웃 시', 
    ['用普通野兽的【兽牙】雕刻而成的工艺品，精美且昂贵，一直是皇家贡品。'] = '보통 야수 는 짐승 이빨 괴뢰 호 전광 들이 조각 으로 공예품 정미하다 고 비 싸 고 그동안 왕립 진상품 이다.', 
    ['用杉木制作的装甲，有较好的抗虫耐腐性作用。'] = '용 杉木 제작 장갑, 비교적 좋 은 항 벌레 넥 오래되다 성 역할 을 했 다.', 
    ['用来抗击沙漠游牧民族贝都因人的掠夺'] = '매운탕 배격 사막 유목민 들 의 베 이 가 져 간 다고 한 약탈 이 었 다', 
    ['用来抵御来自海上的波斯人的偷袭'] = '용 견 뎌 바다 로부터 의 페 르 시 아 인 인 기습 이다', 
    ['用杨树和柳树的木材制造而成，荷兰青年男女订婚时，男方要把自己亲手做的木鞋作为信物送个对方。'] = '용 杨树和 버드나무 의 목재 제작, 네덜란드 청년 남녀 약혼 을 할 때 남 을 자 신의 손 으로 보 내 나막신 을 판 다 는 확신 개 상대 했 다.', 
    ['用柚木制作的装甲韧性佳，但由于木质过于坚硬不易加工。'] = '용 柚木 제작 장갑 근성 좋 지만 너무 딱딱 해 쉽 지 않 은 목재 가공 했 다.', 
    ['用棉布制作而成的帆，呈三角状，根据大小不同装配于船上的不同部位。'] = '용 천 으로 만 들 어 진 돛 을 삼각형 모양 크기 에 따 라 다른 조립 이 배 에 타 고 있 던 부위 다.', 
    ['用棉布和麻布混合编织而成的帆，呈三角状，根据大小不同装配于船上的不同部位。'] = '용 천 과 삼베 혼합 자유자재 로 휘 어 만 든 돛 을 삼각형 모양 크기 에 따 라 다른 조립 이 배 에 타 고 있 던 부위 다.', 
    ['用榆木制作的装甲质地硬朗，耐腐蚀性强，经过加工还可增加抗击打强度。'] = '용 느릅나무 목조 작 장갑 속성 터 프, 내부 식성 을 갖 고 강 을 거 쳐 가공 도 벗 어 날 수 있다 고 퇴치 를 강도 를 높 였 다.', 
    ['用橡木制造的装甲耐磨损，具有极强的抗击能力，适合装配于大型帆船上。'] = '오 크 제조 용 장갑 넥 닳 을 잘 알 고 있 고, 강 한 저항 으로 안성맞춤 조립 능력 은 대형 범선 에서 다.', 
    ['用现在的造船技术能不能造出一艘诺亚方舟来呢？'] = '지금 으로 조선 기술 할 수 있 어 보 노 아 의 방주 1 척 이 오 나요?', 
    ['用竹子为原材料编制的器具，美观实用，原材料易获取，是最常见的家用日常器具。'] = '대나무 를 원료 편성 된 기물 을 미적 실용 을 얻 을 원자재 용이하다 는 가장 흔 한 가정 용 일상 기구 다.', 
    ['用粗棉织布加工制作而成的船帆，强韧的抗撕扯性能深受船长们的喜爱。'] = '용 굵다 면화 길쌈 가공 으로 만 들 어 진 닻 을 강 인 한 항 撕扯 성능 의붓아버지 선장 들 의 사랑 을 받 았 다.', 
    ['用融化的蜡在布面上绘画，再浸入染料，蜡自然龟裂后，留下了独一无二的花纹。许多热带地区的原住民族依然传承着这种传统工艺。'] = '용 녹 의 밀랍 이 布面 에서 회화 를 더 경운기 물감 으로 밀랍 자연 균열 을 남 기고 유일 무 이 한 무늬 를 만 들 고 있다.많은 열대 지역 원주민 족 은 여전히 간이 이런 전통 기법 이다.', 
    ['用轻型木材制造，吃水较浅的小型风帆船，适合近岸及内河航行，抗风浪能力较弱，不宜作为远洋航行船舶。'] = '용 경 목재 제조, 홀수선 바람 이 얕 은 소형 요트 용 으로 안성맞춤 近岸 및 내수 항해 항 집채 만 한 능력 이 약하다 고 예단 로서 원양 항해 선박 이다.', 
    ['用途'] = '용도', 
    ['用途：'] = '어디', 
