    ['的确，她的眼睛就像这大海一样波光荡漾，金色的头发绚烂的如同太阳。很幸运的我和她相爱了，但她的父母觉得我是个穷小子并不赞同我们的婚事。为了能够攒够丰厚的聘礼，我加入了海军。'] = '그래, 그녀 의 눈 처 럼 바다 처 럼 출 렁 거리 를 波光 금빛 머리카락 현 란 한 처 럼 태양 이다.행운 을 나 는 그녀 와 사랑 을 했 지만 그 의 부모 생각 나 는 가난 한 녀석 은 우리 의 결혼 은 동의 하지 않 았 다.흥미 를 느 낄 수 있 도록 알뜰히 푸 짐 한 폐백, 나 가입 했 해군 이다.', 
    ['的贸易商品！'] = '한 무역 상품!', 
