    ['相传在七海之中，每个海域都存在一个大漩涡。它可能缩短海域航行的时间，也有可能把人带到不可预知之地。正如先驱者达伽马所言“漩涡反转，时空扭曲。一步天堂，一步地狱。”'] = '대대로 전하다 는 일곱 바다 속 에서 마다 해역 이 존재 한 다. 큰 소용돌이단축 할 확률 이 해역 을 항해 하는 시간 도 했 을 가능성 이 있다 고 예측 불허 인 지라 땅 으로 끌 고 갔 다.처 럼 선구자 달 에서 프로 스타 글 란 딘 의 말 이 소용돌이 반전 을 왜곡 하 고 하늘나라 로 에게로 한발 한발 지옥.', 
    ['相信我们肯定不会让您失望。'] = '우리 를 믿 어 긍정적 수평 을 드 리 겠 습니다.', 
    ['相对于其他石料来说，大理石质地较软，而且有独特的纹理，特别适合用来打造【石雕】。'] = '은 다른 바위 에 겐 대리석 속성 이 소 프 트 를 하 고 있 는 독 특 한 무늬, 특별 에 적 절 한 것 으로 만 들 어 [석조 사육 하 고 있다.', 
    ['相对望，战斗或许会很艰难，但我们必须夺取这个重要的港口！'] = '상대적 으로 마주 보고 있 으며 전투 을지 몰 라도 들 어 렵 지만 우리 야 탈취 이 중요 한 항구!', 
    ['相比你，我更相信我的火炮。'] = '보다 당신 을 믿 는 나 의 포 사격 을 했 다.', 
    ['相比加勒比海这里更加安全，但贸易就没那么便利了。'] = '카 리 브 해 이곳 에 비 해 훨씬 안전 이지 만, 무역 은 온 데 간 데 없 었 다면 편의 이다.', 
    ['相比女神，我更相信火炮。'] = '보다 여신 을 믿 는 포 사격 을 했 다.', 
    ['盾牌'] = '방패', 
    ['看,前方有结伴而行的商船，他们一定自发组成队伍来防范海盗。'] = '보 면 이 있 고, 앞 에는 초 상선 을 감 안 할 때 자율 팀 대 비하 통과 했 다.', 
    ['看……莫卧儿王朝的商船!正在遭受他们的攻击，一定是被他们发现私下贸易了！'] = '보....모 아 눕다 왕조 의 상선!이 들 의 공격 을 받 고 있다 는 사석 에서 일정 이 이 들 에게 발견 무역!', 
    ['看上去像是一团聚在一起的黑色小颗粒，入口香甜，酸味鲜美。'] = '처 럼 보이 는 상봉 에 함께 있 던 검은색 쪼 갠, 입구 달다, 신맛 신선 하 고 아름답다.', 
    ['看上去像颜色鲜艳的树枝，实际上是一种生活在海底的动物。'] = '마치 화 사 한 나뭇가지 를 실제로 는 하나의 생활 해저 에서 한 동물 이다.', 
    ['看上去只是黑色的粉末，却有着强大的威力。'] = '다만 검 은 가루 가 돼 보이 은덕 을 막강 한 위력 을 발휘 한 다.', 
    ['看上去有些年头，可以尝试拼一下，直觉告诉我这应该是有价值的物品。'] = '주변 에서 볼 수 있 어야 한 다고 리 스페셜 직감 나 에게 이것 은 돼 야 할 가 치가 있 는 물건 들이 었 다.', 
    ['看不出你居然有这等实力！'] = '보 이지 않 는 데 무려 이 너 등 실력!', 
    ['看准机会，找一艘大船动手，这样才能得到海盗们的信任。'] = '레스토랑 기회 를 찾 아 큰 배가 손을 그래야 해적 들 의 신뢰 를 얻 었 다.', 
    ['看到海面上的骷髅旗了吗？这些家伙明目张胆地把这里当成了他们的猎场！'] = '바다 에 해골 깃발 을 보 셨 어요?이런 놈 노골적 으로 알 려 진 이곳 은 그들 의 문제 가 생 겼 을 경우 탕약!', 
    ['看到玛丽被围困，安妮扯掉了头巾，挥舞着指挥刀，嘶吼着命令她的水手向敌人发起进攻，一定要把玛丽救出重围！'] = '보 마리 가 겹겹이 포위하다, 애 니 끌어당기다 떨 어 질 가능성 이 크다. 두건 쇠파이프 를 휘 두 르 고, 指挥刀 울다 기본적 명령 그녀 의 마리 너 에게 적 공격 을 퍼 부 었 꼭 마리 구출 치열 한 경쟁 을 뚫 고!', 
    ['看到苏菲的船了，她受损很严重！对方正对她穷追不舍！'] = '소피 의 선 보 였 고, 피해 심각하다!상대방 이 그녀 에 대해 뭘!', 
    ['看到那个酒桶了吗？先干掉那三艘具有优秀瞭望手的守卫舰，再点燃酒桶给吉布斯发信号。'] = '저 2l 짜리 큰 소주병 했 어요?먼저 죽여버리다 그 3 척 을 갖 췄 요망 손 의 수비 함 을 다시 점화 2l 짜리 큰 소주병 에게 기브스 발신 이다.', 
    ['看吧，我们几乎“顺便”就把悬赏任务完成了！现在让我们去【酒馆】把奖励领了吧，记得常到酒馆看看哦。'] = '네, 거의 \'을 덤 으로 \'을 내 걸 었 다. 임무!이제 우리 가 서 [주점 을 장려 괴뢰 호 전광 들이 수령 했 죠, 기억 을 먹다 주점 을 봐 요.', 
    ['看来你也被我的外表欺骗了呢，其实我是一个内心非常坚强的人。'] = '보아하니 너 도 나 의 외모 속 일 인가 싶 었 는데 사실 저 는 속마음 은 강 인 한 사람 입 니 다.', 
    ['看来你很享受当英雄的感觉。'] = '보아하니 너 가 영웅 고 즐 거 웠 다 는 느낌 을 준 다.', 
    ['看来只有到竞技商店中用竞技场星章兑换合适的水手宝物了。'] = '남 는 건 까지 경기 상점 에서 경기장 별 장 당 마 땅 한 마리 너 보물 했 다.', 
    ['看来奥斯曼的海军和海盗早已是合作关系，统治了地中海。'] = '보아하니 오 스 만 의 해군 과 해적 들 은 것 은 이미 협력 관계 를 통치 해 지중해 이다.', 
    ['看来对手都是些欺软怕硬的家伙，让我们继续前进吧！'] = '보아하니 상대 는 모두 좀 欺软怕硬 한 놈 을 계속 전진 합 시다!', 
    ['看来我们这次的收获相当丰富，不过可真是惊险，每一个都是亡命之徒。'] = '지난해 까지 는 이번 의 수확 풍부하다 지만 정말 스릴 은 하나하나 가 과연 저들 을 했 다.', 
    ['看来我要把这个好消息告诉【I·F·拉齐】。'] = '이 좋 은 소식 을 하지 않 겠 나 라고 알 려 주 앤 I · F · 라 시다 다 사육 하 고 있다.', 
    ['看来敌人为数不少，而且作战经验丰富，不可掉以轻心！'] = '보아하니 적이 적지 않다 고 작전 경험 이 풍 부하 고 방심 은 금물!', 
    ['看来是$(missioncolor:【悬赏令】)发布了，通过悬赏任务，可以获得$(missioncolor:【商会贡献】)，这样就能从商会仓库那里兑换很多好处。这些人恐怕都是为了商会贡献而来。'] = '보 기에 $(missioncolor: 사육 하 고 있다 悬赏令) 발표 에 의 해 만 들 어 졌 을 내 걸 었 다. 임무 를 얻 을 수 있 missioncolor $(: 상공 회의소 공헌 괴뢰 호 전광 들이) 면 에서 상공 회의소 창고 로부터 환전 득도 많다.이 들 은 건 모두 위해 상공 회의소 기여 를 몰 고 왔 다.', 
    ['看来没有其他办法了，这里我也待不下去了……你们可以来【酒馆】找我。'] = '보아하니 달리 방법 이 없다, 여기 나 도 백설기 살 수 없다.그러니까 여러분 를 [주점 사육 하 고 있다. 나 를 찾 아.', 
    ['看来真的有强征民夫的事情发生，他们应该走不远，我们在附近的海域搜寻一下！'] = '보아하니 정말 있 民夫 강제 동원 하는 일 이 생 길 을 걸 어야 되 기 위 한 우리 는 인근 해역 을 수색 해!', 
    ['看来老伙计在等着我了……'] = '보아하니 老伙计 이 기 다리 고 있 어요.', 
