    ['看来魔鬼之手并不是指这里的惊涛骇浪，全员警戒，准备迎战！'] = '보아하니 악마 의 손 이 아니 다면서 이곳 의 험 난 한 파도 를 전원 경계 를 정 도로 상해!', 
    ['看来，繁华安逸的生活早已经腐蚀了那些士兵，我们会轻松取得胜利的！'] = '보아하니, 번화가 안락 한 생활 에서 이미 부식 을 많이 했 는데, 우리 병사 들 을 무 난 히 승리 의!', 
    ['看来，这次有额外的收益哦'] = '보 기에 이번 에 추가 수익 요', 
    ['看杰克使用他的罗盘找到黑珍珠号的方位'] = '보 그 의 나침반 잭 사용 찾 아 흑 진주 호 시가전 에서 는 다', 
    ['看样子敌人阵势未稳，直接冲击敌人侧翼!'] = '모양 이 야 적 전투 배치 하지 않 약 해 진 것 이 직접적 충격 적 측면!', 
    ['看看吧。'] = '가보 자.', 
    ['看看我们造成的轰动吧！不要停下，继续耕耘这条美妙的航线，你知道么？人们已经用黄金商路来形容她了呢！'] = '보 는 우리 에 따 른 진동시키다 시다!지 말고 계속 경작 하다 멈 춰 서 는 이 아름 다운 노선 이 야, 너 알 겠 어요?사람들 은 이제 황금 으로 商路 표현 해 요!', 
    ['看看那里的情况。'] = '한번 가보 자 는 경우 다.', 
    ['看见你们面前的那艘船了吗？这是女王最强大的“吕贝克的耶稣”号，它会毫不留情地粉碎你们！'] = '여러분 앞 에서 보 는 저 배 드 셨 습니까?이 는 여왕 의 가장 강력 한 \' 吕贝克 예수 호 를 거침없이 하 여 분쇄 되 고 말 거 예 요!', 
    ['看起来像蛇，但是生活在干净的水中，身体又长又扁，有的品种像叶子一样薄。'] = '뱀 처 럼 보이 지만, 삶 은 깨 끗 한 물 에 몸 은 길 고 납작하다 입 니 다. 어떤 품목 처 럼 잎 처 럼 얇다.', 
    ['看这辽阔的海面，还有每一艘都满载着贵重货物的船舶！这里真是海盗的天堂啊！'] = '볼 이 광 활 한 해상, 그리고 1 척 당 모두 싣 고 귀중한 화물 을 실 어 나 르 는 선박!과연 이곳 이 해적 들 의 천국 구나!', 
    ['看！海盗已经将俘虏装船，正准备离开据点了！'] = '이거 봐 라.해적 들 은 이미 포로 선적 을 떠 나 려 는 거점!', 
    ['看，到处是被劫商船的货物，那些看起来像酒桶！'] = '보 면 곳곳 에서 벌 어 지고 있 는 피 랍 상선 들 의 화물 을 2l 짜리 큰 소주병 처 럼 보이 는 것!', 
    ['看，前面就是【萨格里什】，我们到了！'] = '볼 때 전방 에는 거장 萨格 리 슈 괴뢰 호 전광 들이 우리 어요!', 
    ['看，我们马上就到马尼拉了。'] = '설명 하 면 곧 까지 마 닐 라 했 다.', 
    ['看，是上次那艘下令攻击我们的海盗船，还有………巴巴罗萨的海军！？'] = '그 를 본 것 이 지난번 척 명령 은 우리 를 공격 하는 해적선 되 고, 또.......아내 로 살 던 해군!요?', 
    ['真了不起！你已经绕过了非洲，离印度不远了。'] = '정말 대 단 하 군 요!너 가 이미 우회 해 아프리카 거, 인도 멀 지 않 았 다.', 
    ['真想喝一杯波尔多的红葡萄酒。'] = '고 싶다 한잔 보 르 도 는 적 포도주.', 
    ['真愁今天的收获少呢，你们就来啦！'] = '정말 시름겹다 오늘 의 수확 적 여러분 은 오!', 
    ['真是……已经分不清是耿直还是其他的什么了。'] = '정말......이미 구별 하지 못 한 이 자신 이 냐, 아니면 다른 어떤 했 다.', 
    ['真是不堪一击。'] = '정말 건 불가능 했 다.', 
    ['真是个明事理的人，看在你们如此用心的份上，我可以透露个消息。汉萨同盟首领阿尔伯特·希勒告知女王，北欧海盗势力最近肆无忌惮地劫掠我们大英帝国的商船。'] = '정말 명 사리 판별 이 어 려 운 사람 을 보 면 당신들 이렇게 신경 쓰 지 않 는 설 익 은 최 상의, 할 수 에 따 르 면 개 소식 이 아 닐 수 없다.한 사 동맹 수령 앨 버 트 시어 러 고지 여왕 을 최근 북유럽 바이킹 족 세력 에 대해 노골적 인 강탈 우리 대 영 제국 의 상선 이다.', 
    ['真是个棘手的小家伙，这样一来救回你的父亲的线索又断了，看来我得去重新找些老朋友打听情况，刚好你趁这个时间去造船厂购买一艘新船。'] = '정말 까다 로 운 꼬마 사람, 그러니까 당신 을 구조 한 아버지 의 단서 를 다시 끊 어 졌 으니 모양 에 가 봐 야 겠 다시 찾 아 조금 옛 친구 알 아 보고, 마침 당신 이 참 에 갈 시간 조선소 1 척 새 배.', 
    ['真是个翻脸不认人的混蛋！'] = '정말 반목하다 는 안 볼 의 나 쁜 놈!', 
    ['真是什么也瞒不了你啊，老戴肯。我看你现在陪这个年轻人玩冒险游戏如此兴致盎然，没有忘记我们七众盟约吧。'] = '정말 아무 것 도 모 르 게 하지 않 아, 당신 老戴 켄 이다.내 가 너 를 보고 지금 당신 과 모험 이 젊은이 들이 놀 이처럼 매 끄 게임 을 잊 지 않 았 다. 우리 일곱 크 라우 맹약 시다.', 
    ['真是好运气，这个什么笔搁就是女神之誓碎片制成的！天啊，居然有人用它来……笔搁是干什么用的？'] = '정말 좋 은 운 이 무슨 펜 내버려두다 바로 여신 의 맹세 조각 으로 만 들 어 진!어머나, 도 있다 "면서 " 쓰....펜 내버려두다 은 뭘 하는 데 에 쓰 는 겁 니까?', 
    ['真是痛快的战斗！据点已经摧毁，俘虏也都解救出来了！让我们返航【巴塞罗那】喝一杯庆祝吧！'] = '정말 통 쾌 한 전투!거점 이미 파괴 해 포로 도 모두 구조 했 다!우리 회 항 타이완 (바 르 셀 로 나 사육 하 고 소주 한잔 축하!', 
