    ['船长，联盟需要我们的力量，赶快出海去攻击敌方吧。'] = '선장 을 연맹 필요 우리 의 힘 으로 빨리 바다 로 나 가 적 합 시다.', 
    ['船长，舰队的补给都已准备完毕，赶快去海上大肆掠夺吧。'] = '선장 을 보급 준비 완료 에 빨리 해상 대대적 약탈 시다.', 
    ['船长，船厂里的装备研究已经开放了，让我们去为装备强化提升吧！'] = '선장, 조선소 에서 이미 연구 의 장비 에 개방 됐 다. 우리 가 는 장비 강화 격상 합 시다!', 
    ['船长，船长，你看那边，那个身影……'] = '선장, 선장, 내 가 보 기에 저기 저 모습....', 
    ['船长，营地的情报屋已经启用了，您可以调派赋闲的航海士去完成各地搜集来的任务，除了能提升我们航海士的经验等级，还有机会赢取宝物哦！'] = '선장, 캠프 의 정보 방 이 기용 할 수 있 겠 는데 차출 등장 한 항해사 찾 곳곳 에서 수집 한 임무 를 제외 하 면 우리 항해사 만 올 릴 수 있다 는 경험, 그리고 회원가입 보물 등급 기회!', 
    ['船长，营地的材料工坊已经启用了，您可以调派赋闲的航海士去完成任务，生产我们装备研究所急需的材料啦！'] = '선장, 캠프 의 재료 工坊 이미 기용 할 수 있 겠 는데 차출 등장 한 항해 를 가 진 우리 임무 생산 장비 연구소 당장 필요 한 자재!', 
    ['船长，营地的贸易站已经启用了，您可以调派赋闲的航海士建设贸易站，为我们的情报屋提供更多更好的任务！'] = '선장, 캠프 의 무역 역 이미 기용 할 수 있 겠 는데 차출 등장 한 항해사 건설 무역 역 을 우리 의 정보 제공 을 더 많이 집 의 임무!', 
    ['船长，营地的铸造厂已经启用了，您可以调派赋闲的航海士到铸造厂完成任务，铸造我们急需的宝物啦！'] = '선장, 베이스 캠프 铸造厂 이미 기용 할 수 있 겠 는데 차출 등장 한 항해사 로 铸造厂 임 무가 완료 되 며 주물 화가 시급하다 는 보물!', 
    ['船长，虽然巴塞罗那已经解围了，但我们不少同胞被海盗俘虏，他们会被当成奴隶的。让我们攻击敌人的据点，拯救他们吧！'] = '선장 은 바 르 셀 로 나 를 이미 했 지만 결국 우리 적지 않 은 동포 해적 포로 그들 은 더욱 취급 을 노예 가 된 다.우리 으로 적 을 공격 하는 거점 을 살 려 내 라 그들 합 시다!', 
    ['船长，装备提升的效果非常显著呢，我们物资还有剩余，不继续升级我们的装备了吗？'] = '선장, 장비 를 높이 는 효과 가 매우 뚜렷하다 데, 우리 물자 남아 있 는데 도 계속 하지 않 을 업그레이드 우리 의 장비 했 어요?', 
    ['船长，要是我们的火炮能再加把劲，我早就轻轻松松地把他们轰得稀巴烂了！'] = '선장, 만약 우리 의 주포 를 다시 힘 을 내 라고 생각 했 다. 그리고 하 게 그들 을 터 득 했 稀巴烂!', 
    ['船长，请下达航向命令吧！'] = '선장, 항로 명령 내 세요!', 
