    ['英国不服从罗马教廷，国王是教会的最高领袖。'] = '영국 불복종 로 마 교황 청, 국왕 은 교회 는 최고 지도자 로 꼽 힌 다.', 
    ['英国人只顾着寻找享受奢侈品，接受指引，前往【汉堡】寻求其他机会吧。'] = '영국 사람 만 이 있 는지 찾 아 명품 기 를 안내 받 을 찾 아가 [햄버거 괴뢰 호 전광 들이 다른 기회 를 모색 시다.', 
    ['英国人和法国人都试图在岛上建立殖民。'] = '영국 인과 프랑스 인 이 섬 에 식민 이다.', 
    ['英国人在沿海岸疯狂地绑架非洲人……'] = '영국인 들 은 해안 정신없이 납치 아프리카 사람들.', 
    ['英国人封锁了英吉利海峡，我们要冲破他们的防线，只要到这里就安全了。'] = '영국인 봉쇄 영국 해협 을 지 켜 야 할 타파하다 그들 의 끈 질 긴 수비 까지 이곳 은 안전 했 다.', 
    ['英国人的海军并不强大，听说他们的女王找了不少的海盗和私掠船才拼凑起这只舰队，让我们好好的教训教训他们吧。'] = '영국 인의 해군 하지 않 는 막강 한 소리 를 자주 듣 는 여왕 을 찾 는 적지 않 은 해적 과 이기심 노략질 하다 배 에야 규합하다 건 만 함대 를 우리 멀 쩡 한 교훈 을 혼 내주 세요.', 
    ['英国军官'] = '영국 장교', 
    ['英国军舰'] = '영국 군함', 
    ['英国国王大都在威斯敏斯特教堂加冕。'] = '영국 왕 들 은 대부분 웨스트민스터 성당 라서 다.', 
    ['英国国王查理二世就生于波尔多。'] = '영국 국왕 찰 스 2 세 는 태생 인 보 르 도 했 다.', 
    ['英国打败西班牙之后，弗朗西斯·德雷克已经成为了北海名副其实的霸主。作为女王的骑士、海军中将、完成全球航行的航海家、挫败无敌舰队的海战天才，德雷克的强大让人热血沸腾。而汹涌的赞美和掌声能让最冷静的人都失去理智，德雷克的行为越来越乖张，并且对手下的约束越来越松懈……'] = '영국 스 페 인 을 꺾 고 이후 프 랜 시 스 코 폴 라 드 레 이크 이미 북해 명실 상부 한 내 려 앉 았 다.여왕 의 기사 로서, 해군 중장 · 완성 글 로 벌 을 항해 하는 航海家, 좌절 무적 함대 는 해전 천재 를 드 레 이크 의 강 들 뜨 게 했 다.반면 에 팽배 한 찬사 와 박수 할 수 있 도록 가장 냉정 한 사람 도 괜찮다 는 에 드 레 이크 의 행태 가 乖张, 게다가 상대 아래 의 단속 은 느 슨....', 
    ['英国政府允许士兵像海盗一样掠夺财宝？'] = '영국 정 부가 허용 병사 들이 해적 처 럼 약탈 재 보 니까?', 
    ['英国海军使用的制式长管炮，使用铁弹作为弹药。'] = '영국 해군 이 사용 하는 제식 긴 파이프 포 를 앞 세 워 쇠 공 사용 으로 탄약 이다.', 
    ['英国王室是奴隶贸易的最大幕后支持者，连海军战船也来莫桑比克支援敌军！'] = '영국 왕실 노예 무역 의 최대 막후 지지자 들 조차 해군 배가 도 모잠비크 지원 적군!', 
    ['英国现在是新教国家，不归属罗马教廷。'] = '영국 지 금은 개신교 국가 에 귀속 로 마 교황 청 하지 않 는 다.', 
    ['英国皇家海军为了保卫海峡，派出了炮船巡逻，不要去惊动这些没油水的家伙，看准时机躲过去就行了。'] = '영국 왕립 해군 를 지 키 기 위해 해협 을 파견 했 으며 포 배 순찰 을 가지 말고 놀 란 것 이 못 유수 한 놈, 레스토랑 등 시기 피 에 가 서 하 면 되 었 다.', 
    ['英国皇家海军为了保护商船出动了，除掉这些碍事的家伙。'] = '영국 왕립 해군 상선 을 보호 하 기 위해 출동 했 고, 나사 는 놈. 이런 방해 되다', 
    ['英国皇家海军的著名风帆战列舰，作为海军上将纳尔逊的旗舰大破法兰西联合舰队而闻名于世。更因其冠绝七海的攻击火力而得到“海上堡垒”的称号。'] = '영국 왕립 해군 의 유명 윈 드 战列舰 로서 해군 제독 넬 슨 의 기함 대 부수다 프랑스 연합 함대 로 세계적 인 명성을 얻 었 다.더 가 관 단절하다 일곱 바다 의 화력 공격 해 해상 보루 \' 라 는 별명 을 얻 었 다.', 
    ['英国舰队几乎每艘船上都装配了这种船首像，战士们相信女王可以带领他们战胜一切。'] = '영국 함대 거의 1 척 당 선상 도 이런 뱃머리 를 장착 해 처 럼, 전사 들 은 믿 고 여왕 이 끌 고 넘 는 그들 을 따 르 는 것 이다.', 
    ['英国著名探险家、海盗德雷克的战舰，他成功通过麦哲伦海峡时，为了纪念所剩下来的最后一艘船而改名。金雌鹿号伴随了德雷克一生的征战。'] = '영국 유명 탐험가, 해적 드 레 이크 전함 을 성공적 으로 통과 때 마 젤 란 해협 을 기념 하 기 위해 에서 남 은 마지막 척 의 배 로 개명 했 다.김 호 암컷 사슴 을 동반 했 다. 드 레 이크 평생 한 시련', 
    ['英式红茶'] = '프 리 미 어 홍차', 
    ['英格'] = '잉 글 랜 드', 
    ['英格丽德'] = '잉', 
    ['英格兰人。做奴隶贸易起家的海盗，在印第安人中被称为“禁闭者”。在伦敦的奴隶拍卖会上与上流社会建立了利益关系，在灰色生意上总有人关照。'] = '잉 글 랜 드 명 이다.일을 노예 무역 에서 시작 한 해적 으로 불 리 는 인디언 명 중 금고형 자다.런던 의 노예 경매 에서 는 상류 사회 건립 했 이해 를 떠 나 회색 장사 에 총 누 군가 배려 했 다.', 
    ['英格兰人。其姑母是葡萄牙国王若奥一世的王后，定居葡萄牙后被王室委以重任，成为促成英葡两国结盟的功臣。与亨利王子是好友。'] = '잉 글 랜 드 명 이다.그 고모 는 포 르 투 갈 국왕 若奥 정말 대단한 왕후 였 다가 정착 포 르 투 갈 왕실 애지중지 을 이루 어 영 葡 양국 의 제휴 공신 이다.해리 왕자 와 친구 처 럼 지 낸 다.', 
    ['英格兰人。典型水手的耿直、冲动和豪迈，会因一言不合大打出手，也会为梦想舍生赴死。虽然自诩为世界公民，但容不得任何人批评自己的祖国。'] = '잉 글 랜 드 명 이다.전형적 인 매 리 너 스 의 자신 과 늠름하다, 충동 에 올 라 가면 한마디 불화 주먹다짐 을 도 낳 을 꿈 꾼 셔 죽 기.비록 자칭 린 세계 시민 지만 틈 누구 든지 비판 조국 이다.', 
    ['英格兰人。出生于普利茅斯，行事果断、机智，通过鼓动水手哗变夺得船长权位，联合其他5艘海盗船，抢劫了载有大量财富的莫卧尔王朝战舰。'] = '잉 글 랜 드 명 이다.普利茅 스 에서 태 어 나 어 단 호 하 고 기지 를 통 해 선동 황천 쿠데타 우승 선장 권좌 에 합동 다른 5 척, 해적선 을 강도 를 담 은 막 대한 부 를 축적 한 모 르 왕조 전함. 누이다', 
    ['英格兰人。印度洋大海盗，最早是武装民运船的船长，他特立独行、胆大妄为，贿赂官员得到民船委任状后四处抢掠，是社会名流和海盗们争相结交的对象。'] = '잉 글 랜 드 명 이다.인도양 을 이 르 면 바다 도루 는 무장 학생운동 권 출신 배의 선장 을 일방통행 식, 목, 뇌물 을 받 民船 관료 위임장 뒤 여기저기 강탈 은 결국 사회 명사 와 해적 들이 앞 다 퉈 사 귄 대상 이다.', 
    ['英格兰人。原本为一名老年船主做管家，雇主去世后代为管理产业，利润稳步提升。一次偶然的机会，他听说雇主的继承人尚在人间，于是开始尽力寻找。'] = '잉 글 랜 드 명 이다.원래 세력 중 한 명 이 노인 선주 일을 집사, 고용주 사망 후손 의 관리 를 위해 산업, 이익 상승 세다.그 는 우 연한 기회 에 한번 듣 고용주 는 후계 구 도가 인간 안 에 여장 을 시작 했 다 " 며 최선 을 다 했 는지 찾 아야 한 다.', 
    ['英格兰人。牧师的儿子，性格多疑但行事专横，是一艘私掠船的船长，在大同盟战争期间，获得当地总督的许可证，在加勒比海地区进行武装私掠活动。'] = '잉 글 랜 드 명 이다.목 사의 아들, 성격 도 혹시 바람 직 하지 않 지만 횡포 이 며, 1 척 불법의 스치다 배의 선장 은 大同盟 전쟁 중 현지 총독 인허가 를 카 리 브 해 지역 으로 무장 불법의 스치다 활동 이다.', 
    ['英格兰人。生于中等家庭，最著名的海图绘制家之一，是个思想敏锐、性格豪放的探险家。年轻时投身于海盗集团，后来成为海盗船船长。'] = '잉 글 랜 드 명 이다.태생 인 중등 가정 을 가장 유명한 해도 그리 개 중 하 나인 예 민 하 고, 개인 사상, 성격 호 쾌 한 인물.젊 은 투신 위하 도루 그룹 으로 일하다 가 해적선 선장.', 
    ['英格兰人。生于贫苦农家，富有冒险精神。从学徒干到水手，最后成为商船船长。据知他是第二位在麦哲伦之后完成环球航海的探险家。'] = '잉 글 랜 드 명 이다.출생 가난 농가 를 즉각 모험 정신 이 었 다.캔 자 스 시 티 에서 도제 까지 일 해 요, 궁극적 으로 상선 선장.그 에 따 르 면 알 은 2 위 에서 마 젤 란 에 유 니 버 설 항해 한 인물.', 
    ['英格兰人。生来就是个亡命徒，喜欢挑战危险的事物，绰号“黑胡子”，被认为是大海上最疯狂、最残忍的海盗，他的骷髅旗几乎成为海盗的图腾。'] = '잉 글 랜 드 명 이다.차 승원 은 개 는 망명자 를 도전적 위험 한 사물 을 별명 검 은 수염 이 같은 관측 이 바다 에서 가장 열광 하 고, 가장 잔 인 한 해적 을 그 의 해골 깃발 을 거의 가 해적 들 의 토템 이다.', 
    ['英格兰人。自称“最坏的海盗”，实际上做事很有分寸，无论任何时候手里总留有交易用的“筹码”，以便在遭受打击后能够迅速恢复。'] = '잉 글 랜 드 명 이다.자칭 \' 최 악의 해적 을 실제로 이 일을 잘 하 有分寸 어떤 때 손 에 총 타월 거래 용 \' 패 \'가 전달 될 수 있 도록 타격 이후 빠 르 게 회복 했 다.', 
    ['英格兰人。著名海盗，为人慷慨仁慈，在占领船舰后便将自己旧船给予俘虏，让俘虏得以逃生。他的海盗团员们也自称“义贼团”。'] = '잉 글 랜 드 명 이다.유명 해적 을 사람됨 격앙하다 인자 함 에 선 점령 함 만 에 자 신의 옛 배 포로 를 주 포로 상록수 역 이다.그 의 해적 단원 들 도 스스로 \'의 흠칫흠칫하다 단 이다.', 
    ['英格兰快速战船'] = '잉 글 랜 드 빠 른 배가 이다', 
    ['英格兰快速炮船'] = '잉 글 랜 드 빠 른 포 배 였 다', 
    ['英格兰装甲战船'] = '잉 글 랜 드 기 갑 배', 
    ['英格兰远程炮船'] = '잉 글 랜 드 장 사정 포 배 였 다', 
    ['英王在法国拥有领土，这导致双方一直冲突不断。'] = '그리스 는 프랑스 보 유한 영토 이 로 인해 양측 은 충돌 을 빚 어 왔 다.', 
    ['英西海战'] = '영 서 해전', 
    ['英雄么……父亲，如今我也成为了一名合格的航海士，如果你能看到的话，你会开心吗……'] = '영웅. 맞습니다.아버지, 저 도 이제 합격 한 항해사, 만약 당신 볼 수 있다 고 말 했 다면 당신 은 즐 겁 습니까.', 
    ['范'] = '범', 
    ['范·德·戴肯'] = '범 · 덕 댈 켄 이다', 
    ['范·德·戴肯与巴巴罗萨居然是旧识，他们在市政厅到底在密谋些什么'] = '범 · 덕 댈 켄 과 아내 로 살 이 라니 낡은 식견 이 들 은 시청 은 도대체 담합 한 게 뭔 가', 
    ['范·德·戴肯与郑芝龙是老相识，从他们的对话中流出了惊人的七众盟约，看来范·德·戴肯上船的目的并不简单'] = '범 · 덕 댈 켄 과 郑芝龙 은 老相识 그들 의 대화 에서 흘 러 나 왔 다. 놀 라 운 일곱 크 라우 맹약 역 을 맡 은 이 범 · 덕 댈 켄 승선하다 의 목적 쉽 지 않 기 때문 이다', 
    ['范·德·戴肯秘密前往酒馆会见神秘人，不知有什么不可告人的秘密'] = '범 · 덕 댈 켄 극비 방문 주점 을 만난 사람 이 얼마나 신비 를 모 르 는 특별한 비밀', 
    ['范•德•戴肯'] = '범 주 드 다이옥신 켄 이다', 
