    ['范围内己方舰船每6秒恢复一定量的怒气。'] = '범위 내 에서 일방적 인 함선 마다 6 초 회복 일정량 의 노기 이다.', 
    ['范围内己方舰船每6秒恢复一定量的耐久。'] = '범위 내 에서 일방적 인 함선 마다 6 초 회복 일정량 의 내구 이다.', 
    ['范围内所有我方每秒恢复怒气。'] = '범위 내 에서 모든 우리 초속 회복 노기 이다.', 
    ['范围内所有我方每秒恢复耐久。'] = '범위 내 에서 모든 우리 초속 회복 내구 이다.', 
    ['范围内所有我方近战攻击提升。'] = '모든 공격 범위 내 에서 우리 측 近战 높 아 졌 다.', 
    ['范围内所有我方远程攻击提升。'] = '범위 내 에서 모든 우리 원거리 공격 높 아 졌 다.', 
