    ['菲律宾保和岛中部，卡门附近一处自然奇景。由1268个圆锥形小山丘组成的巧克力山，高度介于 40到120公尺之间。每到夏季，“干草堆”都会干枯，转为褐色，犹如一排排的巧克力排放在大地上，巧克力山这个名字由此而来。'] = '필 리 핀 보 와 섬 중부, 카 르 멘 근처 한 곳 의 자연 진 풍 경이 벌 어 졌 다.이 圆锥形 언덕 1268 개 로 구성 된 초콜릿 을 높이 산 향가 40 ~ 120 미터 간 다.해마다 여름철 이면 \' 건초 더미 를 모두 수자원 고갈 로 전환 한 갈색 처 럼 변 해 요즘 의 초콜릿 배출 이 땅 에서, 초콜릿 산 이 라 는 이름 이 나 온 다.', 
