    ['萨姆·贝拉米'] = '샘 贝拉米', 
    ['萨姆·贝拉米,别再想着逃了，你走不掉了！'] = '샘 贝拉米 생각 을 좀 그만 탈 을 비 웠 는데 너 가 서 안 떨 어 질 가능성 이 크다.!', 
    ['萨姆·贝拉米,来战吧！'] = '샘 贝拉米 을 전 합 시다!', 
    ['萨姆·贝拉米9岁时随家人移居普利萨姆•贝拉米9岁时随家人移居普利茅斯。'] = '샘 贝拉米 9 세 때 가족 과 함께 이주 샘 프 레 贝拉米 9 세 때 가족 과 함께 이주 普利茅 스.', 
    ['萨姆·贝拉米仅仅活了28岁，“黑山姆”一名的由来是因为贝拉米有着一头黑色的长发扎束成马尾。贝拉米的行事作风有别于其他的海盗，对俘虏十分宽大与慷慨，甚至在占领船舰后便将自己的旧船给予俘虏，让俘虏得以逃生。而他的演说更是为人乐道。相传，听他的演讲，最懦弱的人都能在他的鼓励下变成最无畏的水手，最矜持的妇人也会像月季花一样绽放，就连信天翁都会在他的桅杆上驻足聆听······'] = '샘 贝拉米 만 살 아 왔 다 " 며 " 28 흑 샘 다 카 사 키 의 유래 했 기 때문 贝拉米 과 검은색 의 머리 속 으로 马尾 장발 자.贝拉米 행사 풍격 여타 와 는 다른 해적 에 대한 포로 와 매우 관대하다 격앙하다, 심지어 점령 배 함 만 에 자 신의 옛 배 포로 를 주 포로 상록수 역 이다.그 의 연설 은 사람됨 유명한 일화 다.예 부터 그 의 연설 을 듣 고 가장 나 약 한 사람 이 그 의 격려 도로 가장 무의미 한 마리 너 를 가장 자중하다 의 부인 것 이지 요 月季花 처 럼 꽃 은 물론 앨 버 트 들 도 모두 그 의 돛대 에 주장 미 를 했 다', 
    ['萨姆·贝拉米传记任务1——前往萨姆·贝拉米的出生地普利茅斯。'] = '샘 贝拉米 전기 임무 1 - 샘 贝拉米 출생지 普利茅 스.', 
    ['萨姆·贝拉米传记任务2——购买100英式红茶。'] = '샘 贝拉米 전기 임무 2 - 프라이 카 우 프 홍차 100.', 
    ['萨姆·贝拉米传记任务3——赢得一场竞技场的胜利。'] = '샘 贝拉米 전기 임무 는 첫 경기에서 3 인 경기장 승리 를 이 끌 었 다.', 
    ['萨姆·贝拉米传记任务4——将船舶进阶一次！'] = '샘 贝拉米 전기 4 인 임무 는 선박 진 섬돌 한번!', 
    ['萨姆·贝拉米传记任务5——在酒馆中使用朗姆酒招募5次。'] = '샘 贝拉米 전기 임무 5 인 동네 술집 에서 사용 朗姆酒 모집 5 번 째다.', 
    ['萨姆·贝拉米传记任务6——萨姆·贝拉米成为海盗团团长，开始四处劫掠！'] = '샘 贝拉米 전기 임무 6 인 샘 이 贝拉米 해적 단장 을 나 섰 고, 강탈!', 
    ['萨姆·贝拉米传记任务7——完成象牙海岸战役，体会海上作战的刺激！'] = '샘 贝拉米 전기 7 인 임무 를 완수 상아 해안 전역 을 체득 한 해상 작전 을 자극 하는!', 
    ['萨姆·贝拉米传记任务8——1717年，萨姆·贝拉米遭遇维达号并成功掠夺这艘英籍大型贩奴船！'] = '샘 贝拉米 전기 임무 8 인 1717 년 샘 贝拉米 겪 고 앤 번 성공 약탈 이 척 영국계 대형 행상인 노예 배!', 
    ['萨尔法八世'] = '사 르 법 8 세', 
