    ['萨蒙德'] = '萨蒙 덕', 
    ['萱草·崔'] = '萱草 · 최', 
    ['落单的走私船'] = '외톨이 는 밀 수선 했 다', 
    ['著名古刹，始建于三国年间。'] = '유명 고찰 을 금강산 4 년 간 3 국 이다.', 
    ['著名的日本战船，船艏到船艉都有楯板做的装甲防护，上面遍布用来射箭、放枪的孔洞。接近敌船后把楯板向外侧放倒，变成通向敌船的桥梁，非常利于接舷战斗。'] = '유명한 일본 배 를 배 艏 까지 배 艉 모두 楯 판 한 장갑 방 호 를 위 이라든지 매운탕 양궁, 放枪 의 구멍 이 다.접근 적선 을 판 뒤 楯 바깥쪽 에 넣 대제, 변 으로 선박 의 교량 을 매우 유리 하 게 적용 받 뱃전 전투 다.', 
    ['葛德文.罗德尼'] = '葛德文. 페 르 난 도 로 드니 이다', 
