    ['葡萄'] = '포도', 
    ['葡萄干'] = '葡萄干', 
    ['葡萄干！哦，不，我们要的是真正的上好葡萄酒，对于无法满足我们的伙伴，我们是绝对无法愉快的合作下去的啊。'] = '葡萄干!어머, 아니오, 우리 야 진짜 연근해 와인 을 충족 시 키 지 못 한 우리 의 파트너 로 우리 는 절대 즐 겁 지 않 은 의 협력 을 살 아가 는 데요.', 
    ['葡萄牙'] = '포 르 투 갈', 
    ['葡萄牙“印度总督达尔布克基”要求马上'] = '포 르 투 갈 \' 인도 총독 다 르 보 크 스키 를 요구 했 다. 당장', 
    ['葡萄牙一直想占领整个东非洲。'] = '포 르 투 갈 려고 애 썼 점령 전체 동 아프리카 다.', 
    ['葡萄牙人'] = '포 르 투 갈 사람', 
    ['葡萄牙人、英国人和法国长得都一个样。'] = '포 르 투 갈 명, 영국 인과 프랑스 잘 도 비현실적 이다.', 
    ['葡萄牙人。中产阶级，父亲和兄长忙于从政，把家里的生意来交给他照料，而他在犯了大量低级错误后终于渐入佳境，取得了令父亲和兄长都吃惊的进展。'] = '포 르 투 갈 사람 입 니 다.중산층 을 아버지 와 형 정치 를 서두 르 게 집안 장사 를 통 해 전달 간호 해 주 고 그 는 실수 를 했 다. 대량 저급 잘못 자 마침내 이 점입가경 으로 치 닫 을 거 뒀 을 아버지 와 형 도 놀 라 운 진전 을 이 뤘 다.', 
    ['葡萄牙人。亨利王子忠心的侍从，也是约翰.恩里克航海方面的启蒙老师。虽然年纪不大，但操心的事情太多，所以总是一副苦大仇深的表情。'] = '포 르 투 갈 사람 입 니 다.해리 왕자 는 시종 충성 이자 존 엔 리 케 항해 측 의 계몽 선생님 입 니 다.나이 가 크 진 않 았 지만 걱정 하는 일 이 많다 보 니 자꾸 부 苦大仇深 한 표정 을 짓 고 있다.', 
    ['葡萄牙人。凭借敏锐的危机意识和过人的胆量在加勒比海创出名声的狡猾海盗，是来往船只的噩梦。过去是个谜，名字也是假的，在海盗圈子里是个神秘偶像。'] = '포 르 투 갈 사람 입 니 다.바탕 으로 한 위기 의식 과 두둑 한 배짱 은 카 리 브 해 창출 명성 이 있 는 교 활 해적 들 을 오 가 는 선박 의 악몽 이다.과거 베일 속 에 이름 도 거짓 을 해적 고리 에서 는 신비 우상 으로 남아 있다.', 
    ['葡萄牙人。原本是海军军官，因为酗酒被降职后索性做起了自由自在的海盗。势力不大但交友极广，无论军方还是海盗都不愿与他为敌。'] = '포 르 투 갈 사람 입 니 다.원래 해군 장교, 음주 좌천 됐 기 때문 뒤 아예 꾸 려나 가 자유 롭 게 하는 해적 이다.세력 좁 지만 친교 가 워낙 광 범 위하 든 군 이나 해적 엄두 를 내지 못 하 고 그 와 을 적국 으로 간주 했 다.', 
    ['葡萄牙人。是个壮实的木匠，为了帮青梅竹马出头而误伤人命，开始逃亡生涯。一直认为误伤人命是自己的污点，但很多人因此敬畏他。'] = '포 르 투 갈 사람 입 니 다.이 튼튼하다 는 목수 를 위해 방 죽마고우 초반 으로 误伤 인명 을 도피 생활 을 시작 했 다.심 각하 게 여 误伤 인명 은 자 신의 오점 을 원 했 고 많은 사람 이 두려워 하는 모습 을 보 였 다.', 
    ['葡萄牙人。曾经也是富家子弟，因赌博欠下巨额债务，浪子回头后得到资助，开始有了点起色，但麻烦接踵而至，目前要一面照看生意一面躲避债主。'] = '포 르 투 갈 사람 입 니 다.한때 도 부잣집 출신 을 도박 으로 거액 의 채무 를 탕 을 시작 한 뒤 지원 을 받 는 좀 활기 를 찾 았 지만 불편 겹 치 면서 지금 한쪽 측면 돌 장사 대피 채권자 이다.', 
    ['葡萄牙人。有商业头脑的传教士，利用传教的机会兜售一些小商品，在各殖民地都有朋友，商船也乐于让他搭乘。在一次远东旅行中想到了一个新点子，只等大鱼上钩。'] = '포 르 투 갈 사람 입 니 다.상업 두뇌 의 선교사 를 이용 한 기회 다 팔 선교 일부 일용품 각 식민지 이 친구, 상선 마저 즐 겨 그 더러 탑승 했 다.한번 이 극동 여행 중 이 떠 올 랐 새 아이디어 만 등 대어 를 낚 기 30 분.', 
    ['葡萄牙人。有经济头脑的情报贩子，靠贩卖亦真亦假的情报赚了第一笔，同时也惹了不少麻烦，一直在寻找一位强有力的靠山帮他摆平一切。'] = '포 르 투 갈 사람 입 니 다.우리 는 경제적 두뇌 의 정보 치기 혼자 인신 매매 도 정말 도 가짜 정보 벌 첫 보상금 을 동시에 도 사고 를 쳤 폐 를 끼 친 해 줄 것 을 당부 한 강력 한 후견인 역할 을 부탁 사무 마 청탁 을 따 르 는 것 이다.', 
    ['葡萄牙人。没落贵族，为了中兴家族而成为一名殖民者，虽然外表与普通水手无异，但仍努力维持着自己的贵族标签，对荣誉一类的东西非常重视。'] = '포 르 투 갈 사람 입 니 다.몰락 을 중흥 기 위해 귀족 가문 으로 거 명 되 고 무단 으로 겉모습 과 일반 마리 너 나 다름 없 었 지만 여전히 노력 을 지 켜 나 가 고 귀족 꼬리표 를 영예 같은 물건 을 중시 했 다.', 
    ['葡萄牙人。父亲是殖民地总督，而他是殖民地行侠仗义的游侠，可以说专跟父亲作对。官方忍无可忍之下发出通缉令，卡瓦略不得不逃离殖民地。'] = '포 르 투 갈 사람 입 니 다.아버지 는 식민지 총독 인 데, 그 는 식민지 行侠仗义 의 대응 전력 을 전담 아버지 와 대립하다 이다.관영 참다 못 한 연해 수배 를 내 려 놓 고 탈출 할 수 밖 에 없 었 卡瓦略 식민지 였 다.', 
    ['葡萄牙人。父亲是雷阿尔城的商人，少年时代就开始在父亲的货船上掌舵，穿行葡西两国。当他厌倦了塔霍河狭窄的水道后直接把目光投向了大西洋。'] = '포 르 투 갈 사람 입 니 다.아버지 는 레 알 타운 의 상인, 소년 시절 부터 아버지 의 화물선 에서 모양새 를 누비 며 葡 서 양국 을 오 간 다.그 가 싫증 이 나 타 霍河 좁 은 물길 후 직접 눈 길이 대 서양 이다.', 
    ['葡萄牙人。航海家亨利王子的堂弟，准男爵，因为娇生惯养而被派到船上历练。实际上比堂兄想象的更努力，很快具备了领导能力。'] = '포 르 투 갈 사람 입 니 다.航海家 해리 왕자 는 사촌 동생 으로 준 경 이기 때문 娇生惯养 으로 파견 돼 선상 과 관련 해 자 신의 이다.실제로 보다 사촌 가 생각 했 던 것 보다 노력 을 빨리 갖 춰 리더십 이다.', 
    ['葡萄牙人。退伍陆军军官之子，在为了对抗海盗而成立的民兵队担任民兵队长，得知主角准备讨伐摩尔人后毅然加入。'] = '포 르 투 갈 사람 입 니 다.제대 육군 장교 아들 을 위해 설립 에 대항 하 기 위 한 해적 들 의 민병 대가 민병 대장 을 맡 을 전해 들 은 주역 준비 토벌하다 무어 사람 간 뒤 이 가입 했 다.', 
    ['葡萄牙人一直想要将马六甲据为己有。'] = '포 르 투 갈 려 해 온 이 가로 챈 혐의 다.', 
