    ['虽然我们还缺不少人手，但形势紧急，让我们补充补给，即刻向【巴塞罗那】出发！'] = '비록 우리 일손 부족 한데 적지 않 지만, 긴급 상황 을 보충 보급, 타이완 (바 르 셀 로 나 에 곧바로 괴뢰 호 전광 들이 출발 합 시다!', 
