    ['西亚和东非一带往来频繁的港口，长期受到伊斯兰教徒统治，郑和下西洋时曾在此落脚。'] = '시 아) 와 동 아프리카 일대 거래 가 빈 번 한 항구 에 시달 린 이슬람 교도 통치 를 그 정 화의 항해 때 이곳 에 정착 했 다.', 
    ['西伯利亚'] = '시 베 리 아', 
    ['西伯利亚是俄罗斯联邦境内北亚地区的一片广阔地带。'] = '시 베 리 아 는 러시아 연방 내 성과 를 거 둔 만큼 동북아시아 지역 의 광 대한 분야 지대 에 있다.', 
    ['西伯利亚是俄罗斯联邦境内北亚地区的一片广阔地带，西起乌拉尔山脉，东迄太平洋，北临北冰洋，“西伯利亚”这个名称可能来自古突厥语，意思就是“宁静的土地”；早在石器时代以前，西伯利亚已经有人居住。末次冰期时代气候寒冷，所以当时的水位比较低。现时的白令海峡，当年有一条陆桥连接西伯利亚和阿拉斯加。现时美洲原住民的大多数人口都是透过这条陆桥从西伯利亚去到美洲的。'] = '시 베 리 아 는 러시아 연방 내 성과 를 거 둔 만큼 동북아시아 지역 의 광 대한 분야 지대, 서 부터 우랄 산맥, 동 줄곧 태평양 을 북 으로 북극 해, \'시 베 리 아 에서 나 온 것 이 라 는 명칭 이 옛 튀 르 크 어로 \'는 뜻 이다. 조 용 한 땅 이라고 도 부 른 다.일찍 석기시대 이전 시 베 리 아 이미 사람 이 살 고 있다.차 冰期 시대 말 날씨 때문에 당시 수위 가 낮 기 때문 이다.现时 의 베링해 협 은 그해 외지 육교 연결 시 베 리 아 와 알래스카.现时 미주 원주민 들 의 대다수 인구 는 모두 통 이 조 육교 시 베 리 아 에 갈 미주 한 다.', 
    ['西北'] = '서북', 
