    ['西印度公司总督彼得松·霍因前来拜访，他带了联盟对抗东印度公司的善意，国王为了复位欣然同意。不知这背后是否有什么深意呢'] = '서 인도 회사 총독 피 터 송 호 로 데 려 갔 고, 그 는 자신 을 찾 아 연맹 대항 동 인도 회사 소속 의 선의 에 들 어간 국왕 을 위해 선뜻 응 했 다.이 깔 려 있 지 않 은지 모 르 무슨 뜻 깊다 인가', 
    ['西印度群岛中最大的城市，扼守着墨西哥湾通往大西洋的大门，盛产雪茄烟。'] = '서 인도 제도 에서 제일 큰 도시 매 요충 을 지키다 고 멕시코 만 으로 통 하는 문 대 서양 을 많이 생산하다 雪茄烟 이다.', 
    ['西印度群岛没有贝拉米的消息，可是根据描述，却好像那个最近很出名的年轻海盗团长，加入他的团队才能接触到他。'] = '서 인도 제도 없 는 贝拉米 소식 을 따 라 묘사 하지만 최근 에는 그 가 유명 의 젊 은 해적 단장 으로 가입 그 의 팀 야 접 한 그 다.', 
    ['西印度群岛海域出现了一伙猖獗的海盗，听说他们的首领是一个很令人愤慨的家伙。'] = '서 인도 제도 해역 나 일당 이 창궐 하는 해적 소리 를 자주 듣 는 수령 은 아주 떠 서 놈 이다.', 
    ['西奥菲拉'] = '서 오 르 페 우 라', 
    ['西德尼'] = '서 독 니', 
    ['西斯'] = '시 스', 
    ['西晋建兴元年(313年），吴淞江上浮起两尊佛像，背上有佛名，吴县信士把佛像迎到了重元寺，唐代改寺院名为永泰禅院，宋代始改为静安寺。'] = '서진 建兴 원년 (313 년) 을 떠 吴淞江 에서 2 무 속인 오명 을 쓰 고 있 吴县 불 명 으로 信士 불상 을 안내 했 중 원사 를 바 꿔 라 당대 사원 永泰 선원 에서 송 대 시 바 꿔 静安 사.', 
    ['西湖有十景，柳浪闻莺、南屏晚钟、三潭印月……'] = '이 호수 는 십 경이 을 柳浪闻莺, 南屏 晚钟, 三潭印月....', 
    ['西湖有十景，花港观鱼、雷峰夕照、双峰插云……'] = '이 호수 는 십 경이 花港 관, 생선, 雷峰 석조, 연쇄 자리바꿈 꽂 구름....', 
    ['西湖有十景，苏堤春晓、曲院风荷、平湖秋月、断桥残雪……'] = '이 호수 는 십 경이 을 苏堤 춘 샤 오, 곡 정원 风荷, 평 호수 秋月, 断桥 残雪....', 
    ['西班牙'] = '스 페 인', 
    ['西班牙“无敌舰队”的主力炮舰，装配有多层的炮楼。依靠这种“海上要塞”般的战舰，西班牙一度成为了世界的海洋霸主。'] = '스 페 인 무적 함대 주력 군함 을 장착 한 다. 여러모로 포루이런 \' 해상 요새 같은 전함, 스 페 인 은 한때 세계 의 해양 에 올 랐 다.', 
    ['西班牙、意大利的航海家都会来这里学习。'] = '스 페 인 이탈리아 의 航海家 마다 이곳 을 공부 했 다.', 
    ['西班牙与南美人原住民混血儿。会西班牙语，与各地水手混得熟络，为人淳朴善良，没有财富积累的观念，手头有一点闲钱就会在赌桌上输得精光。'] = '스 페 인과 남미 원주민 혼혈 이다.이 스페인어 와 각지 에서 매 리 너 스 혼 게 친 출품작 을 순 하 고 착 하지 못 했 고, 부의 축적 관념 해도 돈 이 없 을 것 이 라 는 점 闲钱 면 도박 테이블 에서 잃 훌렁 벗 어 젖 힌 다.', 
    ['西班牙人。为了娶到自己的梦中情人不断做着发财梦，因听说某小岛有海盗的宝藏而出海，几年时间里虽然没有找到宝藏，但积累了丰富的航海知识。'] = '스 페 인 사람 이다.결혼 하 기 위해 자 신의 이상형 리 기도 하 고, 이 发财梦 어느 섬 이 해적 들 의 보 고다 바다 로 나 갔 다가 몇 년 동안 은 찾 지 못 했 지만 망 을 쌓 은 항해 지식 이다.', 
    ['西班牙人。乡绅世家，小时候被骑士小说冲昏头脑，在城市里攀援跳跃，把钟楼当龙穴。成年后依然故我，家人希望通过婚姻锁住他，而他索性逃到了海上。'] = '스 페 인 사람 이다.어 렸 을 땐 성향 명문가 를 기사 소설 쾌감 은 도시 에서 攀援 점프 를 궁 이 용 혈 이다.성인 이 된 뒤 여전히 故我 가족 희망 혼인 을 통 해 되 돌 아 온 그 는, 아예 해상 탈출 했 다.', 
    ['西班牙人。以一头火红的长发著称，在海盗中被称为“女爵”，为了找出逃婚的丈夫而专挑海军船只下手，其疯狂程度只有“黑胡子”可堪匹敌。'] = '스 페 인 사람 이다.머리 로 는 신 강 시뻘겋다 장발 은 해적 \' 여성 작위 \'을 찾 아 내기 위해 종합 선물 세트 식 남편 을 만 골 라서 해군 선박 손 댈 그 정도 밖 에 열광 하 고 흑 수염 \'가 되 면 간척지 에 필적 할 만 했 다.', 
    ['西班牙人。传奇大海盗“黑胡子”的女儿，喜欢男装打扮，从小苦练剑术并组织自己的马贼团，希望向抛弃自己的父亲复仇。'] = '스 페 인 사람 이다.전설적 인 바다 도루 흑 수염 \'의 딸 을 좋아 하 고 남성복 차림 을 하 고 자 신의 어 려 서부터 구슬땀 을 흘 린 검술 조직 의 马贼 단 께 자신 을 버 린 아버지 에게 복수 이다.', 
    ['西班牙人。博学的收藏家，尤其喜欢收藏各种地图，当发现各种航海地图描述差异极大时觉得马可.波罗等人都是大话精，准备出海亲眼见证真相。'] = '스 페 인 사람 이다.박학하다 컬렉터 를 특히 좋아 하 지도, 각종 소장 이 발견 각종 항해 지도 묘사 격차 를 접 했 을 때 마 르 쿠 스. 폴로 등 도 모두 흰소리 지점, 준비 바다 로 나 눈 진상 했 다.', 
    ['西班牙人。性格坚毅的小胡子，为躲避当地领主的迫害溜上了远洋商船。5年时间，从一名与老鼠为伍的底层水手成长为商船的大副。'] = '스 페 인 사람 이다.콧수염 을 기 坚毅 의 성격 을 피하 느라 현지 지연 의 박해 물받이 에 원양 상선 이다.5 년 이 걸 렸 1 명 과 쥐 을 일 삼 는 밑바닥 캔 자 스 시 티 로 성장 하는 등 항해사 상선 이다.', 
    ['西班牙人。沉默而老道的水手，从来只谈生意不谈交情。在吵吵嚷嚷的水手圈子里被称为“冷面人”，但也有相当多的船长喜欢他的务实处事风格。'] = '스 페 인 사람 이다.침묵 으로 노 회한 정치력 의 매 리 너 스, 만 나 사업 실익 이 없다 " 며 " 인맥 을 쌓 았 다.이 는데 그 의 고리 에서 매 리 너 스 로 불 리 는 냉면 명 이라고 도 하 고, 상당수 선장 그 를 좋아 하는 실무적 스타일 이다.', 
    ['西班牙人。脾气暴躁，嗓门儿大，在与海盗的交锋中被刺伤眼睛，伤疤让他显得更狰狞。但其实心地善良，喜欢小孩且擅长做各种玩具。'] = '스 페 인 사람 이다.이 를 嗓门儿 대, 해적 과 의 상대 전적 에서 눈 을 찌 흉터 가 그 에게 더 희롱 했 다.마음씨 좋 지만 실제로 아이 들 을 좋아 하 고 각종 장난감 잘 만 들 것 이다.', 
    ['西班牙人。英俊而激情洋溢的青年，有很大的志向，但半生都被霉运之神笼罩。虽然已经很少有船长敢招募他，但他仍然没有放弃自己的理想。'] = '스 페 인 사람 이다.잘 생기다 고 열정적 인 청년 이 크다 지만 반생 지향점 이 징크스 의 신 에 휩 싸 이 고 있다.이미 선장 이 적다 는 감히 공모 해 줬 는데 그 는 포기 하지 않 자 신의 포부 다.', 
    ['西班牙人。贵族出身，因被仇家陷害丢掉了爵位和婚约，登上一艘商船开始流浪，一直试图找出陷害者。作为一个有故事的男人，明显与其他水手格格不入。'] = '스 페 인 사람 이다.귀족 출신 에 이 르 고 원수 음해 일자리 를 잃 었 다 는 시구 와 이혼 을 당 에 상선 1 척 을 방랑 하 기 시작 하 려 노력 해 왔 을 찾 아내 음해 자다.자살 로 생 을 마감 한 스토리 가 있 는 남자, 눈 에 띄 게 다른 캔 자 스 시 티 는 단 어다.', 
    ['西班牙人为了殖民曾经大肆屠杀印第安人。'] = '스 페 인 사람 을 위해 식민지 였 던 대대적 학살 인디언 이다.', 
    ['西班牙人灾星'] = '스 페 인 사람 灾星', 
    ['西班牙人皮萨罗毁掉了我们的国家。'] = '스 페 인 사람 皮萨罗 어구 우리 의 국가 이다.', 
    ['西班牙人禁止我们崇拜太阳神。'] = '스 페 인의 금지 우리 숭배 태양신 이다.', 
    ['西班牙人，是军方背景的贵族后代，从小被当做家族继承人培养。富有冒险精神思想单纯，但是认定的事情会一路走到黑。'] = '스 페 인 사람 은 군 배경 을 가 진 귀족 후손 으로 어 릴 때 부터 중심축 으로 가족 후계자 양성 이다.부 유한 모험 정신 사상 단순 지만 인정 되 는 일 은 만 밟 은 흑 이다.', 
    ['西班牙哈布斯堡家族曾经统治这里。'] = '스 페 인 합 스 부 르 크 가족 한때 통치 여기 있 어요.', 
