    ['这么长时间以来，我见过的夷人，全部都是那些野蛮无理、长相奇异的强盗，所以就把你们也误认为来烧杀抢掠的海盗了。'] = '이렇게 긴 시간 을 내 가 만난 평탄하다 명 으로 모두 그 야만적 무리 한, 생김새 기 묘 한 강도 를 너희들 도 오인 으로 烧杀 강탈 한 해적 했 다.', 
    ['这也叫海盗！简直就是不堪一击。'] = '이 불 러 도 해적!건 말 도 안 되 는 건 불가능 했 다.', 
    ['这也怨不得你。这下我是彻底没什么可去的地方了，只好留在这艘船上，你不会反对吧，亲爱的船长？'] = '이것 도 怨不得 당신 이다.저 는 이 철 저하 게 갈 곳 이 없 었 고 배 너 에 남아 있 을 반대 하지 는 않 죠, 자기 선장?', 
    ['这些兵匪难分的家伙原来全部都是巴巴罗萨.海雷丁的手下，消灭这些豺狼，不过要小心阿芒德的旗舰，奥斯曼海盗王可不是好惹的。'] = '이런 병 경박하다 재일 동포 는 놈 원래 모두 바 제 니 퍼 로 살 레 딩 이다. 바다 밑 에 들 豺狼 소탕 에 나 섰 지만 조심 아 참억새 덕 의 기함 을 오 스 만 해적 왕 의 好惹 그저 그 렇 고.', 
