    ['这些古旧的碎片居然拼出了一张完整的藏宝图，出海探寻宝藏，看看有什么额外的收获吧'] = '이 들 의 파편 진부하다 의외로 가 나 왔 을 藏宝图 출항 한 장 완전한 모색 지하 자원, 예 를 들 면 무슨 플러스 알파 \' 죠', 
    ['这些只是零散海盗而已，实力不值一晒！根本连海盗团都称不上。'] = '여기까지 는 영세 해적 뿐, 실력 불이익 한 말리다!는 아예 해적 단 시점 도 되 지 않 았 다.', 
    ['这些奇怪的东西一起熬在一起真的能吃吗……'] = '이 들 끓 는 이상 한 것 과 함께 정말 먹 을 수 있 나........', 
    ['这些家伙速度可真快，好像已经攻进了海上丝绸之路起点——泉州……那边是…达尔布克基！'] = '이런 놈 속 도가 시속 진짜로 빨리, 골 을 터 뜨 려 해상 실크로드 시 작인 췐 저우....저기 는.다 르 부 케 기!', 
    ['这些巨型战舰里装载的是满满的鸦片，这些地狱之花给这里带来了永夜般的黑暗。死灰复燃的东印度公司仍然在制造无边的罪孽，碾碎他们！'] = '이런 거 함 에 탑재 된 이 들 은 이 넘 쳐 나 는 아편 을 지옥 의 꽃 에게 이곳 에 영 박 같은 어둠 이 었 다.되 살 아 난 듯 한 동 인도 회사 는 여전히 제조 허허벌판 죄업 을 碾碎 그들!', 
    ['这些年来，东南亚多了许多欧洲人。'] = '그 동안 동 남아 여 많은 유럽인 들.', 
    ['这些无耻的强盗，控制了国王，还掠夺了无数的黄金，一个也不能放过！'] = '이 들 의 파렴치한 강도 를 통제 해 왕 에도 엄청 난 금 을 하나 도 놓 칠 수 없!', 
    ['这些烦人的官兵就像苍蝇一样赶也赶不走，徐海决定自己带队击退追捕的官兵。'] = '이 집 요 한 장병 들 처 럼 파리 처 럼 쫓 겨 도 를 쫓 아 다니 지 않 았 을 徐海 기로 결정 하 고 인솔 격퇴 추적하다 병사 들.', 
    ['这些犬牙交错的岛礁不仅可以掩护伏击，也可以分散船阵！'] = '이런 국면 이 뒤 엉 키 어 복잡하다 는 岛礁 뿐 만 아 니라 엄호 매복 기습 을 할 수도 있 고 분산 배 한차례!', 
    ['这些破旧的碎片居然是一张藏宝图，让我们看看藏宝地点在哪！'] = '이런 허 름 한 파편 이 라니 한 장 藏宝图 를 살 펴 본 藏宝 지점 은 어디 인지!', 
    ['这些防御炮台非常坚固，尽量将他们诱出炮台火力覆盖范围，再逐个消灭。'] = '이런 방어 포대 확고하다 는 점 을 가급적 그들 쬐다 보 포대 화력 커버 를 다시 일일이 박멸 한 다.', 
    ['这伙海盗的做法是每次交易都选择在半夜进行，为的是方便实施抢夺。但同意半夜偷偷交易的难道不也是非法商品贩子吗？不用跟他们“客气”。'] = '이 해적 들 의 것 은 매번 거래 가 선택 은 한밤중 에 실시 를 공식화 한 편의 탈취 했 다.그러나 동의 밤중 에 몰래 거래 가 없 을 까 도 불법 상품 치기?없이 그들 과 \' 겸손하다 \' 다.', 
    ['这伙海盗！打着贸易公司的旗号无恶不作。现在，他们的指挥官彼得松.霍因又指挥着他的海盗船队扑向了新大陆。'] = '이 해적!커 다 란 무역 회사 는 명 분을 내세 우 고 있 无恶不作 이다.이 들 의 지휘관 피 터 송 했 는 지 휘하 고 있 는 그 의 해적 선단 타구 를 향 해 신대륙 발견 했 다.', 
    ['这伙海盗，在攻击了普林西蒲城后，不但没有仓皇逃走，竟敢企图进攻贝略港。做好准备，给年轻的对手一个难忘的教训。'] = '이 는 해적 을 공격 했 普林西 蒲城 후 이 없 을 뿐 아 니라 창황하다 도주 를 감히 시도 공격 베 류 항 에 입항 했 다.준비 에 만전 을 기 해 나이 어린 상대 기억 에 남 는 교훈 을 얻 었 다.', 
    ['这位先生，难道您还不知道吗？那些打着商人旗号的家伙其实贩卖的商品正是……我的同胞呀！已经有许多兄弟姐妹被那个可恶的家伙给贩卖去了天涯海角，再也见不到了！！'] = '이 선생 을 그때 알 지 못 하 고 있 습니까?그런 극대 상인 를 기치 로 내세 운 놈 사실 인신 매매 의 상품 이 바로....나 의 동포!이미 많은 형제 자매 그 못 된 놈 에게 인신 매매 갔 땅 끝 을 볼 수 없 어요!!', 
    ['这位大叔，不要激动，现在让我们一起来了解您的故事。'] = '아저씨, 이 흥분 하지 않 고, 지금 우리 같이 하 고 재 밌 어 선생님 의 이야기 다.', 
    ['这位新来的水手长居然会熟练地使用钩锁，船长，你可赚大了。'] = '선배 항해사 라 능 수능 란 하 게 사용 낚다 자물쇠 를 선장 을 너 대 박 이다.', 
    ['这句话的意思是把猴封起来非常合我心意，这样海面上就会风平浪静。'] = '이 말 의 뜻 은 원숭이 봉 기 가 마음 에 들 어요 이런 바다 에 면 예외 였 다.', 
    ['这只船正在使用'] = '그러나 이 사용 하 고 있다', 
    ['这可是个好消息，也不枉费我多浪费了几天。我们现在就去改造吧，我早就想给旗舰多加两门火炮。'] = '이 좋 은 소식 을 하나 도 못 하지만 개 허비하다 나 여 낭비 지 냈 을 것 이다.우리 지금 갈 개조 세요, 제 가 예전 부터 에게 기함 (본지 5 월 두 문 포 사격 을 했 다.', 
    ['这可是个好消息，我早就想给旗舰上多加装两门火炮了。'] = '그러나 개 반 가운 소식 이 난 벌써부터 을 주 고 싶다 " 며 " 기함 에 여 加装 두 문 주포 했 다.', 
    ['这可是个好消息，马上就去造船厂。'] = '김 정 일 국방 위원장 이 개 소식 을 금방 갈 게 조선소 를 세 웠 다.', 
    ['这可是好东西！这上面记录着经历丰富的冒险家们的毕生经验.交给你的航海士阅读，可以提升阅历，增长知识。'] = '김 정 일 국방 위원장 이 좋다 는 것!그 위 기록 하 고 경험 이 풍 부 한 모험 가 들 의 경험 이다. 당신 께 필생 의 항해사 읽기, 높이 정도 연륜 에 성장 지식 이다.', 
    ['这可真是个好地方呢！茂密的丛林和辽阔的草原，看来这是个适合发展，值得投资的好地方呢！'] = '참으로 좋 은 곳 일 까!울 창 한 숲 과 광 활 한 사바나, 이것 이 적 합 발전 을 투자 할 만 한 좋 은 장소 입 었 어요!', 
    ['这可真是个好消息，戴肯叔叔。就按您说的办。'] = '참으로 개 소식 을 착 용해 켄 아저씨.말씀 하 신 대로 처리하다.', 
    ['这场战役实在是太惊险了，没想到陈祖义如此心狠手辣，竟然都是下死手。'] = '전쟁 은 너무 스릴 러 더니 이렇게 陈祖义 냉흑하다 手辣 명세 를 보 면 모두 아래 죽 손 에 넘 어 갔 다.', 
    ['这场战斗真是艰难，维达号名不虚传！'] = '이 전투 정말 어 려 워 앤 호 명성!', 
    ['这场荒唐的战争该结束了，我会向民众证明这场战争是个错误，你们只是无辜的受害者。'] = '이번 터무니 없 는 전쟁 이 끝 났 고, 께 민중 입증 이 전쟁 이 잘못 된 것 으로 밖 에 보지 않 고 선 의의 피해 자가 이다.', 
    ['这块冰看起来没什么威胁，不过我们还是轰碎它吧，别让它挡着路。'] = '이 얼음 처 럼 보이 지만 별 위협 이라고 우리 는 그것 을 쾅 spacer) 를 만 들 어 봐, 그것 이 놓 여 있다 고 길 게 하지 마 세요.', 
    ['这块大陆上要什么有什么。'] = '이 대륙 에서 무슨 무슨 이다.', 
    ['这大英帝国可真舍得下这么大的血本……'] = '이 대 영 제국 도 참 사장직 에 이렇게 큰 낭패....', 
    ['这对你来说的确有失公平，难道你要因此卸下你肩上的责任？'] = '너 한테 사실 이 공정 하지 않 으며 < 설마 하 기 때문에 하역 너 의 어깨 는 책임 을 질 것 인가.', 
    ['这就明了了！海盗其实是有两拨，一波是真正的海盗，而另一波则是……来不及了，我们火速赶往卡利卡特增援！'] = '이 명 료!해적 사실은 두 배제하다 을 파 는 진 정한 해적 으로, 다른 한 파 는 것 은.시 간이 촉 박해 요, 우리 권유 로 칼 리 카 터 증원!', 
    ['这就是糖胶？真想不到长相那么凶恶的乌加尔·马丁能用这些东西做出那么精制的糖人。'] = '이것 이 바로 사탕 아교?정말 의외이다 얼굴 면 흉 악한 우 갈 마 틴 쓸 물건 들 에 대해 그렇게 정제 된 糖人 이다.', 
    ['这就是索法拉么？看起来就像个小渔村呀！'] = '이것 이 바로 소 페 라 해 야 돼 요?럼 개 작 은 어촌!', 
    ['这就是那群海盗的首领了'] = '이것 이 바로 그 군 해적 들 의 수령 했 다', 
    ['这就足够了！愿诸神保佑你我，如果有机会，我一定回来助你一臂之力！以报答你的慷慨援助！'] = '그 걸 로!원하다 제 신 가호 너 나 할 기회 가 되 면 꼭 돌 아 와! 너 에 힘 을 실 어 줄 협조하다너 의 지원 으로 보답 격앙하다!', 
    ['这帮混蛋！'] = '이 방 버르장머리!', 
    ['这年月想做海盗的比想做骑士的还多！'] = '이 연 월 차 를 하 고 싶 은 해적 들 의 보다 뭔 가 보 여주 고 싶 은데 기사 는 또 여!', 
    ['这并非易事，我想我们需要准备充分才行。'] = '이 기 가 쉽 지 않 아 이렇게 해 야 충분히 대비 해 야만 한 다.', 
    ['这座城市原来是玛雅人的特奥城。'] = '이 도시 는 원래 마야 사람 의 테 성.', 
    ['这座城市的实际统治者不是总督，而是银行家们。'] = '이 도시 는 실제 통치 자가 아니 총독 이 아 니라 은행가 들.', 
    ['这座城市的年纪比葡萄牙王国的年纪还大呢！'] = '이 도시 는 포 르 투 갈 나이 보다 왕국 의 어린 나이 를 대 할 것 이다!', 
    ['这座岛被称为印度洋上的明珠。'] = '이 라 는 섬 으로 불 리 는 인도양 에서 훌 륭 한 인물 이다.', 
    ['这座港口是从穆斯林的手中夺来的。'] = '이 항구 는 무 슬 림 의 빼 앗 아 온 다.', 
    ['这座港口是根据圣经中的圣多美日命名的。'] = '이 항구 는 성경 중 성 자기 일 이 붙 인 이름 이다.', 
    ['这座港口没什么有意思的东西。'] = '이 항구 별 재미 있 는 것 이다.', 
    ['这座贸易港可真繁盛，人们都在港口边忙碌。'] = '이 무역항 도 참 번창 하 고, 사람들 은 항구 변 분주하다.', 
    ['这很突然……'] = '이 갑 작 스 러 운....', 
    ['这我倒是没意见，那家伙差点害我没命，不过，我要先到加尔各答一趟，顺便还个欠下的人情。'] = '이 꼭 의견 없 어. 그룹 에서 그놈 뻔 했 나 를 해 치 는 것 과 는 그러나 내 가 먼저 까지 콜 카 타) 를 덤 으로 개 빚 에서 발간 된 다.', 
    ['这我倒是还没考虑过，你可以说说你的条件，太难的要求我可做不到。'] = '이 꼭 도 생각 해 본 을 여유 있 게 자 신의 의 조건 을 요구 할 수 있 는 힘 내 가 안 된 다고 한 다.', 
    ['这战力，并不是贩奴船！而是普通的商船！'] = '이 전력 만 있 는 것 은 아니다. 행상인 노예 배!아 닌 통상 적 인 상선!', 
    ['这才是我葡萄牙的勇士！正好，最近威尼斯联邦牵头组建神圣联盟，准备讨伐奥斯曼海军，奥斯曼海军统帅正是巴巴罗萨，第一块信物就在他手中。'] = '그것 이 바로 내 포 르 투 갈 의 용사!마침 최근 베 네 치아 연방 주선 구성 신성 한 연맹 을 준비 토벌하다 오 스 만 해군 을 오 스 만 해군 통수권 자 바로 바 버 로 살 을 제 친 것 은 확신 하나 로 넘 어 갔 다.', 
    ['这支神秘的工匠锤是工匠公会的信物，有了它就可以找到那些臭脾气的老工匠协助我们改造船只'] = '이 부대 는 신비 의 장인 망치질 을 장인 공회 한 다 는 확신 을 가 졌 는지 그것 을 찾 을 수 있다 는 그 냄새 난 기질 로 장인 협조 개조 해 선박 이다', 
    ['这支神秘的工匠锤是工匠公会的信物，有了它就可以找到那些臭脾气的老工匠协助我们改造船只。不过那些臭脾气的老工匠C级以下的船只可看不上眼。前往【舰队】，改造C级或以上船舶'] = '이 부대 는 신비 의 장인 망치질 을 장인 공회 한 다 는 확신 을 가 졌 는지 그것 을 찾 을 수 있다 는 그 냄새 난 기질 로 장인 협조 개조 해 선박 이다.하지만 구리다 성벽 의 노 장인 C 급 이하 배 들이 하지 않 눈 이 었 다.[함대 를 찾 아가 괴뢰 호 전광 들이 개조 C 등급 또는 이상 선박 이다', 
    ['这是一个大海贼时代，前往伟大的航路吧！'] = '이 는 큰 해적 시대 를 찾 아가 위 대한 항로 시다!', 
    ['这是一张记录着宝藏埋藏地的地图。'] = '이것 은 한 장 기록 하 고 망 매장 지로 의 지도.', 
    ['这是一点小小的心意顾问先生，您看能不能通融一下……'] = '이 는 작 은 마음 고문 선생 을 수 있 을지 융통 해 보 십 시 오.', 
    ['这是个锤子？'] = '이것 은 망치?', 
    ['这是什么东西？船上的渔网居然没人会用，还是离这个怪物远一点吧！'] = '이 는 어떤 물건 입 니까?선상 한 그 물망 이 의외로 할 사람 이 없다. 용 으로 는 이 괴물 에서 멀찌감치 떨 어 합 시다!', 
    ['这是什么？'] = '이것 은 무엇 입 니까?', 
    ['这是冒险家协会为新人冒险家的准备的宝物精华，这些足够你把这门火炮提升一阶，不过，之后升阶所需的宝物精华，只有通过冒险来获得了。'] = '이 는 모험 가 협회 는 신인 모험 가 의 준비 의 보물 이 충분한 추출물 이 문 주포 올 리 준위 로 하지만 뒤 l 당 계급 에 필요 한 보물 에센스 를 통 해서 만 모험 을 얻 었 다.', 
    ['这是刚刚那个废物口中“美丽的宝瓶”——塞壬低语魔瓶，可笑的家伙，居然只把它当做一个美丽的装饰品，真是愚蠢！'] = '이 는 방금 저 폐기물. \' 아름 다운 宝瓶 \' 인 세 임 누 난 마귀 병 을 웃 기 는 놈 안하무인 만 놓 고 그것 을 하나의 아름 다운 장식품, 정말!', 
    ['这是因为贪婪！从战争英雄到成功商人，到最后沦为恶贯满盈的海盗，是欲望与贪婪使你变得多面……'] = '이 욕심 때문!에서 전쟁 영웅 으로 성 공한 기업인 을 마지막 까지 로 전락 한 해적 들 은 (this guy 욕망 과 탐욕 으로 당신 이 다면....', 
    ['这是塞壬低语魔瓶，它就能创造出真实的幻境，你曾打败过的敌人会以更强大的姿态重新出现。挑战并打败他们，你就会得到魔瓶上一任主人——迪亚士封印在里面的奖励。'] = '이것 은 세 임 누 난 마귀 병 을 를 창출 할 수 있다 며 진 실의 영웅적인 남자, 당신 은 꺾 하는 자 들 에게 는 더 강력 한 모습 다시 살 아 났 다.도전 을 꺾 고 그들 을 당신 을 받 으면 마귀 병 전임 주인 인 디 아 스 의 봉인 을 뜯 는 인센티브 를 주 기로 했 다.', 
    ['这是我为拯救昔日故友的一点心意，你不用推辞，现在我帮助你，以后我会需要你的帮助……'] = '이것 은 내 가 구출 을 위해 왕년 의 故友 저의 성의 예 를 자네 고사 에도 불구 하 고 이제 내 가 너 를 도 와 줄 을 앞으로 당신 이 필요 한 도움.', 
    ['这是我们应做的，夺回巴塞罗那只是开始，我们的目标是彻底消灭敌人！可惜我的人手不足，您是一名航海士？'] = '이것 은 우리 의 할 바 르 셀 로 나 를 탈환 시작 일 뿐, 우리 의 목표 는 철저히 섬멸 적!아 는데 한 일손 부족, 당신 은 한 명 항해사?', 
    ['这是汉萨同盟最强的力量，正面强攻无异于以卵击石，先攻击旁边的护卫船，瓦解他们防线，最后围歼这只“雄鹰”。'] = '이 는 한 사 동맹 최강 의 힘 으로 정면 강공 을 먼저 계란 으로 바 위치 기예 요 나 다름없다 공격 옆 의 호위 를 받 으며 배 를 와해 그들 수비진 을 마지막 포 위하여 섬멸하다 기만 독수리 \' 다.', 
    ['这是海洋女神之誓言，据传在它共有7块，分布在世界的七大海域之中，据说集齐七块碎片，才能获得面见女神的资格。这块碎片正是当年我亲手交给你父亲的一块……'] = '이 는 바다 의 여신 의 맹세 중상 을 입 은 것 은 모두 일곱 조각 으로 흩 어 져 사 는 세계 7 대 해역 에 한 것 으로 알 려 진 회 코 지 七块 파편 을 취득 할 수 있 도록 면담 여신 자격 을 얻 었 다.샅바 파편 이 바로 그해 제 손 으로 당신 께 아버지 의 하나.', 
