    ['那些被赶跑的强盗和赌徒听说在东南方的海岛上建立了一个叫做【圣多美】的港口，我必须过去看看，可不能让他们形成气候！'] = '갇 힌 퇴 출시 켰 던 강도 와 노름꾼 통일적 동남쪽 시 아 일 랜 드 에서 한 켠 세인 트 앤 디 의 항구 를 사육 하 고 자기 돈 을 꼭 과거 구경 할 수 있 지 못 하 도록 해 야 형성 기후!', 
