    ['那伙龙蛇混杂的欧洲海盗依仗自己船坚炮利，在南中国海到处设据点对往来商船肆意掠夺。'] = '그 놈 龙蛇 혼잡 유럽 해적 을 등에 업고 자 신의 船坚炮利, 남 중국 해 에서 곳곳 에 설치 거점 에 대한 왕래 상선 멋대로 약탈 이 었 다.', 
    ['那你是为了什么？'] = '그럼 당신 은 무엇 을 위해?', 
    ['那几位可得多加小心，我爹让我赶来告诉几位，汪直一直难以剿灭，除了其实力强大之外，还因为其与丰臣秀吉有着关系。'] = '그럼 몇 명 있다, 조심 하 고 나 오 게 했 다 저 자신 을 찾 아 온 아버지 에게 몇 위, 왕 직 고민 하 소탕 으로 세력 뿐 만 아 니라 그 막강 실력 외 에 그 와 도 요 토 미 히 데요 시 과 관계 다.', 
    ['那可是一场艰难的战斗，维达号名不虚传。'] = '그러나 그 한바탕 힘 겨 운 싸움 을 벌이 며 앤 호 명 불허 전이 었 다.', 
    ['那好吧，姑且就相信你们，但你们先协助我恢复开普敦的士气。'] = '그럼 알 았 어, 잠시 만 믿 지만 먼저 회복 협조 나 케 이 프 타운 의 사기 를 꺾 었 다.', 
    ['那好吧，您先告诉我，那群人是谁？'] = '그럼 알 았 어, 당신 먼저 말 하 더라 면서 그 사람들 은 누 구입 니까?', 
    ['那好，最新战报，我们反抗军秘密筹集物资的商队由于叛徒泄密，被围堵在霍尔木兹，希望你们能即刻赶赴那里，解救商队。'] = '그래, 최신 战报, 우리 군 의 저항 을 은 밀 하 게 조성 물자 상단 이 배신자 비밀 유출 이 틀 어 막 는 호 르 무 즈 를 줬 으면 즉각 에 사정 해 그곳 에서 구조 상단 이다.', 
    ['那家伙阴险狡诈，却偏偏有坚硬的城墙，让我们到亚齐集结，我安排内应到马六甲城里，到时候里应外合才能获得胜利。'] = '그놈 음흉하다 얄 미 운 상술 에 있 는 딱딱 한 성벽 을 우리 가 가 볍 게 이동 배 치가 아 체 결집 을 안 에서 말 라 카 성안, 나중에 저서 북조선 야 승리 의 주역 이 됐 다.', 
    ['那就一鼓作气，拿下他们！'] = '그럼 단숨에 뛰 며 그들!', 
    ['那就好，但愿他们能给我改造出我梦寐以求的火炮吧。'] = '그럼 좋아 하 면서 이 들 좀 개조 에 내 꿈 에 그리 던 주포 시다.', 
    ['那就是我的手杖，即不是偷来的也不是抢来的，你们别来烦我！'] = '바로 나 의 지팡이 를 이용, 즉 아니 훔 친 것 도 아니 고, 당신 이 빼 앗 은 마 짜증 나 를 무시 하는 거 야!', 
    ['那就是没得谈咯，你们真以为胜券在握了吗？人头在这，你倒是来拿啊！'] = '그것 은 바로 이야기 를 제대로 못 하늘나라 너희들 정말 당선 이 확 실 한 줄 알 았 었 어요?머리 를 싸 이, 당신 은 책상 앞 을 받 아!', 
    ['那就看看谁先到吧，【果阿】可不比卡利卡特差多少！'] = '그럼 누 가 먼저 도착 해 봐 라, 타이완 (열매 아 사육 하 고 있다. 도 되 지 않 은 수준 보다 칼 리 카 터!', 
    ['那已经可以称你为女强人了。'] = '그런 당신 을 만하다 \' 알파 걸 \' 했 다.', 
    ['那当然，能够全灭西班牙和意大利的联合舰队，那种成就感是你们无法理解的，啧啧！'] = '그것 은 물론 이 지 을 수 전 소멸시키다 스 페 인과 이탈리아 의 연합 함대 를 그런 성취감 은 너희들 이해 할 수 없 는, 쯧쯧!', 
    ['那快来试试吧，让他们看到我的实力！'] = '그럼 빨리 해 봐, 보 내 실력!', 
    ['那怎么样才算是等价交换？'] = '저것 은 어때요 영해 야 등가 교환?', 
    ['那您就此返航了吗？我想玛利亚一定很想念你。'] = '그럼 당신 이 귀 항 했 어요?생각 마리 아 일정 그리 워 했 다.', 
    ['那我们就主动出击，逐个击破！'] = '그럼 우리 에 스스로 출격 을 일일이 격파!', 
    ['那我们继续进发吧，世界的尽头，我拉比斯来了！'] = '그럼 우리 출발 합 시다 를 계속 세 상의 끝 나 라 비 스 왔 다!', 
    ['那是啥？投资文化港口赠送的航海士学习书籍！我记得那个谁说过学习使人气质高雅！我亲爱的船长，能让我试试吗？'] = '저것 은 나?투자 문화 항구 선물 한 항해사 학습서!그 기억 한 다고 공 부하 게 기질 고아!내 사랑 하는 선장 이 잘 살 수 있 는 제 가 한번 해 보 겠 습니까?', 
    ['那是自然，从你嘲讽我的那一天起，我就决定了，一定要亲手打败你，然后站在你面前轻蔑地说一声：虫子！'] = '그것 은 자연 을 당신 야유 를 보 내 는 그날 부터, 나 는 결정 이 났 을 손 으로 꺾 고 네 앞 에 서 있 게 경멸 에게 말 벌레 가!', 
    ['那是自然，那是自然，你简直和你的父亲一模一样。'] = '그것 은 자연, 저것 은 자연, 당신 은 소름 끼 치 도록 과 너 의 아버지 똑 같 았 다.', 
    ['那是阿姆斯特丹的守备军，快撤！'] = '그것 은 암 스 테 르 담 의 수비 군, 빨리 철회하다!', 
