    ['那现在可以炼制长生不老药了吗？'] = '그럼 지금 수 불 로 장 수의 약 을 드 셨 습니까?', 
    ['那群荷兰人似乎在打这里主意。'] = '그 떼 이 는 것 같 아 다 날 이곳 네덜란드 아이디어 다.', 
    ['那艘向我们快速驶来的船没有挂任何旗帜，有蹊跷！'] = '그럼 우리 에게 빠 르 게 따 라오 던 척 하지 않 은 어떤 걸 의 깃발 을 흔 들 며 의문!', 
    ['那艘是帆船！'] = '그럼 척 은 요트!', 
    ['那艘海盗船大摇大摆的过去了，他们连登船检查都没有！'] = '그 는 과거 척 해적선 으쓱으쓱. 그들 에게 连登 선박 검사 들이 없다!', 
    ['那还用说，我自然不会绕过他们。伙计们，起锚，出发！'] = '말 할 필요 있 는 건 가요, 내 가 없 게 마련 우회 훈수 를 두 었 다.점원 들 에 닻 을 출발 합 시다!', 
    ['那还磨蹭什么？如果不快点，要是让陈祖义听到了风声，攻破的难度肯定会加大！'] = '그것 도 우물쭈물 하 고 무엇 입 니까?하지 않 으면 빨리 을 기 쁘 게 듣 陈祖义 에 살짝 으로 골 을 터 뜨 난이도 긍정적 인 목소리 가 커 질!', 
    ['那还等什么，快回【巴士拉】去吧。'] = '무엇 을 기 다리 는 건 가요. 빨리 회 앤 디 바 스 라 사육 하 고 갑 시다.', 
    ['那还能有什么好消息……'] = '그럼 무슨 기 쁜 소식 이 전해 지고....', 
    ['那里的情况很不乐观，一伙海盗抢劫了港口，没有人敢往那儿去了。'] = '그곳 의 상황 이 만 만치 않다, 해적 일당 강도 항구 를 할 사람 은 없 을 그곳 에 갔습니다.', 
    ['那里进行大量的商品交易，启程前往看看吧。'] = '거기 대량 의 상품 거래 로 떠 났 어 봐.', 
