    ['邮件发送成功'] = '메일 발송 성공', 
    ['邮件已领取'] = '메일 이 수급', 
    ['郁金香深受法国贵族的喜爱，是尼德兰重要的出口货物。'] = '튤립 기복 이 심 한 프랑스 귀족 들 의 사랑 을 받 는 네덜란드 중요 한 수출 화물 이 실 려 있다.', 
    ['郊狼头盔'] = '시외 늑대 헬멧', 
    ['郑和下西洋时也曾到达过亚丁。'] = '그 정 화의 항해 때 도 아 덴 에 도착 했 다.', 
    ['郑和在亚丁买到的麒麟其实是长颈鹿。'] = '정 허 아 덴 만 에서 에 사 온 기린 사실 기린 아니 에요.', 
