    ['郑夫人是南中国海的海盗王。'] = '정 부인 은 남 중국 해 의 해적 왕 에 올 랐 다.', 
    ['郑夫人的义子张保仔也是狠角色。'] = '정 부인 의 붓 张保仔 도 매섭다 역 을 맡 았 다.', 
    ['郑成功'] = '정 성공', 
    ['郑成功先生，你的要求我们已经做到了，稍后我会去各处市政厅投资来复兴各处城镇。虽然不能弥补达尔布克基所做的万一，我也算是尽我所能了。至于道歉什么的，我想就不需要了，告辞。'] = '지난달 정 씨, 너 는 우리 는 이미 요구 해 냈 다. 나중에 찾 아가 기 웃 거리 곳곳 에서 시청 투자 로 부흥 곳곳 을 일 컫 는 말 이다.보완 할 수 는 없다. 다 르 보 크 스키 가 한 만일, 저 도 라도 달 라며 최선 을 다 해 했 다.회심 사과 를 하 고 싶 은 필요 없 어요, 하직하다 이다.', 
    ['郑成功吗？还真是个有趣的人。'] = '정 성공 인가.정말 재미 있 는 사람 이다.', 
    ['郑成功率领军队从鹿耳门突击过来了，准备迎战。'] = '정 성공 을 이 끌 고 군 은 사슴 耳门 돌격 우루무치 에 왔 을 정 도로 상해.', 
    ['郑成功的军队已经突破到了普罗民遮城，快加入防御。'] = '정 성공 하는 군 이 이미 돌파 로 프로 민 숨기다 성, 빨리 가입 방어 이다.', 
    ['郑成功的船队涌入了台江内海，他们的大船在内海移动会受到限制，这是我们的好机会！'] = '정 성공 선단 이 몰 렸 台江 내 해 그들 의 큰 배 를 포함 해 이동 제한 될 수 밖 에 없 고, 이것 이 우리 의 좋 은 기회!', 
    ['郑氏令旗'] = '정 씨 가 영장 기', 
    ['郑石氏'] = '郑石氏', 
    ['郑石氏虽然被捕，但红旗帮还有郑石氏的义子张保仔坐镇，他联合了黑旗帮等其他海盗帮派组成大联盟，直接挑衅前来围剿的官军。这些年来，郑石氏虽然是名义上的领袖，但是更加年轻、狠辣的张保仔俨然已成长为带领红旗帮百战百胜的灵魂人物。'] = '郑石氏 은 구속 됐 지만 붉 은 깃발 도 郑石氏 방 의 붓 张保仔 부재, 그 합동 검 은 깃발 등 다른 해적 패거리 구성 메이저리그 를 직접 찾 아 토벌 작전 의 관군 도발 이다.그 동안 郑石氏 은 명목상 의 리더 가 될 수 있 지만 보다 젊 고 다잡다 매 운 张保仔 엄연히 을 이 끌 고 방 백 전 백 승 홍 치 의 중진 이다.', 
    ['郑芝龙'] = '郑芝龙', 
    ['郑芝龙拥护了逃亡的中国皇帝，趁他们立足未稳，加紧进攻！'] = '郑芝龙 망명 을 옹호 하는 중국 황제 들 을 틈 타 立足未稳 공격 을 서두 르 고!', 
    ['郑芝龙是可以跟陈祖义抗衡的人物。'] = '郑芝龙 은 할 수 있다 는 점 을 陈祖义 에 맞 서 는 인물 이다.', 
    ['郑芝龙爪牙'] = '郑芝龙 정치 브로커', 
