    ['阿拉伯人。一副没睡醒的样子，对什么事都缺乏兴趣。因为作战勇猛闯出了名头，加上落魄的气质和标准的水手打扮，意外地受到年轻人的追捧。'] = '아랍인 들.1 부 잠 이 깨 지 않 는 모습 이 고 무슨 일 이 부족 했 다 는 관심 을 보 여 왔 다.때문에 작전 용맹 냈 을 대폭 강화 하 고 있 는 데다, 허 름 한 기질 과 기준 의 캔 자 스 시 티 차림 에, 의외로 받 젊은이 들 의 취재 경쟁 을 벌 였 다.', 
    ['阿拉伯人。家族在丝绸之路时代就是行商，如今是庞大的商业帝国。他对家族挑拨战争并大发战争财的行为十分不满，一直搜集证据试图推翻贪婪奢侈的长辈。'] = '아랍인 들.가족 이 실크로드 시대 는 행상. 이제 는 막 대한 상업 제국 이 었 다.그 는 가족 에 대한 전쟁 을 하 고 대 박이 야 전쟁 행위 가 돈 을 버 는 불만 을 터 뜨 증거 수집 복시 키 려 탐욕 사 치스 러 운 어른 이다.', 
    ['阿拉伯人。生于香料世家，擅长品鉴香料和美酒，据说站在亚历山大可以闻到苏伊士靠岸的香料船。业余是刀剑收藏家，熟悉各种近战武器的用法。'] = '아랍인 들.향료 명문가 에서 태 어 品鉴 향료 와 술 을 잘 한 것 으로 알 려 진 역 은 알 렉 산 더 있 수 에 즈 접 안 하는 향신료 배 였 다.아마추어 수집가 들 은 칼 에 익 숙 한 각종 近战 무기 사용법 이다.', 
