    ['陈祖义在广东沿海一带烧杀抢掠，无恶不作，附近海域的百姓深受其罪，现在他跑到东南海域兴风作浪，大明海军岂能姑息养奸！'] = '陈祖义 는 광 둥 성 연해 일대 烧杀 강탈 을 无恶不作, 인근 해역 의 서민 들 의 죄 를 지금 뛰 기 까지 동남쪽 해상 에서 보고 숲 을 대명 해군 따위 姑息养奸!', 
    ['陈祖义在这片海域盘踞已久，势力盘根错节，如果直接冲向大本营，很可能无功而返，甚至有可能丧失生命。'] = '이 陈祖义 앞바다 로 도사리다 이미 오래 전부터 준비 를 세력 논리 직접 돌진 베이스 캠프 될 가능성 이 점 쳐 지고 돌 아서야 가능성 이 높 아 져 목숨 을 잃 는 다.', 
    ['陈祖义已经在这一代霸陵已久，手下人马众多，没有完全的准备不宜轻易的发起战争，升级改造我们的船只，胜率也会更大一些。'] = '陈祖义 이미 이 세대 는 이미 오래 전부터 1556km 릉 을 밑 에서 군대 를 완전히 없 는 많은 준비 를 쉽게 예단 을 갖 는 전쟁 을 시작 으로 개조 우리 선박 을 승률 도 더 많 을 수 있다.', 
    ['陈祖义是明朝的船王，来到东南亚做了海盗。'] = '陈祖义 은 명 나라 의 船王 을 찾 은 동 남아 해적 모습 을 드 러 냈 다.', 
    ['陈祖义狂妄无度，横行东南亚多年，是时候将他连根拔起了。但他的实力不容小觑，小心为上。'] = '陈祖义 광기 를 듣 도록 암담한 동 남아 여 년 을 움 직 여야 할 때 입 은 그 뿌리 를 했 다.그러나 그 의 실력 만만 찮 아 조심 을 에서 다.', 
    ['陈祖义的海上战术是出了名的诡谲，最善使用谋略，多次从大明海军手中逃脱，下一个目标$(missioncolor:【泗水】)他估计已经设下了陷阱。'] = '陈祖义 의 해상 전술 을 드 러 내지 않 는 诡谲 가장 선 사용 터전 으로 부터 여러 차례 대명 해군 탈출 에 성 공한 다음 목표 $(missioncolor: 수 라 바 야 사육 하 고 있다. 그 는 추정) 이 말 려 함정 이 있 었 다.', 
    ['陈祖义麾下的南洋海盗控制了东南亚的所有咽喉要道，如果我们想打败他，那就必须杀出一条血路。'] = '陈祖义 휘하 에 남양 해적 통제 했 다. 동 남아 의 모든 인두 길목 을 우리 가 그 를 이기 고 싶다 면 해 야 한 다. 血路 승전', 
    ['陈祖义麾下的南洋海盗控制了东南亚的所有咽喉要道，摧毁他们。'] = '陈祖义 휘하 에 남양 해적 통제 했 다. 동 남아 의 모든 인두 길목 을 파괴 그들 이다.', 
    ['陈祖义，你作恶多端，如今你的手下都弃暗投明离你而去，你还不束手就擒？'] = '陈祖义, 당신 에 빌 많 고 이제 너 의 밑 에서 모두 弃暗投明 틀 어, 당신 아직도 못 탈당 하는?', 
