    ['降低进入光环影响范围的敌军舰船速度，与增加速度数值一致。'] = '낮 춰 후광 영향권 에 들 어가 는 적군 과 함선 속도 를 빠 른 속 도로 증가 수치 일치 한 다.', 
    ['除了可以用来制作面包，也能酿造成口味浓烈的【伏特加、威士忌、琴酒】。'] = '외 용 으로 활용 할 수 있 어 빵 을 거 머 쥘 수 있 는 술 에 입맛 남성미 거장, 위스키 보드카 · 칵테일 사육 하 고 있다.', 
    ['除了在大城市设立贸易中心以外，汉萨同盟还在小岛和岛礁上建立了很多小型补给商站。'] = '은 대도시 설립 무역 센터 외 에 한 사 동맹 은 섬 과 岛礁 누리 에서 많은 소형 보급 상 역 에 도착 했 다.', 
