    ['除了葡萄牙似乎还有荷兰的人马，伴随着发展与扩张的，永远都是掠夺与牺牲，看来任何国家任何民族都不例外。'] = '포 르 투 갈 듯 외 에는 네덜란드 의 군대, 의용군 발전 과 확장 을 영원히 모두 약탈 과 희생 이 역 을 맡 은 어느 나라 어느 민족 도 예 외가 아니다.', 
