    ['陶斯印第安村保存了一系列的居民点和仪式中心，是具有史前传统的阿那萨基印第安部落文化的典型代表，村落可能出现在公元1400年以前，并且是由瓜得鲁普爵士条约确定的边界北部保存的最好的村落。'] = '陶斯 인디언 마을 보존 돼 있 는 일 련 의 居民点 와 식 센터 로 사상 전통 의 아 그 사 키 인디언 문화 는 전형적 인 대표, 마을 에 나 타 날 수 있 는 기원전 1400 년 이전 에 해당 되 는 것 이 며 이 과다 하 게 푸 재즈 조약 확정 된 경계 북부 보존 을 위 한 최고의 마을.', 
