    ['随着政治、信仰、领土及商业竞争等领域摩擦的升温，基督教国家与强大的奥斯曼帝国之间的战事已是无法避免。在希腊勒班陀近海，由西班牙王国、威尼斯共和国、教皇国、萨伏依公国、热那亚共和国及马耳他骑士团组成的神圣同盟即将与雄霸地中海的奥斯曼海军展开一场空前绝后的海战，这场战役，将最终决定的绝不仅仅是海军的胜负！'] = '정치, 종교, 영토 및 상업 경쟁 등 분야 마찰 의 가열 되 면서 기독교 국가 와 강력 한 오 스 만 제국 간 의 전쟁 은 불가 피 할 것 으로 보 인 다.그리스 르 반 레 비 스 트 로 스 페 인 근해 에서 왕국, 베 네 치아 공화국, 教皇国, 사 엎드리다 쟈 공국, 제 노 바 공화국 및 몰타 骑士团 로 구성 된 신성 동맹 을 앞 두 고 " 雄霸 지중해 의 오 스 만 해군 벌이 는 전무 후 무한 공 허 한 메아리 전 해전 에 명운 을 대상 으로 최종 결정 은 결코 해군 의 승부!', 
    ['随着欧洲人的扩张，对于霍尔木兹海峡的争夺已经无可避免，加入保护海峡的防御力量，抵御敌人的进攻。'] = '유럽 인의 확장 에 대해 호 르 무 즈 해협 의 다툼 이 불가피하다 고 가입 보호 해협 의 방어 력 을 견 뎌 낸 적 인 공세 에 나 서고 있다.', 
    ['随着等级提升开放四个专用建筑，命令手下赋闲的航海士完成对应营地任务，获取丰厚的任务奖励及航海士经验！'] = '됨 에 따 라 등급 을 개방 네 전용 건물 을 명령 밑 에서 등장 한 항해사 대응 임무 를 완수 주둔지 취득 푸 짐 한 임무 장려 및 항해사 경험!', 
    ['随着航程越来越远，要在各个海域间航行的时间越来越长，像我们这次前往北海，不知要航行多久，真是头疼啊。'] = '항행 노정 면서 점점 멀 어 져 이 여러 해역 간 항해 할 수 있 는 시 간이 길 어 지고, 우리 처 럼 이번 행 북해 를 항해 가 얼마나 갈 지 모 른 다 " 라며.', 
    ['随着黑胡子的声威日盛，越来越多的零散海盗希望投靠到他的麾下，证明你的实力，不止是战船的威力，还有你的坚定和无情！'] = '따 라 는 흑 수염 声威 일 번성 하는 경향 이 강 해 지고 영세 해적 희망 전향 까지 그 의 영향권 을 증명 하는 실력 을 뿐 아 니라 배가 의 위력 을 그리고 너 의 확 고 한 과 무 자비!', 
